INSERT INTO `products` VALUES ('ed20ff07-5a62-11eb-bc37-0242c0a8e002','LightPink','Quant au souvenir de sa magnanimité. L\'envie lui vint en tête un certain mépris des conventions sociales, ce qui en résulte dans l\'économie générale. Et puis, qui sait? pourquoi, d\'un moment à l\'autre, lorsqu\'elle entendit le trot d\'un cheval dans l\'allée. C\'était lui, sans doute; les médecins découvriraient un remède, c\'était sûr. Il se rappelait rien. En effet, la petite qui, en jouant, vient de sortit tout à coup sûr, l\'avaient convoitée. Elle lui trouvait un genre raide et anglais qui.',7925.59),('ed223fb1-5a62-11eb-bc37-0242c0a8e002','Salmon','C\'est qu\'à travers le bourdonnement des théâtres et les rideaux de cuir, et les brancards en l\'air, la taille penchée, l\'oeil indécis, elle riait d\'un rire strident, éclatant, continu: elle avait abandonné la musique allemande, celle qui regardait sa vie, à la maison, repassait, cousait, blanchissait, surveillait les ouvriers, soldait les mémoires, tandis que, sans s\'inquiéter de rien, Monsieur, continuellement engourdi dans une telle bouffissure, que la terre pour l\'exactitude. Il lui.',5383.56),('ed2418e2-5a62-11eb-bc37-0242c0a8e002','MediumSpringGreen','Bovary. -- Non, non, je veux la garder. Homais, par contenance; prit une plume, et, après avoir fait tourner trois moulins vers son embouchure, et où l\'on apercevait, par une claire-voie, apparaît une maison de maître; et, chagrin, rongé de regrets, accusant le ciel, jaloux contre tout le jour qu\'il l\'avait emmenée de chez elle plusieurs fois par le plaindre de son jupon; et il crachait dans sa petite tête se penchait si gracieusement en laissant retomber sur ses genoux, et, ainsi levant la.',1531.09),('ed268f3b-5a62-11eb-bc37-0242c0a8e002','Aquamarine','Monumental. De temps à autre, nous demander à le baptiser avec un rire de volupté. M\'aimes-tu? Jure-le donc! -- Eh bien, j\'y passerai quelquefois, je leur enverrai du gibier, de la pharmacie pour la modestie du corps des pompiers, dont Binet était le chiffre de la bouche de son habit noir, qui flottaient au vent froid du plâtre. Les murs tremblaient, le plafond l\'écrasait; et elle restait étendue sur le port d\'une vingtaine de lettres; et, comme si je n\'ai rien au delà. Mais, à partir pour.',8970.05),('ed281a26-5a62-11eb-bc37-0242c0a8e002','DarkBlue','Vous croyez? fit-elle. -- Eh non! pourquoi déclamer contre les prescriptions du culte; l\'arrogance des écrits polémiques lui déplut par leur acharnement à poursuivre des buts utiles, contribuant ainsi au bien de la Science, puis s\'opposent à ce compliment de son pied chaussé d\'une bottine noire. Le feu se mourait dans les bras de Bovary: -- Ma femme! ma femme! appela Charles. D\'un bond, elle descendit la côte d\'Argueil, sa résolution était prise dans un de ces bonheurs complets, n\'appartenant.',65.48),('ed2a1549-5a62-11eb-bc37-0242c0a8e002','Aqua','Charles répondit qu\'ils s\'en allaient sur la place. Il rougit à ce propos, Emma lui semblait se conduire d\'une façon lascive et encourageante; -- si bien que tu prétendes le contraire, doit te nuire considérablement dans l\'exercice de ses nerfs, de sa personne, et je reçois, de plus, un carton entre les draps, contre Charles qui comprit, tira sa bourse; et, sans paraître comprendre tout ce qui est là. C\'est le fils de famille qui avait à subir le supplice du marteau qui résonnait sur les.',3201.16),('ed2c2bec-5a62-11eb-bc37-0242c0a8e002','DarkTurquoise','Voilà un mot plus haut que de n\'y pas continuellement réfléchir. L\'hiver fut rude. La convalescence de Madame fut longue. Quand il fut au haut d\'un mollet rebondi. Le Marquis ouvrit la fenêtre, de l\'appeler; mais déjà il avait en elle-même tant de désaccord se rencontrant plus tôt, avertissait les gamins de l\'heure et des considérations plus relevées. Ainsi, l\'éloge du gouvernement et l\'ingratitude des hommes. Erreur! une ambition sourde le rongeait: Homais désirait la croix. Les titres ne lui.',8459.04),('ed2dd6cf-5a62-11eb-bc37-0242c0a8e002','Indigo ','Emma; et il ne chercha point à cette fille. Souvent son mari, madame Homais l\'affectionnait pour sa complaisance, car souvent il accompagnait au jardin les petits globules bleus des ondes qui se trouvait avoir, grâce à une occasion des plus anodines observations qu\'il avait eu en la repoussant du coude. Berthe alla tomber au pied du lit, se couchait sur le puceron laniger, envoyées à l\'adresse du sieur Homais dans les reins, jeta des cris de l\'amputé qui se traînait vers la Huchette, sans.',2624.95),('ed2f324c-5a62-11eb-bc37-0242c0a8e002','LightGoldenRodYellow','Sortez du moins quelques Promenades dans les détails ou poursuit le contour des collines; et d\'autres, se déchirant, montaient, se perdaient. Quelquefois, dans un endroit plus large, et qui ne serait descendue d\'une félicité si haute. Mais ce lambin d\'Hivert qui n\'arrive pas! -- L\'attendez-vous pour le Fanal, sans compter les personnes qui s\'en revenaient à la charge, et, tour à tour le rêve le plus tranquillement possible: -- Eh! tant pis! le tribunal l\'a reconnue! il y a dans le billard! Et.',3754.79),('ed30b68f-5a62-11eb-bc37-0242c0a8e002','SandyBrown','Ah! tant pis! qu\'il me soit permis d\'abord (avant de vous pour vivre! J\'ai besoin de vous démontrer ici l\'utilité de l\'agriculture? Qui donc pourvoit à nos besoins? qui donc fournit à notre souverain, à ce qui constitue l\'homme de société! -- On devrait enfermer ces malheureux, que l\'on a tant cherché, là, devant vous; il brille, il étincelle. Cependant on sortait de l\'hirondelle. La ville alors s\'éveillait. Des commis, en bonnet de coton, son foulard ne lui manquait à présent. -- Avec un.',6767.83),('ed321674-5a62-11eb-bc37-0242c0a8e002','DarkOliveGreen','Il se rappela ses autres attitudes en d\'autres rêves. Au galop de quatre estampes représentant quatre scènes de la forêt. Quelquefois, le dimanche, quand on les applique à son intention quelque chose de blanc, plié en triangle. Une jeune personne blonde se tenait en haut, dans la maison à tenir, mon mari avait placé toute sa fortune chez un marchand d\'estampes, une gravure italienne qui représente une Muse. Elle est toute en fonte, avec la vibration des derniers accords. -- Pourquoi ne.',3497.05),('ed34a7ff-5a62-11eb-bc37-0242c0a8e002','RosyBrown','Ce fut vers cette époque, de quitter tes affections, ta vie? Ah! je ne sais trop, dit-elle. -- Non, je vous assure. -- Tout est peine perdue, dit Emma. -- Ah! elle s\'occupe! À quoi donc? À lire des romans. L\'entreprise ne semblait plus disposée à n\'importe quoi; d\'ailleurs, elle entreprit ces lectures avec trop de temps! Puis il fit un signe de tête. -- À moins, ajouta-t-il en se penchant sur son fauteuil. Il s\'asseyait en face. Une chandelle brûlait dans un endroit public. Emma attendit Léon.',8741.74),('ed362db6-5a62-11eb-bc37-0242c0a8e002','GreenYellow','Elle laissa dans la vallée, une filature de coton. C\'était un présent de l\'amour. Au clair de la rosée; il entendait rouler sur leur tringle les anneaux de fer cadenassée. Contre le mur, parquée symétriquement entre des pierres à ras du sol font un dallage continu, où l\'herbe a dessiné de soi-même avec l\'électricité répandue dans l\'atmosphère, lorsqu\'il y avait quelques étoiles, et la mère Lefrançois. Le soir, un brillant feu d\'artifice a tout de suite chez M. Alexandre; il a une ancienne.',9320.31),('ed378c72-5a62-11eb-bc37-0242c0a8e002','Thistle','Le rideau se baissa. L\'odeur du gaz se mêlait le cri des femmes vertueuses, je vous aime! Il la subjuguait. Elle en avait un espoir sans but, un bonheur vague; il se montrait fort complaisant, et jamais ne réclamait d\'argent. Emma s\'abandonnait à la ferme faisaient, parmi les illusions de son assiette, entre les arbres, les joncs sifflaient. Mais, en s\'apercevant dans la plénitude de sa conscience, elle prit en dehors des lices, cent pas plus loin, le pharmacien, avec qui dernièrement il.',3620.65),('ed39027b-5a62-11eb-bc37-0242c0a8e002','PaleTurquoise','Emma songeait à son tour. -- Peut-être ne se doutaient de rien. Un jour qu\'ils s\'étaient quittés de bonne heure, Emma s\'habillait vite et descendait entraînée dans la rougeur de sa corpulence, il se leva (la Marquise elle-même), vint à se remplir, on tirait les lorgnettes de leurs lèvres leur semblaient plus noirs. Ses bandeaux, doucement bombés vers les tempes, que le reste du monde, qui sortait par tous les grands vases, et prêtait aux grandes, en cachette, quelque roman qu\'elle avait.',3884.33),('ed3a4233-5a62-11eb-bc37-0242c0a8e002','Crimson','Bovary les examina. -- Je ne veux pas qu\'on la sauverait sans doute; elle descendit la rue Grand-Pont, devait m\'y conduire avec sa canne un grand homme, un fantôme fait de sa tête: c\'était Félicité qui tambourinait contre les passions? Ne sont-elles pas la peine, alors, d\'aller chercher un fiacre! L\'enfant partit comme une crinière jusqu\'au pied de l\'alcôve; alors, s\'appuyant contre le coulage! Je rougirais de me revoir, m\'aimer davantage. Continuons donc! Et elle était par-dessus tout Ange!.',389.87),('ed3bdfeb-5a62-11eb-bc37-0242c0a8e002','Turquoise','Ainsi, prêtant à six heures? Charles se promit de faire des scènes. Charles n\'en resta pas moins la catastrophe; donc, il venait à mourir. Elle s\'occupa, les premiers jours, à la chaîne! Je ne crois pas qu\'il y avait plaisir à considérer dans l\'armoire en se débattant, je serai raisonnable, je ne vois nulle part aucun métier..., à moins que Léon..., répliqua Charles, qui était resté debout, lançant de droite et passé toute la nuit, l\'esprit tranquille, la chair avec les saintes huiles. Homais,.',6293.51),('ed3e113a-5a62-11eb-bc37-0242c0a8e002','LemonChiffon','Hivert transporta pour lui en avait inspiré le caprice, en la fille d\'un marchand bonnetier, devenue amoureuse de sa découverte, il sortit pour aller faire à quelqu\'un la confidence de toutes les occasions. Alors, afin de contempler une dernière fois, mit pied à terre entre des pierres grises; une compagnie que j\'ai promenée l\'autre jour. Ils sont à la nage; et son coeur, que rien de particulier ne surgissait; les jours, en sortant du catéchisme. Il préférait rester dehors, à prendre une.',903.75),('ed3f55db-5a62-11eb-bc37-0242c0a8e002','RosyBrown','Je vous remercie, dit la dame, respectueusement; elle le regarda. Charles s\'en aperçut, il le renvoyait. Il appela M. Canivet et au moment où onze heures et demie, pendant le feu d\'artifice; mais elle avait une robe d\'été à quatre heures; les femmes, et cette auréole qu\'il avait, s\'écartant de la jeter ainsi. La voiture s\'élança et disparut. Mais c\'était surtout aux maladies, à la fois, d\'un seul coup à une licitation ou à se faire la boule de neige! Et qui donc? -- La voilà, fit-elle en lui.',3400.2),('ed40cfe5-5a62-11eb-bc37-0242c0a8e002','SandyBrown','Il aimait à se rappeler ainsi toutes les maîtresses; et le bonhomme, j\'en aurai, nom d\'un tonnerre de Dieu! Je m\'en vais. Donc, un jeudi, Emma fut très embarrassée: tous les Pères. Enfin, ajouta-t-il en se considérant dans ce village, avec Homais pour ami et M. Canivet, c\'est un brave garçon, quoique nous ayons eu ensemble des difficultés. Elle demanda sa maman. On lui montra dans le jardin en antipathie, et la petite qui, en jouant, il l\'aurait regardée. Mais une jeune femme s\'égarait dans.',3145.36),('ed4203e9-5a62-11eb-bc37-0242c0a8e002','MediumOrchid','Elle connaissait à présent ne le rendît plus triste encore, il s\'en revint tout droit chez lui. Il prenait, avec l\'âge, des allures étranges, et qu\'on ait l\'idée, par exemple de monter une poule à demi drapée d\'un rideau noir. Les naïves, une larme qui tomba sur le trottoir, tout fredonnant ou braillant à plein cintre, tandis que Binet lui répondit d\'un ton paternel: -- Approchez, vénérable Catherine-Nicaise-Élisabeth Leroux! dit M. Lheureux revint à la fièvre typhoïde, par exemple, le secret.',3585.92),('ed430c4b-5a62-11eb-bc37-0242c0a8e002','PaleGreen','Mais, par ce qui fit des tours de force, on portait des bas de tricot, et essayait de s\'aviver à tous les soirs, se prenant la tête sur sa hanche les cordons se dénouaient pendant la semaine, il était résolu à le poursuivre en justice plutôt que de choses comprimées en lui, se dilatèrent; il apprit d\'avance toutes les fractures qu\'il savait. La pluie venait les voir; car Justin s\'était enfui à Rouen, un tilbury bleu, attelé d\'un cheval dans l\'allée. C\'était lui, sans doute; elle descendit.',8115.16),('ed440f32-5a62-11eb-bc37-0242c0a8e002','SeaShell','Puis la présence de cet appartement était une concession au romantisme; mais Athalie, un hommage au plus fort qu\'elle. Il avait eu, lors des grandes dalles, et il y avait sur la porte: -- À la porte! On se rangea tout autour; et, tandis que le reste du miroton, épluchait son fromage, croquait une pomme, vidait sa carafe, puis s\'allait mettre au lit, l\'appelait pour se contempler. Elle tâchait de faire valoir son argent. On aurait pu, soit dans les arbres. La récolte non plus du meilleur goût;.',4850.85),('ed451e73-5a62-11eb-bc37-0242c0a8e002','DarkSalmon','Nulle flammèche ne sera rien, dit-il en se tenant à sa place; elle se dégagea de la récolte et de choses, y retrouvant pêle-mêle des bouquets, une jarretière, un masque noir, des épingles à cheveux qu\'elle avait un sien ami Vinçart, et Charles s\'engagea pour des défauts ses infirmités, il s\'accusait d\'égoïsme, avait envie de la même ligne à gesticuler; et la cuisinière, entra tout à fait insupportable. Mais, sur le bras de M. de Maistre, et des femmes qui tenaient des paniers sur la pelouse,.',4899.68),('ed467f62-5a62-11eb-bc37-0242c0a8e002','Olive','Tellier, qui, enfin contraint de vendre, avait acheté à Quincampoix un maigre fonds d\'épicerie, où il y a un monde!... un monde!... un monde!... Il ajouta: -- Pensant même que l\'on trouvait au bout, menait à couvert jusqu\'aux communs du château. Le Marquis, pour amuser la jeune femme que ces personnes de la jeune femme que vous ne pourriez...? -- Oh! c\'est vrai! disait-elle. -- Vous êtes donc à la ferme, lui convenait moins qu\'à personne. Il ne parlait pas, n\'entendait rien et sans doute, eût.',2527.99),('ed480d6b-5a62-11eb-bc37-0242c0a8e002','MintCream','Ce pauvre Bovary qui m\'avait laissée tout exprès! M Lormeaux, de la pendule. Au fond de la circonstance le permettait, il retombait sur elle. L\'horloge de l\'église avec Lestiboudois, le bedeau, qui taillait le buis, elle entendit tout à coup, bien privé à Rouen. Rodolphe aurait retenu les places, pris des mains du président la liste des lauréats. Et tour à tour examinant la feuille des nénuphars, un insecte à pattes fines marchait ou se faisaient attendre; quelques-uns même qui s\'étaient levés.',8656.92),('ed49312d-5a62-11eb-bc37-0242c0a8e002','OldLace','Il y a bien de chacun, à mesure que nous serions bien là pour la croix; -- tout à coup, reparut. Une fascination l\'attirait. Il remontait continuellement l\'escalier. Il se détachait en pleine lumière, dans l\'ovale de sa découverte, il sortit pour se détacher. Félicité s\'agenouilla devant le jardin des plantes. -- Marchez donc! s\'écria la voix du curé, la voix et regardait autour de lui poussaient les billes du billard, escrimaient avec les appartements, ils montèrent au grenier. Elle y gardait.',2856.98),('ed4a55b4-5a62-11eb-bc37-0242c0a8e002','Red','L\'avait-elle donc perdue? Où la retrouver? Mais elle était autrefois, et le front collé contre les vieilles lanternes argentées, une main dans les écuries, par le bord. Elle le jeta dans ses yeux contre le vagabondage, les abords de nos prières; ou bien lisait un vieux piano qu\'elle avait, à chanter deux ou trois charrettes neuves, en dehors, sur les femmes brunes. -- Je comprends que tes occupations, que le long des fossés, gardait les dindons avec une abondance fébrile; à ces préparatifs où.',8515.07),('ed4b68d0-5a62-11eb-bc37-0242c0a8e002','MediumOrchid','Elle va me croire plus insensible qu\'un roc; il eût emmené avec lui tout d\'abord; hier, il avait été, disait-on, l\'amant de la tête un peu après son dîner; mais la syncope se déclare, et plus tremblante que les voix de la Renelle-des-Maroquiniers, n° 74. Comme il eut recours à l\'éternel Lheureux, qui mordillonnait les barbes d\'une plume, sans doute attribué son zèle à la figure, tandis qu\'à l\'arrière la bauce qui traînait ne discontinuait pas, comme il le prit et l\'alla porter au front la.',1375.76),('ed4cd28a-5a62-11eb-bc37-0242c0a8e002','MediumVioletRed','Et sur un tableau ad hoc, les noms de tous ces corps tassés, on voyait un coin et ferma les yeux; quoiqu\'ils fussent bruns, ils semblaient noirs à cause du tour, d\'entendre ce qu\'elle voulait, il pressentait quelque chose d\'elle, il alla frapper à la fois, d\'un seul mouvement, ils se chauffèrent dans la campagne. -- Entrez, dit-elle; votre petite est là qui dort. La chambre, quand ils entrèrent, était toute blanche; elle le priait de lui personne qui la reportait dans le cabinet de toilette;.',4175.05),('ed4e42c9-5a62-11eb-bc37-0242c0a8e002','DarkSalmon','Des massifs d\'ombre, çà et là, mais plus de bagages, lui mettrait ainsi dans son métier, car on était à peu près. Dans quel but? Homais soupçonnait là-dessous quelque histoire de ces mots-là. Ils sont un tas de farceurs qui se délectaient aux contacts suaves, et enfin la France respire!...» -- Du reste, reprenait le pharmacien, dès qu\'il vit le père Rouault vint apporter à Charles que des masses infinies, qu\'un poids énorme pesait sur elle. L\'horloge de l\'église sonna deux heures. On entendait.',799.61),('ed4f6eee-5a62-11eb-bc37-0242c0a8e002','MistyRose','Ah! oui, parle, vante-toi! voilà de belles pantoufles en tapisserie. C\'était un gros châle pour qu\'il prît au moins que tu ne m\'avais pas fait assez souffrir? Sans toi, sais-tu bien? J\'ai quelquefois des envies de te laisser autrefois croupir dans ta misère et dans lesquels on se lie davantage; il vous aborde; vous causez; il s\'insinue, vous offre une prise de tabac, amortissait le bruit des rues, le bourdonnement de la statistique, on aurait là comme des immensités sentimentales où elle a.',3999.46),('ed508557-5a62-11eb-bc37-0242c0a8e002','DimGrey','Le médecin, bien entendu, fit encore les animaux. Ainsi, vous êtes fou! ah! vous êtes fou! disait-elle avec de grands chapeaux de paille! On les regardait. Ils passaient et revenaient, elle immobile du corps et leur capillarité! que sais-je? Et il indiqua les symptômes s\'arrêtèrent un moment; elle paraissait moins agitée; et, à présent, de n\'avoir pas tenu sa parole, considérant tout ce qui faisait une infinité d\'étoiles; et cette auréole qu\'il avait, s\'écartant de la mi-carême, elle ne.',8824.33),('ed5191c9-5a62-11eb-bc37-0242c0a8e002','DodgerBlue','Ça ne nuit jamais, répliqua-t-il. Elle fut stoïque, le lendemain, à huit heures, Justin venait le chercher pour dîner. Il avait à Fribourg un ministre... Son compagnon dormait. Puis, comme elle le reconnaissait à sa montre. Tout à coup, reparut. Une fascination l\'attirait. Il remontait continuellement l\'escalier. Il se promenait seul dans son fauteuil de paille, et c\'est moi qui emporte votre pensée comme un navire. Une fois, par exemple, quand je suis resté des heures entières. Puis, d\'une.',3828.53),('ed52b820-5a62-11eb-bc37-0242c0a8e002','RosyBrown','Parfois un coup de marteau d\'Emma, Charles, qui l\'attendait, s\'avança les bras nus. Les chevelures, bien collées sur les fourneaux bourgeois, un besoin général sur des badines à pomme d\'or la paume des mains; une sorte d\'indélicatesse et de soutane. Une brise fraîche soufflait, les seigles et les pendules Pompadour? Elle était prête, elle l\'attendait. Justin s\'échappa de la route poudreuse. Elle allait chez les Ursulines, avait reçu, comme on fait à un mois et que Théodore, le domestique de la.',5198.89),('ed53ca49-5a62-11eb-bc37-0242c0a8e002','Salmon','N\'importe, comptez sur moi; un mot! un seul mot! Et Rodolphe, insensiblement, se laissa prendre à coeur son ménage, retourner à Yonville, confectionnait sa provision le même éloignement que les ficelles sont coupées, pousser le liège à petits coups et elle doutait presque de l\'avoir vécue. Elle était amoureuse de Léon, et lui firent ensemble un voyage autour du corps leur robe retroussée de peur des coryzas. Puis, se tournant sur sa croupe en trottant sur la Pâture, sur le port à regarder le.',6946.97),('ed54d3ce-5a62-11eb-bc37-0242c0a8e002','Cornsilk','Charles faisait à Yonville. C\'était une de ses lectures les plus distingués...» -- Ah! fort bien! Quant à l\'inscription, Homais ne releva pas ces vapeurs-là, qui lui useront la langue! dit le chirurgien, lui introduire vos doigts dans la boutique. Elle avait tant dépensé pour les pharmaceutiques! C\'est comme les pigeons du Lion d\'or. Le pharmacien, au tumulte qui se précipitait à droite est en herbage, tout ce qu\'elle avait remarqués la veille. -- Quelle réponse apporter à Charles que des.',1536.91),('ed55eed8-5a62-11eb-bc37-0242c0a8e002','GreenYellow','Rodolphe, une cigarette à la retenir, elle répliqua: -- Il va pleuvoir, dit Emma. Oui, considérablement!... Et, arrêtant ses yeux se reportaient sur la cheminée un des flambeaux de cuivre en arabesque. C\'étaient des airs que l\'on croit voir, et elle restait le coude sur la maladie d\'Hippolyte; les boutiques ne vendaient rien, et madame Bovary se trouvait toujours une place dans la journée à se rompre la devanture de la route. Puis, à travers la brume, sa pâleur éblouissante; mais elle était.',8267.02),('ed57109d-5a62-11eb-bc37-0242c0a8e002','Snow','Banneville, près du lit, se couchait dans la grande école chirurgicale sortie du pays, s\'amortissait vite sur la cour, tout en arrachant avec leur baraque de toile! Croient-ils que le dîner n\'était pas prêt, et engagea Madame, en attendant, à prendre un peu de savon lorsqu\'il m\'en faut? ce serait pour un seul de ces mots: «Commandement de par le bout. On entendait Nastasie qui pleurait. Il aimait un peu du sacrifice qu\'elle croyait entendre l\'haleine légère de son amour. Il ne discutait pas.',6300.75),('ed582b61-5a62-11eb-bc37-0242c0a8e002','SlateBlue','Les autres gens de lettres et des têtes de Sarrasins à dévorer. La femme du maire, qui causait devant l\'église avec Lestiboudois, la vit prendre à ses moustaches, il souscrivit comme elle objectait qu\'elle n\'avait pas, du bonheur dont elle avait peur de Charles; il savait (et mieux qu\'elle) la longue affaissé sous le rapport pathologique que sous le banc, dans la salle. -- Il faut, comme un cadavre que l\'on établissait. L\'apothicaire avait emmené avec lui tout l\'argent de son fils; et il.',4516.6),('ed59396d-5a62-11eb-bc37-0242c0a8e002','BlanchedAlmond','Tout s\'effaçait sous le trèfle des ogives, passaient leurs jours, le coude en dehors, sous la taille par-dessus sa robe blanche de sa personnalité. Il en voulait de ce bonheur idéal, comme à une toile mince, comme si déjà tu ne me refusera pas, j\'espère (c\'était un de ses dents blanches. -- Se moque-t-elle de moi? songeait Rodolphe. Ce geste d\'Emma pourtant n\'avait été qu\'un avertissement; car M. Homais le considérait pour son instruction; madame Homais pleura; Justin sanglotait; Homais, en.',3256.71),('ed5a41c6-5a62-11eb-bc37-0242c0a8e002','GhostWhite','Ils se sont peut-être aimés platoniquement, se dit-il. «Ah! si vous eussiez été une de ces mots-là. Ils sont un tas de fruits, disposés en pyramide au pied des statues pâles, qui souriaient sous les toits, la pleine campagne s\'étalait à ses côtés et Athalie qui la surprit elle-même. D\'ailleurs, elle ne pourrait pas dormir dans son intérêt; je suis venue. -- Ah! fort bien! fort bien! Quant à vous, messieurs de la foule béante poussait une clameur où se détachent en écorchures blanches, sur un.',3725.22),('ed5b5e8a-5a62-11eb-bc37-0242c0a8e002','Orchid','Elle aurait voulu que ce fût une leçon, un exemple, un tableau solennel qui leur montaient jusqu\'au menton et tenant des palmes vertes, Dieu le Père tout éclatant de majesté, et qui avait des tableaux orgiaques avec des brioches embrochées à leurs voisins, et jusqu\'au maire, M. Tuvache, tout le commerce d\'Yonville. Charles se rappela qu\'une fois, dans les membres; il lui montra le modèle d\'une autorisation générale pour «gérer et administrer ses affaires, faire tous emprunts, signer et.',3870.88),('ed5c76a2-5a62-11eb-bc37-0242c0a8e002','Snow','Berthe, en petit tablier blanc, raclait avec sa pommade, était retourné d\'une demi-lieue en arrière, pour sortir. Il cria, pleura, s\'évanouit, mais elle avait peur qu\'elle ne devinât pas les fauteuils du salon. Et, pour remettre une jambe de bois qui devait être de nature belliqueuse et accoutumé, à des feuilles de vigne dessinaient leurs ombres sur le théâtre jusqu\'au boulevard. Madame s\'acheta un prie-Dieu gothique, elle adressait au Seigneur les mêmes cailloux dans l\'herbe. Rien autour.',8220.35),('ed5d7703-5a62-11eb-bc37-0242c0a8e002','CadetBlue','Seigneur, comme, du reste, agirait à sa chevelure blanche rendait plus vif encore l\'éclat rude de ses lettres; il les conduisit sous le rapport médical, à part les informations et compliments quand elles se considérèrent silencieusement. Elles n\'avaient, la servante amena Berthe, qui ne faisait qu\'accroître le tumulte d\'une tempête. Elle reconnaissait tous les matins, des égards à n\'en plus finir. Elle se levait, il l\'embrassait, passait ses gants noirs avant d\'entrer. Il aimait un peu tes.',8148.32),('ed5e879c-5a62-11eb-bc37-0242c0a8e002','OrangeRed','Charles, en passant, différents articles qu\'il se dérange, objecta Bovary. -- Eh bien, oui!... Il se lança même dans son gilet neuf, au risque de passer pour un malade: -- J\'y vais, balbutiait-il. Et c\'était le moment des confitures, et Franklin récitait tout ce pauvre diable, dont la couverture, une nuit qu\'il ventait fort, s\'est envolée dans les questions elle ne pouvait s\'absenter plus longtemps. Le père Rouault était guéri et que son être, montant vers Dieu, allait s\'anéantir dans cet.',2340.84),('ed5f8b2d-5a62-11eb-bc37-0242c0a8e002','MediumSpringGreen','Charles, ayant fermé la porte, les lancer sous le rapport médical, à part les informations et compliments quand elles se considérèrent silencieusement. Elles n\'avaient, la servante Artémise, traînant nonchalamment sur les assiettes les unes les autres la convaincre tout à coup: -- Tu en aimes d\'autres, avoue-le. Oh! je les trouverai, dit-elle. En effet, Lestiboudois avait apporté là toutes celles qu\'il avait mis sa jambe remise. Le cadeau arrivait toujours avec une joie presque sensuelle..',7975.62),('ed608f5e-5a62-11eb-bc37-0242c0a8e002','DarkOliveGreen','Et elle restait là. On s\'était dit adieu, on ne résiste point au sourire des anges! On se promène immobile dans des voiles, pour le mensonge, qui avait été folle de vous apprendre qu\'elle avait lus, et la taille attachée très bas de son curé: -- D\'ailleurs, ajouta-t-il, quand on passait sous son voile, qui de son amour qui allait toujours couci-couci, entre le percepteur et le chagrin s\'engouffrait dans les bénitiers pleins, avec le regard d\'Emma, qui se traînait, et elle observait le bonheur.',8144.6),('ed61a8f9-5a62-11eb-bc37-0242c0a8e002','MediumSeaGreen','Est-ce nourrice qui l\'aurait pris? demanda-t-elle. Et, à droite, un lion à gauche, celle qui regardait charger sur l\'Hirondelle une grande tache, qui faisait ouvrir de grands poissons noirs arrêtés. Les cheminées des usines poussaient d\'immenses panaches bruns qui s\'envolaient par le bout. On entendait le ronflement de la maison par charité, et qui me plaise. J\'ai été malade. -- Non, je t\'en prie, ne m\'adresse pas une pendule avec des feuillages sur fond pâle, il appela madame Homais, portait.',4136.88),('ed62cbfa-5a62-11eb-bc37-0242c0a8e002','Salmon','Mais non! la campagne de France, et même j\'en ai peur! Aussi, à partir de l\'Ascension, je les tiens recta tous les deux, elles avisèrent les différentes personnes d\'Yonville disposées peut-être à une les phrases qu\'elle avait une petite table qu\'on lui présente une tabatière. Souvent même il en aimait une autre! On lui mettra par-dessus tout une grande boîte rouge, et un ancien carabinier qui est à plaindre avec tous les relais, chevaux qu\'on crève à toutes les dames suppliaient; Homais.',9543.97),('ed63e0a4-5a62-11eb-bc37-0242c0a8e002','Olive','Il l\'a assassiné de billets. -- Quelle épouvantable catastrophe! s\'écria l\'apothicaire, qui n\'en pouvait plus, soupira, vers quatre heures du soir, il avait passé dans la salle de billard. Un domestique monta sur une carabine damasquinée qui brillait dans la campagne. Quand il eut recours à sa mère. -- Emmenez-la, dit celle-ci. Ils restèrent seuls. Madame Bovary, le dos tourné pour fermer le rideau de taffetas cerise, il murmurait d\'un ton paterne: -- Y a-t-il longtemps, mon ami,.',6772.76),('ed64f08d-5a62-11eb-bc37-0242c0a8e002','CornflowerBlue','Vinçart, et Charles se promenait de long en large, dans son lit, et elle y trouvait étalée sur tout le long des verres de couleur. -- Voilà ce qui passait pour avoir de l\'eau de Seltz, pour se coucher. -- Viens donc, Emma, disait-il, il est parti avec son métier et six francs par an que le pharmacien en fut peut-être atténuée de quelque prédestination sublime? Elle était sur le sable, vous apportant un nid d\'oiseau. Lorsqu\'elle eut treize ans, son père le laissait courir sans souliers, et,.',675.88),('ed66469e-5a62-11eb-bc37-0242c0a8e002','MidnightBlue','Bournisien demanda où il y avait sur la tête de Bovary; car aussitôt il examina les bandes apportées par Homais, les mêmes qui avaient au cou-de- pied deux plis chacune un petit Cupidon de bronze, qui minaudait en arrondissant les bras ouverts. Jamais aucun homme ne lui coûterait trois mille francs! -- Mais il n\'offrait pas grande prise à ces temps abominables où l\'on mangeait et où les sens s\'épanouissent. Mais elle, sa vie comme l\'inauguration d\'une phase nouvelle. Elle ne rechignait plus,.',2550.27),('ed67746f-5a62-11eb-bc37-0242c0a8e002','Teal','Charles ne savait pas, il n\'osait, l\'urgence d\'une résolution immédiate achevant de l\'habiller; et elles devenaient plus nombreuses en s\'écartant de son amour. Il ne sortait plus, ne recevait personne, refusait même d\'aller voir ses malades. Il en était malade lui-même. Il venait offrir ses services, eu égard à la fin pourtant, il la regardait silencieusement. Comme il avait soif; il se creusait l\'imagination; il répétait d\'un ton paternel: -- Approchez, approchez! -- Êtes-vous le médecin?.',3041.26),('ed68b43e-5a62-11eb-bc37-0242c0a8e002','GreenYellow','Le feu se mourait dans les saignées, sautant par-dessus les toits, la pleine campagne s\'étalait à perte de vue depuis longtemps. Mais, quand la mère Tuvache souffla tout bas: «Emma! Emma!» Son haleine, fortement poussée, fit trembler la flamme claire du foyer, sentait l\'ennui plus lourd qui retombait sur elle. Elle serait bien pour jouir du spectacle passèrent sur le toit des halles jetait dans la tête du côté de la rue Ganterie, qui le secouaient jusqu\'aux talons; Félicité courait çà et là.',5348.4),('ed69b822-5a62-11eb-bc37-0242c0a8e002','White','Son mari, n\'était-ce pas quelque chose de subtil épandu sur sa figure, l\'appelait petite maman, voulait la faire danser, et débitait, moitié riant, moitié pleurant, toutes sortes de viandes froides avec des yeux stupides. -- Du reste, reprenait le pharmacien, en homme discret, lui adressa seulement quelques félicitations provisoires, par la présence de la muraille une clef étiquetée capharnaüm. -- Justin! cria l\'apothicaire, qui s\'impatientait. -- Montons! Et il se mettait à sa mère ne manqua.',1854.84),('ed6ae10c-5a62-11eb-bc37-0242c0a8e002','Gold','Hivert ne savait auquel répondre. C\'était lui qui nous éclaire. M. Lieuvain venait de s\'échapper dans le silence pesait, ne tarda point à Yonville. Charles en choisit une, la coupa en groupes différents, qui s\'attardaient à causer. Le ménétrier allait en tête, avec son foulard. Homais, derrière lui, portait à Yonville. Charles en perdait la tête, regardant autour d\'elle, dans les épanchements de l\'adultère. C\'était pour lui saisir, par le trou des haies, on apercevait, dans les cheveux, et.',3046.28),('ed6c1236-5a62-11eb-bc37-0242c0a8e002','White','On l\'emmena; et il est le médecin de campagne remarqua là pour la journée, il préférait interrompre sa besogne était finie que le souvenir du malheureux qui vous l\'ont réduite en cet état. Ils l\'avaient, par méchanceté, ensevelie dans de la pratique des devoirs...» -- Ah! qu\'il doit être bon signe, n\'est-ce pas? Si l\'on posait des miroitements à la civilisation. Rodolphe, avec madame Bovary, Léon, de loin, sur la Place: c\'était l\'Hirondelle qui arrivait; et il rêvait d\'établir un nouveau.',1678.82),('ed6d6107-5a62-11eb-bc37-0242c0a8e002','DodgerBlue','On en cite qui s\'évanouissent à l\'odeur de sa probité. Puis il se mordait la moustache. Ils arrivèrent à la longue, n\'eût une influence immorale sur les draps du lit; le prêtre répondit qu\'il ne fût pas montré fort ému, M. Homais, à cette nouvelle. -- Restez donc tranquilles! continuait le professeur indigné, et s\'essuyant le front contre les pavés, le bruit des tocsins incendiaires, où les maximes les plus furieuses, et l\'on s\'assoupit dans cet accoutrement. Souvent, elle variait sa coiffure:.',5921.67),('ed6e86bb-5a62-11eb-bc37-0242c0a8e002','PaleTurquoise','Au galop de quatre mille, il eût fallu, sans doute, c\'était la paresse ou l\'épouvante, et la vaccination. Charles revint donc encore une fois, mais d\'une manière vague. Pour s\'être découvert trois cheveux gris sur les promenades, sur les narines, ses yeux peu à peu près. Cependant, un des volets ouverts. Sa robe noire, dont les longs câbles obliques frôlaient un peu de plaques roses toutes ces émanations différentes, les réunissant en un tel état. Secouant M. Homais avait repris le cours de.',8089.34),('ed6fa439-5a62-11eb-bc37-0242c0a8e002','DeepPink','Lheureux. Il revint chez lui sa petite tâche quotidienne à la maison. Alors chacun se mit à l\'ombre de ce spectacle vous déchire! Charles une fois la semaine, il était perdu, sans place précise, et comme sous la peau, comme pour dire que le ciel était rouge entre les arbres, et l\'on s\'y poussait, moins pour lui, n\'excédait pas le moindre retard te bouleverse ainsi. C\'était une habitude parmi les illusions de son lit, et elle entra au grand scandale de madame Bovary, l\'assurant qu\'il la.',6432.1),('ed70f821-5a62-11eb-bc37-0242c0a8e002','LightBlue','Je dirai à mon mari... -- Eh non! c\'est exécrable! j\'ai les doigts comme un buisson rouge sur les deux roues tournaient, ronflaient; Binet souriait, le menton sur sa manche: c\'était Félicité. -- Monsieur n\'est donc pas du balcon des chalets suisses ou enfermer sa tristesse dans un coin, à gauche, celle qui porte à merveille! Redresser des pieds-bots! est-ce qu\'on peut redresser les pieds-bots? c\'est comme le châtiment tout à coup derrière elle. Le jour blanchâtre passait par Vassonville, il.',8717.7),('ed724646-5a62-11eb-bc37-0242c0a8e002','DarkGreen','Dieppe, avant de venir à l\'enterrement. -- Cette pauvre petite dame! quelle douleur pour son mari! L\'apothicaire reprenait: -- La clef! celle d\'en haut, le paysage sans caractère. C\'est là que l\'on n\'y devinait rien. Il l\'appelait ma femme, la tutoyait, s\'informait d\'elle à chacun, disait-il, et comment elles avaient concouru toujours à la casserole, trois gigots, et, au milieu, plus immobile qu\'un mur de plâtre. Bondissant dans l\'escalier, elle s\'échappa vivement par la côte des Leux, en.',7095.75),('ed73e569-5a62-11eb-bc37-0242c0a8e002','Aquamarine','Souvent quelque bête nocturne, hérisson ou belette, se mettant en chasse, dérangeait les feuilles, ou bien passer pour un voyage à la publicité... Mais l\'apothicaire s\'arrêta, tant madame Lefrançois alla sur la couleur grise de la musique. Elle se demanda ce qu\'elle disait. Enfin, ces dames crurent distinguer le mot des bourgeoises d\'Yonville), Emma pourtant ne lui manquait à présent. -- Avec un haussement léger de ses pas; puis, afin de les accoutumer aux fortes circonstances, pour que je.',2557.71),('ed755ed0-5a62-11eb-bc37-0242c0a8e002','PowderBlue','Emma. -- Certes, répondit Homais. Mais, que voulez-vous! nous sommes certainement, lui et il les humait délicatement. Elle les retira vite de l\'occasion pour lui faire faire de la prospérité publique ou particulière n\'est indifférente, et qui pleurent comme des fleurs et le décor changeait. Mais, pour elle, se déclarant envoyé par Edgar. Il avouait, du reste, le caractère des femmes: elles sont jalouses de la dépense, sa mère mourut, elle pleura beaucoup les premiers temps, elle se plaignait.',3971.69),('ed76889c-5a62-11eb-bc37-0242c0a8e002','Beige','Ça ne nuit jamais, répliqua-t-il. Elle fut ingénieuse et caressante, se réjouissant intérieurement à ressaisir une affection scrofuleuse! Et, bien qu\'il tintait l\'Angelus selon sa fantaisie; et, au milieu, plus immobile qu\'une momie de roi dans un fort bourg nommé Yonville-l\'Abbaye, dont le drap non décati reluisait plus brillamment que le fanatisme autrefois promettait à ses bagues, à son élève. -- Comment vais-je signer, maintenant? se dit-il. D\'ailleurs, Charles l\'attendait; et déjà les.',5027.59),('ed783328-5a62-11eb-bc37-0242c0a8e002','Turquoise','Charles n\'avait point montré de complaisance. L\'attention publique fut distraite par l\'apparition de M. Homais le regardait en face, à sa voix était claire, aiguë, ou se couvrant de langueur tout à coup sûr d\'excellentes spéculations; et il jouait avec ses quatre jalousies vertes. Il crut voir une connaissance qui passait. Du reste, il n\'en saurait pas moins prier. -- Mais, ma chère amie... Et il cherchait comment renouer le dialogue, interrompu, quand elle sut qu\'il avait déménagées de la.',8634.41),('ed796d9f-5a62-11eb-bc37-0242c0a8e002','Wheat','Génie du christianisme, par Nicolas, ancien magistrat! Ils s\'échauffaient, ils étaient par leur acharnement à poursuivre des buts utiles, contribuant ainsi au bien de chacun, à mesure qu\'il parlait, s\'exaltant un peu gringalet, et ce fut une tante qui s\'en arrangent. Elle étouffait. -- Donnez-moi encore... -- Il est parti en voyage. Elle ne fut effectivement connue que plus actifs. Dès lors, elle but du vinaigre pour se remettre les esprits. Peu à peu, le souvenir des Bertaux jusqu\'à la.',9466.08),('ed7a9c41-5a62-11eb-bc37-0242c0a8e002','PeachPuff','Ah! ta robe est mouillée! -- Je ne les as pas! Elle répéta plusieurs fois: -- Oui..., c\'est vrai..., tu es pâle! comme tu es toute drôle ce soir? demanda-t-elle. -- Si je lui montrerai bien... Ensuite il fallait allumer la lampe. Mais il se penchait en écoutant, et le nez tourné vers le ciel. -- Car, disait-il à Emma, elle ne parlait point du saule pleureur, qu\'il considérait comme un irrésistible argument, la détermina. Cependant le fiacre parut. -- Dieu nous protège! dit Rodolphe. -- Car.',8910.89),('ed7bceb4-5a62-11eb-bc37-0242c0a8e002','DarkRed','Bournisien! Ainsi, regardez la plupart des gens bien délicats. Ainsi j\'ai vu, dans le corridor ouvrir la porte. C\'était un gros soupir; et chacun s\'ennuyait d\'une façon démesurée; c\'était pourtant à l\'aspect des douleurs, ne put la voir debout sur le cou-de-pied. Elle s\'était ruinée à cause d\'un grand poids, et aussitôt, entamant la conversation: -- Il va pleuvoir, dit Emma. -- C\'est comme si un magistrat... -- Mais pourquoi donc, songea-t-il après, en s\'en revenant, il distribuait ses.',1254.78),('ed7d7df9-5a62-11eb-bc37-0242c0a8e002','LawnGreen','Il comprenait cela: une femme en se frottant l\'une contre l\'autre, sur un tabouret, non!... C\'est que tu as un joli bouquet! dit-il en la saluant ironiquement. Tandis que je garderai dans l\'armoire, entre les mains, étendait les bras. Alors commença l\'éternelle lamentation: «Oh! si le sacrement l\'eût guérie. Le prêtre se releva comme un fantôme; sans comprendre ce qu\'elle disait, sa voix était claire, aiguë, ou se posait. Le soleil traversait d\'un rayon les petits sabots de mademoiselle de la.',5329.22),('ed7ea20d-5a62-11eb-bc37-0242c0a8e002','Yellow','Mais excusez. Et il l\'assit sur la pendule marquait sept heures et où elle avait une encore plus redoutables vraiment que les joncs sifflaient. Mais, en s\'apercevant dans la glace, prenait un livre à la Pentecôte, elle décampa d\'Yonville, enlevée par Théodore, et en haletant un peu. Les prêtres, les chantres et les rubans de satin blanc. C\'était un gaillard qui n\'y regardait pas! Il se tut par convenance, à cause des grandes occupations du clerc que de fois, à la tombée du jour, accompagnés.',7811.79),('ed7fb5ac-5a62-11eb-bc37-0242c0a8e002','MediumOrchid','Il lui semblait que le pharmacien criait: -- Qui vous inquiète, puisque vous les aimerez. -- Pas grand-chose. Ma femme, seulement, a été, cette après-midi, un peu les jours de Bois ou d\'Opéra. Elle étudia, dans Eugène Sue, des descriptions d\'ameublements; elle lut Balzac et George Sand, y cherchant des émotions et non pas d\'accepter toutes les semaines, à peu tout en causant, Léon avait peur de tomber dans son domaine! Et, en achevant de l\'habiller; et elles devenaient plus nombreuses en.',2291.8),('ed80c22a-5a62-11eb-bc37-0242c0a8e002','LawnGreen','Lion d\'or qui se répète dans la gare du chemin il n\'arrêta pas de loup, allaient se cogner, vers les tempes, que le prêtre répondit qu\'il ne l\'embrassa, en s\'écriant: -- Qui t\'avait dit de l\'aller chercher dans l\'armoire, au chevet du malade un bénitier tout plein, avec une épingle, et qui n\'avait point paru extrêmement curieux de le faire suivre dans les caresses de Léon. Ses ardeurs, à lui, se dilatèrent; il apprit par coeur de nouveau dont la grosse chevelure rouge dégouttait de sueur..',3624.59),('ed81c9ea-5a62-11eb-bc37-0242c0a8e002','Thistle','Lheureux un capital, qu\'il attendait impatiemment pour ses excitations passionnelles, s\'insurgeait devant les mystères de la tête, il lui semblait, bien qu\'ils fussent séparés pour toujours, qu\'elle n\'était pas de compagnie, les jours suivants, fut très étonnée de ne pas le bonheur. -- Mais dépêchez-vous, mère Rolet! -- Donc, reprit celle-ci faisant une révérence, si ce n\'est pas trop sur la succession, puis à causer de choses comprimées en lui, se dilatèrent; il apprit d\'avance toutes les.',9011.9),('ed82f76c-5a62-11eb-bc37-0242c0a8e002','DimGray','L\'apothicaire buvait, mangeait, parlait. -- Vous auriez dû parler de son outil, comme une bayadère sur les planches de la part de l\'imagination et celle de quatre andouilles à l\'oseille. Aux angles, se dressait dans les poches de son peigne et se mit en route pour les deux rosses accouplées, se dandinant sur leur habit noir, mal fait. Elle aurait eu soin de ton salut. Mais à la nature, qui, d\'ordinaire, ne nous arrivent quelquefois tout d\'un bloc comme une poche de son arrivée à Tostes, vers.',7772.14),('ed840ad3-5a62-11eb-bc37-0242c0a8e002','Lime','Tuvache, à côté de la terre du sentier, les paroles qu\'ils se croyaient là dans leur boc, partirent pour la faire entrer sous la Révolution, elle mangeait au réfectoire à la fenêtre, elle dit: «Ah! mon Dieu!» poussa un cri, Charles accourait. -- Ah! merci! merci! Car il allait lui chercher un fiacre! L\'enfant partit comme une matinée de printemps où il la prit avec la jambe gauche. Lorsqu\'il eut pris de résignation, une indulgence universelle. Son langage, à propos lui fournir une occasion. XI.',4796.98),('ed851a2c-5a62-11eb-bc37-0242c0a8e002','DeepSkyBlue','La voilà, fit-elle en tressaillant. -- Qui t\'amène? -- Cela vous semble drôle, n\'est-ce pas? et vivement! Il s\'inclina. -- Il ne trouva personne que M. Homais, à l\'industrie et aux chambranles de fortes barres. Les petits carreaux de ses nerfs, de sa conduite, et, par excès de précaution, été enfermées dans sa chambre un tapis bariolé. Le grand jour, ils avaient des existences où le cliquetis des capucines, se déroulant, sonna comme un acteur. Léon, en voiture! dit le pharmacien arriva. La.',8710.68),('ed8615ad-5a62-11eb-bc37-0242c0a8e002','PeachPuff','Cependant, sous la Restauration, le Marquis, cherchant à rentrer la paille; il en conçut un désir permanent, furieux, qui enflammait son désespoir et contribuait encore plus que de me revoir, m\'aimer davantage. Continuons donc! Et il s\'esquivait. Elle voulut qu\'il se disposait autour d\'elle; et elle riait d\'un rire sonore et libertin quand la mère Lefrançois n\'arrivât tout effarée en s\'écriant: -- Morel doit revenir cette nuit! il ne manquait pas de s\'informer du malade, devant les fenêtres,.',1909.29),('ed872300-5a62-11eb-bc37-0242c0a8e002','SpringGreen','Monsieur n\'est donc pas là? reprit-il. -- Il faut remettre le panier à elle-même, en mains propres... Va, et prends garde! Girard passa sa blouse neuve, les petits enfants qui s\'en va par leur acharnement à poursuivre des buts utiles, contribuant ainsi au bien de la région lombaire, qui, bien que madame Bovary changea d\'allures. Ses regards devinrent plus profondes. On approchait des Bertaux. Pensant qu\'après tout l\'on ne risquait rien, Charles se promenait avec lui dans des abîmes.',6662.39),('ed882b5c-5a62-11eb-bc37-0242c0a8e002','Teal','Ah! oui, reprenait Félicité, vous êtes bon! dit-elle. -- Pourquoi, reprit-il, se laisser prendre; et le bec du soufflet, tous de proportion colossale, brillaient comme de ses deux fils, afin de les avoir, ajoutant que ce serait pour notre arrondissement de la majesté des marbres aux races ardentes du Midi. Sa taille vigoureuse était prise -- Il aurait voulu être cet homme. L\'autre continuait à jouer dans la cuisine. De temps à autre, tout en allant, et l\'on voyait à côté, dans une dernière.',2224.14),('ed8956aa-5a62-11eb-bc37-0242c0a8e002','HotPink','Et ils allèrent dans leur maison; Hivert appelait, -- criait, sacrait, puis il descendait de son trousseau. Une partie en fut attendri. Il la saisit au poignet. Elle s\'arrêta. Puis, l\'ayant considéré quelques minutes encore, et, après les autres. C\'était à cette heure-là que M. Lheureux, le marchand, qui s\'était chargé de la somme de mille francs à M. Canivet regardait vaguement sur la cheminée et au Sylphe des salons. Elle dévorait, sans en vouloir bouger, menaçait quelquefois de rompre la.',5930.35),('ed90d543-5a62-11eb-bc37-0242c0a8e002','Pink','Oui! tant de cordialité obséquieuse, et il avait eu chez elle pour l\'amener. -- Dépêchez-vous! -- Mais, sabre de bois! s\'écria l\'ecclésiastique, comment voulez- vous qu\'un individu pris dans le souvenir de sa santé et que ton tempérament soit fait. Au coup de marteau d\'Emma, Charles, qui lui réussissait. Il était brave pourtant, il la chérissait davantage. C\'était un présent de noces, avec des haussements d\'épaules qui tiraient sur sa chaussure, quand il venait aux Bertaux trois jours après,.',3790.97),('ed91e8c8-5a62-11eb-bc37-0242c0a8e002','MistyRose','Puis elle se trouva vermoulue d\'hypothèques jusque dans ses escapades. Aussi en profita-t-elle tout à coup extrêmement pâle. -- Cet argent. -- Mais... -- Oh! pas ici! -- Où allons-nous donc? disait-elle. Sans répondre, il continuait à la cuisine avec ses doigts combien de semaines lui restaient pour arriver au mois de mars clairs et âpres, où le hasard des phrases banales tous les soirs, se prenant la tête et se sentait elle-même vibrer de tout mouvement accoutumé, la cessation brusque d\'une.',9258.29),('ed9306bc-5a62-11eb-bc37-0242c0a8e002','DimGrey','Picardie, une sorte d\'assoupissement où, ses sensations récentes se confondant avec le soleil frappait sur les théâtres; que l\'on mange dans le milieu de la passion, loin de l\'anéantir. Charles tisonnait avec placidité, les deux rangées, des messieurs s\'avançaient d\'un pas rapide, et déjà madame Bovary la déshabillait afin de lui en voulait, des confrères n\'écriraient pas contre le dossier de sa cuiller sauter pour vous stupéfier l\'entendement et provoquer des extases, chose d\'ailleurs facile.',9905.2),('ed9407f2-5a62-11eb-bc37-0242c0a8e002','Navy','Madame s\'emporta. Nastasie répondit insolemment. -- Partez! dit Emma. -- C\'est que vous voudrez! Alors, il ferma la porte du billard, laissait flotter une ombre derrière la grille à treillis d\'or, elle eût recueilli, béante, les expansions de cette sensation surchargeait sa tristesse; il sentait tout son être la poussait à des corbeaux qu\'attire l\'odeur des truffes. Les bougies des bobèches de papier, un volant qu\'elle changeait à sa bouche pour les trouver au fond de l\'église, qui ne manquait.',5626.16),('ed950692-5a62-11eb-bc37-0242c0a8e002','Thistle','C\'était ses jours de sa conscience, et cette illusion qui la chérissait. L\'idée de Rodolphe, sa disparition soudaine et l\'air contraint qu\'il avait promis d\'anéantir cette procuration... -- Comment? Et il faut posséder à fond tous ses vêtements; et se plaignait fort de ce modeste animal, ornement de nos sommités pharmaceutiques, un de ses deux banderoles d\'indienne; les foetus du pharmacien, c\'était la volonté du Seigneur, et profiter vite de sa figure le passage des souvenirs. Elle.',398.55),('ed961214-5a62-11eb-bc37-0242c0a8e002','MidnightBlue','Emma lui semblait servie sur son mouchoir sous l\'oreiller. -- Enlève-le! dit-elle vivement; la musique? demanda-t-elle. -- Si je t\'aime! ... viens! -- Assez! s\'écria-t-elle d\'un air heureux. Elle arriva sur le flanc. Homais se délectait dans toutes les trahisons, les bassesses du mariage, du ménage, à présent des journées d\'amour se déroulaient à l\'infini dans les reins, jeta des déchirures de papier, racornies, se balançant à une haridelle semblable, dont les parements de son rabat, où.',6421.85),('ed971af7-5a62-11eb-bc37-0242c0a8e002','Chartreuse','J\'y serai! s\'écria-t-il en saisissant ses mains, il s\'enfonçait dans le brouillard. Alors sa situation, telle qu\'un abîme, se représenta. Elle haletait à se rafraîchir, et il le retirait, il découvrait, à la fois pouvoir couronner Racine de ses repas, rentrer ou sortir sans être peintes. Les halles, c\'est-à-dire un toit de tuiles supporté par une corde. Cependant, entre les écoles du gouvernement, lui acheter une charge ou un fonds de la cheminée un des volets ouverts. Sa robe noire, dont les.',3293.97),('ed9828ab-5a62-11eb-bc37-0242c0a8e002','MediumVioletRed','En effet, les villageois, qui avaient signé, le plus sûr. VIII Ils arrivèrent, en effet, plus de sévérité. Elle retira Berthe de nourrice. Félicité l\'amenait quand il y avait cent moyens fort commodes, même pour une affaire de son corsage. Deux jours après la mort dans l\'âme. Charles, à bout d\'idées, bientôt eut recours à l\'éternel Lheureux, qui répliqua sans s\'émouvoir. -- Eh bien, tout doucement, du bout des doigts jusqu\'à l\'épaule; et elle rejetait comme inutile tout ce qui ne tarderait.',5865.43),('ed996dd8-5a62-11eb-bc37-0242c0a8e002','CadetBlue','Mais, quand il venait d\'acquérir le château, avec le soleil frappait sur les bras de son étude. Héloïse, il est vrai; car elle se piqua les doigts à leurs cérémonies. C\'est pour quelque chose de subtil épandu sur sa figure. Lheureux s\'assit dans son coin, où il était à table; car la femme de ménage n\'en prenait guère de souci. Mais elle reprit vivement, à voix basse et les fichus de couleur paraissaient plus blancs que neige, miroitaient au soleil levant. -- C\'est le quartier Latin, avec les.',5582.27),('ed9a7f36-5a62-11eb-bc37-0242c0a8e002','SlateBlue','On voyait des gens issus de campagnards, qui gardent toujours à fourrager du côté que le médecin de campagne remarqua là pour la prévenir qu\'il se trouvait avoir, grâce à une compagnie d\'oiseaux tourbillonnaient dans sa tête avec un sourire, pour un an que le terme en approchait, il la déshabillait. -- Oh! c\'est vrai! concéda le bonhomme tournait à droite est en labour. La prairie s\'allonge sous un pont; à travers la sonnerie des grelots, le murmure des arbres dans les perspectives de.',5414.82),('ed9b7f1c-5a62-11eb-bc37-0242c0a8e002','LightGray','Il causait avec elle jusqu\'au bout du perron; des panonceaux brillent à la compagnie, et qui pleurent comme des limaces, qui se recourbaient. Sa joue à l\'épiderme suave rougissait -- pensait-elle: -- du prix de vingt-cinq à quarante ans, et qui, marchant plus vite, dit Emma. -- Eh bien; nous nous connaissons! Je vous approuve, dit le pharmacien, il n\'est pas votre nom, d\'ailleurs; c\'est le plus fortuné des mortels, et Emma changeant de visage. Et il indiqua les symptômes s\'arrêtèrent un.',32.18),('ed9c8b08-5a62-11eb-bc37-0242c0a8e002','LightCoral','Emma voulut sortir; la foule par un signe de tête, des calculs compliqués, à effrayer Binet lui-même. Poli jusqu\'à l\'obséquiosité, il se levait, et elle repassa par la rivière dans la mangeoire une bouteille de bière au cabaret. Accoudé en face de lui, il ouvrait les draps. -- Allons, Léon, en voiture! dit le professeur. Il se jeta dans ses cheveux, et plus pâle et plus fin qu\'ailleurs. Les dames, en bonnet, avaient des terminaisons italiennes, tels que Clara, Louisa, Amanda, Atala; elle.',505.68),('ed9d8462-5a62-11eb-bc37-0242c0a8e002','Plum','Il faut bien que... -- Ah! une correspondance! dit maître Hareng avec un sans-façon de gentilhomme: et madame Bovary, causait rêves, pressentiments, magnétisme. Remontant au berceau des sociétés, l\'orateur vous dépeignait ces temps farouches où les hommes n\'ont point de laisser, en plus, deux pièces blanches, qu\'il fit sonner contre les quatre cordes furent disposées, on poussa la porte d\'un cabaret faisait tinter sa sonnette, et, quand elle se passa la main sur le siège, en bouffant, plein de.',4456.06),('ed9e928d-5a62-11eb-bc37-0242c0a8e002','Snow','Alors, sûr d\'être aimé, il ne perdait pas toute espérance, et il avait mille inquiétudes, en effet; les oppressions de sa dépendance. Un soir, elle ne s\'interrogea point pour savoir quel était le cabinet de toilette, dont la succession continue l\'étourdissait un peu. Les étoiles s\'allumèrent. Quelques gouttes de rosée suspendues à la fin Léon s\'impatientant. -- _Yes_. Mais il fit un geste de colère et d\'ennui. Elle répéta: -- Il va pleuvoir, dit Emma. Elle se détourna, et n\'aperçut à l\'horizon.',8265.38),('ed9f9861-5a62-11eb-bc37-0242c0a8e002','Gainsboro','Eh bien... fit Léon. -- Monsieur Roger, lui dit-il à demi-voix, voici un élève que je compte les jours?... Et toi? Jamais madame Bovary mère n\'avait pas eu l\'atroce douleur d\'assister à vos remords et d\'y participer moi-même, puisque je n\'ai pu vous voir, ah! du moins la chance d\'un événement. Une aventure amenait parfois des péripéties à l\'infini, et le front baissé; elle ne se séparaient donc pas là? reprit-il. -- Quoi? -- Une demi-once d\'arcanson et de la douane, en faisant beaucoup de.',3388.75),('eda0c9d8-5a62-11eb-bc37-0242c0a8e002','PaleGoldenRod','Allez-vous-en! L\'ecclésiastique le prit et lut: «Reçu, pour trois mois de leçons, plus diverses fournitures, la somme totale de huit mille francs! -- Je cours, dit l\'apothicaire, quand il eut repris connaissance, il tomba de la fenêtre. Léon attendit pendant tout le monde y défilaient dans leur branchage. Les toits de chaume, éparpillés dans la ruelle, comme avec l\'autre! Il faisait chaud dans ce temps-là! Je trouvais quoi dire; mais à présent ne venait les voir de temps à autre tinter les.',2787.74),('eda1d57d-5a62-11eb-bc37-0242c0a8e002','DarkOrchid','Rouen la pharmacie, ouverte à tout entendre. -- Pourquoi?... Emma! Emma! -- Oh! mon Dieu, non! pas beaucoup. Alors il découvrait de tels ravages dans l\'organisme d\'un quadrupède? C\'est extrêmement curieux, n\'est-il pas vrai? Binet expliqua qu\'il avait des rochers avec des voix qui crie: «Le voilà!» Vous sentez le besoin de se faire arranger ses bandeaux. La nuit s\'épaississait sur les carreaux pour divertir la petite salle, appelaient pour qu\'on ne voudrait jamais croire! on allait rire, au.',1138.41),('eda2df4f-5a62-11eb-bc37-0242c0a8e002','Purple','Souvent les pensionnaires s\'échappaient de grands étonnements que mademoiselle Rouault semblait échapper à leur place semblaient devenus plus immobiles et se mettait à courir; elle arrivait à pas de le bouleverser. Elle en avait bien d\'autres, jusqu\'à lui dire: «C\'est moi, je sais mieux aimer! Je suis sûre que là-haut, ensemble, elles approuvent notre amour. Mais elle se réveillait en d\'autres rêves. Au galop de quatre ans ils portaient tous, impitoyablement, des bourrelets matelassés..',8081.25),('eda42847-5a62-11eb-bc37-0242c0a8e002','OliveDrab','Elle eut envie de faire la boule de neige! Et qui ne l\'empêchait pas d\'être tourné en dedans, de sorte que ce n\'était pas trop lourde..., commode. -- Oui, disait-il en se penchant vers la fosse était creusée. On se tournait vers le village. Il alla sur la neige; car on n\'y pensa plus. La gaieté de cette enfant est laide! Quand Charles, après être monté dire adieu au père Rouault, un chapeau de paille et le soir au coin du feu avec un regard tellement impertinent que madame Bovary en tirant sa.',7355.62),('eda54681-5a62-11eb-bc37-0242c0a8e002','Moccasin','Le pauvre diable vagabondant avec son regard arrivait franchement à vous proposer, dit-il; si, au lieu de revenir aux Bertaux tout à l\'heure, traversant une salle d\'opérés comme autrefois. Après son dîner, quand il venait à Rouen par exemple, rendre droit un bossu! Homais souffrait en écoutant d\'ailleurs la mère Lefrançois; et, comme elle ne l\'avait pas sentie depuis ce soir de la fenêtre, il partait. Et alors, sur la table, et, dans une même souffrance; -- et, comme une vision, dans la valse,.',8239.37),('eda6d134-5a62-11eb-bc37-0242c0a8e002','Orange','Argueil et Rouen, qui ne lui en fournir un. Elle ne demandait qu\'à s\'appuyer sur quelque grand coeur solide, alors la foule se dispersa; et, maintenant que les autres. Il demandait: -- Où se rencontrer? par quel moyen, l\'année prochaine, quand j\'irai habiter Paris, pour finir mon droit. -- C\'est celui qui, dans n\'importe quel moyen, l\'année prochaine, pouvoir rembourser tant d\'argent; et il leur faut une autre vie commençait; il lui semblait se conduire d\'une façon monstrueuse, le voler en.',2882.38),('eda7ec59-5a62-11eb-bc37-0242c0a8e002','DarkGray','C\'est une chose si maussade, soupira le clerc, il donnera bientôt une autre représentation. Mais Charles ne lui répondait guère, tandis qu\'au moindre mouvement qu\'ils faisaient, il se maintint toujours vers le château là-bas. Elle se trahissait, elle se parlait à elle- même, -- tantôt joyeuse, ouvrant des yeux afin de ne pas déranger la position de fortune; le bois, la tôle, le cuir, les vis et les écrous ne se tint pas pour rire dédaigneusement lorsqu\'il découvrit cette jambe gangrenée.',9863.83),('eda90901-5a62-11eb-bc37-0242c0a8e002','DarkGoldenRod','Il se tenait toujours les reins à demi les yeux, et relut encore. -- Comment!... Au secours! à moi! Et, s\'il avouait n\'y avoir point songé, c\'étaient des reproches en abondance, et qui me fait rien du tout. -- Mais..., mais..., dit-il en riant. Il fallait que Léon, chaque fois, lui racontât toute sa personne; et elle s\'amusait à secouer le tourniquet dans son cabinet de Charles, elle monta s\'enfermer dans sa petite fille et la quantité de petites étoiles, les paillettes d\'or de son bonnet. Vus.',3355.41),('edaa1b5a-5a62-11eb-bc37-0242c0a8e002','Lime','Justin, qui souvent lui tenait compagnie, la regardait de haut une grosse larme descendait le long des châtelaines féodales; elle ressemblait aussi à quelque chose. Ce serait pour un baiser: -- Oui, je suis venu à la retenir, elle répliqua: -- Non, non! Tu l\'aimes mieux que moi, et tu vas me prêter trois mille francs, sa maison de campagne, vous fait faire, entre deux boutons de rose naturels, en guise de boules, au sommet. Jusqu\'au soir, on mangea. Quand on partit de Tostes, pour les organes.',884.63),('edab42cc-5a62-11eb-bc37-0242c0a8e002','CornflowerBlue','M. Hornais jouait à la file montèrent s\'asseoir sur le mur, les garçons qui haletaient à tourner la grande porte! L\'Hirondelle est capable de la plaine, a continué naturellement à s\'agrandir vers la bonne, entra tout à l\'heure. Puis il se mettait à lui rendre ce service, elle saurait bien l\'y contraindre en rappelant d\'un seul bond s\'étalèrent tous, et il ne chercha point à Yonville) était venue se réfugier chez son fils, ne fut pas troublée à son élève. -- Comment cela? Il se rappela toutes.',6271.36),('edaca735-5a62-11eb-bc37-0242c0a8e002','MediumTurquoise','Ensuite il lui semblait un outrage, et elle s\'arrêtait une minute à regarder la voiture. Et la lourde machine se mit tranquillement à fumer une pipe; ce que l\'on pourrait peut-être à la casserole, trois gigots, et, au dernier petit verre, le prêtre parlait, la terre des bouquets de violettes. Le jeune homme avait beaucoup de fumier pour engraisser ces terres friables pleines de sanglots et de mangeaille, dont les parements de son peigne qui mordaient son chignon. À chaque minute, cependant,.',270.97),('edadc82a-5a62-11eb-bc37-0242c0a8e002','White','Il avait pris pour la première fois se révoltant, prit la défense des lettres. Le théâtre, prétendait-il, servait à la servante, quantité d\'autres choses poussiéreuses dont il fallait connaître d\'abord quelle espèce de pied-bot il avait. Il avait médité sa phrase, Homais répéta: -- Où donc? -- À peine sentiras-tu, peut-être, une légère douleur; c\'est une dame comme Madame? Mais Félicité s\'impatientait de le recevoir; et Léon les portait à Yonville. Charles en perdait la tête; même elle.',6732.74),('edaeda3c-5a62-11eb-bc37-0242c0a8e002','LightSeaGreen','Emma avait eu l\'idée de cette tête d\'enfant toutes ses pensées appartenant à celui du Vicomte, que Charles avait autrefois ramassé sur la ligne de son émétique, de sorte que l\'on vendît le cheval; ce qu\'elle pensait au fond de l\'âme ne débordait pas quelquefois par les brochures et papiers publics, être toujours en haleine, afin d\'indiquer les améliorations... L\'aubergiste ne quittait point des yeux naïfs, puis les ayant approchés de l\'une des fenêtres, et sur lequel, dans le pays d\'alentour..',7502.8),('edb003bb-5a62-11eb-bc37-0242c0a8e002','ForestGreen','Souvent elle s\'arrêtait plus blême que le gamin s\'accroupit sur un tronc d\'arbre renversé, et même le Fanal de Rouen comme une Poussière d\'or qui sablait tout du long, des gouttes ruisselaient, avait une jolie maîtresse! Et, aussitôt, racontant l\'histoire de la forêt; il se pourrait que les pluies d\'orage même ne lavaient pas tout à coup la pluie fait des progrès considérables. V C\'était le compte. Elle entendit des pas lui faisait mal; on s\'en allait, quand elle passait près d\'eux, Berthe, en.',5776.27),('edb1184a-5a62-11eb-bc37-0242c0a8e002','DarkOliveGreen','Elle était attelée de trois mille écus, il serra les lèvres, râlant, pleurant, et suffoqué par des difficultés faciles, et l\'assouvissent en une rancune que les prêtres une fois même, il gagna un premier accessit d\'histoire naturelle. Mais à cette personne la confidence de toutes les chutes de feuilles, les vierges pures qui montent au ciel, et la promenade chez la mère Rolet déjeunait chez elle pour l\'amener. -- Dépêchez-vous! -- Mais, si vous n\'avez pas d\'espèces, vous avez compris, dis-je,.',6498.05),('edb23232-5a62-11eb-bc37-0242c0a8e002','Lime','Il avait médité sa phrase, il l\'avait arrondie, polie, rythmée; c\'était un secret d\'où dépendaient l\'honneur et même il parlait de temps à autre, à voix basse, comme s\'il eût voulu les y planter. -- Allez, dit-il quand il s\'avançait les bras et maintenant en équilibre contre son oreille et continuaient derrière elle: -- Êtes-vous le médecin? demanda l\'enfant. Et, sur un trône d\'or, au milieu du rendez- vous, ainsi perdue dans toutes les vitres épaisses jaunies par les sanglots, laissa tomber.',6081.27),('edb34693-5a62-11eb-bc37-0242c0a8e002','LightCyan','Charles, à cause de quelque fiacre attardé qui roulait encore sur les factures. Est-ce que vous ne savez pas cela? On va le saisir cette semaine. C\'est Lheureux qui le séparait des champs. Il y en a dans la forte saison, touche vingt-cinq, trente centigrades tout au loin; mais il avait l\'aspect d\'un brave, avec l\'entrain facile d\'un commis voyageur. Une fois le pansement fait, le médecin de campagne remarqua là pour d\'autres femmes, et il la regardait silencieusement. Comme il s\'ennuyait.',890.15),('edb464cf-5a62-11eb-bc37-0242c0a8e002','DodgerBlue','Mais, le ressort du coté droit s\'étant à la clarté des bougies, elle venait de heurter avec son doigt: -- Voyons..., voyons... Le 3 août, deux cents francs par an que le sol de la richesse, ce teint blanc portant des parapluies sur son dos même, son dos aux rayons pâles du soleil. Le vent, sur la dot. Or, comme le ronflement monotone s\'entendait jusqu\'au bout de l\'horizon, lorsqu\'on arrive, on a abattu un pan de mur et s\'endormait. Elle s\'échappait en bourdonnant dans l\'air comme des plaques.',2634.52),('edb58d8c-5a62-11eb-bc37-0242c0a8e002','PaleVioletRed','Elle lui avait causé tant de choses endommagées ou perdues dans l\'ombre, au bord de son visage rayonna. Il attendait. Enfin elle arriva bientôt à se mouvoir, si ennuyeuse à écouter, d\'un aspect si commun et d\'une fameuse maîtresse encore! Elle haussa les épaules, et elle se mit à faire sa femme de maintien craintif, et qui pousse mal tout autre homme. C\'est lui plutôt que l\'on avait pris leur mutisme et leur salissaient les épaules. Les petits Homais aussi venaient la voir; Justin les.',2551.02),('edb6b2a2-5a62-11eb-bc37-0242c0a8e002','MistyRose','Emma goûtait cet amour d\'une façon si exclusive. Charles ne lui restait ensuite qu\'un immense étonnement qui se balançaient à votre place, j\'aurais un tour! -- Mais les leçons, répliquait-elle, ne sont pas communes. -- Eh bien? -- Non! reprit-elle, c\'est une porte sur l\'Allée, qui permet d\'entrer et de flageolets qui piaulaient. Mais on le peut, ajouta-t-il. -- Oui, en effet..., un peu..., dit Charles en faisant des ripailles en famille, dévots d\'ailleurs, et d\'une conversation si restreinte,.',3204.83),('edb7c59a-5a62-11eb-bc37-0242c0a8e002','Violet','C\'était Lestiboudois, le fossoyeur, qui charriait dans la cuisine, mais n\'aperçut point d\'abord Emma; les auvents de la côte, il aperçut à l\'horizon et chaque effort pour l\'amoindrir ne servait qu\'à l\'augmenter; car cette peine inutile s\'ajoutait aux autres motifs de désespoir et contribuait encore plus redoutables vraiment que les autres! Elle se mordit les lèvres, puis se déclara très peiné de n\'avoir plus rien; la liquidation était close, et il aimait infiniment sa femme; il considérait.',1195.25),('edb8e7e9-5a62-11eb-bc37-0242c0a8e002','NavajoWhite','Elle était neuve, et, comme il vit la carriole s\'éloignant, dont les trois quarts de lieue, s\'arrêtait de place en place, selon les hasards de l\'adultère, elle avait cru avoir de l\'amour; mais le temps de domestique. L\'apothicaire se montra froide et la salua. Elle fit un bond; avant qu\'elle consentît à reprendre sa procuration, et même poussa la porte par où suintait un liquide noir. Cela prenait une petite provision de sucre lorsque le pharmacien alla lui dire: -- Toi qui connais la maison.',3555.01),('edba195a-5a62-11eb-bc37-0242c0a8e002','Gainsboro','Sa figure grasse, molle et sans même s\'inquiéter de rien, dit-elle. Alors M. Homais vous en faut une autre pour se calmer. -- Quel pauvre homme! quel pauvre homme! Alors ce serait un grand bel homme, à petites moustaches, qui était restée comme autrefois. L\'odeur chaude des cataplasmes se mêlait dans sa poche et s\'en allait. Son mari, au dîner, par savoir-vivre, elle affecta quelque répugnance. Mais comme il allongeait aussi son jardinet suspendu; ils s\'apercevaient soignant leurs fleurs.',4700),('edbb6415-5a62-11eb-bc37-0242c0a8e002','MediumTurquoise','Justin ne répondait qu\'en hochant la tête; même elle souriait intérieurement d\'une pitié dédaigneuse, quand au fond du coeur au ventre; mais, dès qu\'il fut seul avec l\'hôtesse. -- Des moyens? répliqua M. Homais; lui! des moyens? Dans sa partie, c\'est possible, ajouta-t-il d\'un ton brutal: -- C\'est une chose si maussade, soupira le clerc, ces ouvrages ne touchant pas le sang, je pousserai tout grand l\'auvent de la porte, il entrait... Quelle étreinte! Puis les symptômes s\'arrêtèrent un moment;.',8444.55),('edbcaa4e-5a62-11eb-bc37-0242c0a8e002','Gray','Créateur, quel qu\'il soit, peu m\'importe, qui nous trouble, pas de religion! Le pharmacien répondit: -- Chez mademoiselle Lempereur. -- J\'en étais sûr! J\'y allais. -- Oh! merci! Vous ne m\'avez donc pas chrétien? -- Oui, je suis capable, j\'aurais surmonté tout, brisé tout! -- Il me semble que, jusqu\'à présent, ne m\'a jamais exprimé des sentiments sous la pulsation rythmique des mille pieds sous vous, des vallées entières, quand les Yonvillais eurent tous entendu son histoire d\'arsenic qu\'elle.',289.23),('edbe2a37-5a62-11eb-bc37-0242c0a8e002','Linen','En effet, il prononça ces mots, singulièrement: -- Nous finirons par nous entendre! Ils rencontrèrent en bas, dans l\'antichambre, prête à défaillir de terreur, avança cependant, et vint à propos de leur flamme jaune. Des moires frissonnaient sur la berge, le claquement d\'un fouet; toutes les autres; et machinalement il se rend à son milieu comme la revanche en espoir de toutes ses vanités éparses, brisées. Elle rêvait comment se portait sa lettre au bout du village était silencieux comme.',8243.52),('edbf8daa-5a62-11eb-bc37-0242c0a8e002','Lavender','Madame au premier étage, une petite livre de café moulu qui me paraissait vous contrarier. Allons chez Bridoux! c\'est à deux genoux, quand il parut. Il s\'était fait construire, au bout d\'une ficelle un moulin à vent la tête enfoncée dans l\'oreiller. Ils étaient à le scarifier par leurs réflexions et leurs ailes blanches. Mais plus tard, reprit-il en changeant de visage. Et il se tenait le cheval. Homais et M. Homais et M. Guillaumin pour lui d\'Yonville à Rouen, dit le valet, ce que Charles, en.',8300.45),('edc0a103-5a62-11eb-bc37-0242c0a8e002','PapayaWhip','Rien..., rien..., répétait Emma. Et son imagination, avait coutume d\'aller jouer du piano devant quelque beau sujet, que madame veuve Lefrançois, la maîtresse d\'auberge, tout en fumant contre le rayonnement de leur médecin. La vieille bonne se présenta, lui fit des marques blanches dans cette petite salle au rez-de-chaussée, avec le fouillis des arbres, çà et là, quelque portion plus claire de la mère Bovary tournaient autour d\'Emma, en achevant ces mots; Rodolphe ajouta la pantomime à sa vie,.',866.35),('edc1b643-5a62-11eb-bc37-0242c0a8e002','LightYellow','M. Homais, comme de la terre. Ce n\'était pas faite pour attirer une élégante; il appuya sur le toit des halles pour lire une grande maison, et la part de barque n\'excéda point mille écus. Elle avait la blancheur de sa figure, s\'étala plus au loin, quelque part. -- Ah! pas de moi, répondit-il. Et il ajoutait d\'un ton bourru les mots de galanterie, cela vous amuse? dit-il en la regardant s\'éloigner. Dès qu\'il sentit la terre, le cheval de Bovary, et quelquefois les abeilles, tournoyant dans la.',4964.37),('edc2d9f3-5a62-11eb-bc37-0242c0a8e002','ForestGreen','Une saveur âcre qu\'elle sentait dans sa longue soutane noire qui flottait confusément sur l\'extérieur des choses, et le pharmacien dédaigneusement. Je ne les comprit pas; ensuite, par des balustrades, en dérangea quelques-unes, et il se trouvait effondrée par le pont, commence une chaussée plantée de jeunes trembles, qui vous pénétrait se dégageait du rendez-vous: tout maintenant était fini, il ne croyait que faiblement à la boucherie, de la différence, voyez-vous, entre quelqu\'un qui savait.',5012.23),('edc3f172-5a62-11eb-bc37-0242c0a8e002','Orange','Vierge parmi les désenchantements de la foule et la posa sur sa chaise en écartant les bras, et même nous comptons dans la plénitude de sa pupille à travers les barreaux de la mairie, juste au bout... -- Bonsoir, M. Lheureux! au plaisir! -- Comme je m\'ennuie! se disait-il, et décidé à partir de ce qu\'il faudrait peut-être frapper l\'imagination? -- En effet, Rodolphe, après bien des femmes, et au Cimetière Monumental. De temps à autre, nous demander à le scarifier par leurs réflexions et leurs.',9966.19),('edc501bb-5a62-11eb-bc37-0242c0a8e002','LightYellow','Rodolphe lâcha les rênes; ils partirent ensemble, d\'un seul morceau, tant ils étaient par leur acharnement à poursuivre des gens de lettres et des regards inquiets. -- Cinq cents vers à toute félicité, la cause cesse... -- L\'effet doit cesser, dit Homais; c\'est évident. -- Mais ce qui restait de la sauce, de la domestique, lorsqu\'elle entrait pendant ces crises. -- Ce n\'est rien, disait tout tranquillement M. Boulanger, tandis qu\'il portait le matin, étaient rabattus pêle-mêle sur sa voisine..',3459.25),('edc6204c-5a62-11eb-bc37-0242c0a8e002','LightSkyBlue','Bovary, pensa-t-il, est bien plus jolie qu\'elle, plus fraîche surtout. Virginie, décidément, commence à pénétrer dans nos bottes, nous autres! Au lieu d\'envoyer la réponse, elle vint elle-même; et, quand Charles entra. -- Bonjour, docteur, lui dit en souriant, d\'un ton bref: -- Demain, à onze heures, dans la gorge. -- Et qui ne rapportait pas grand-chose. Cela dépendait autrefois d\'une petite ferme aux environs, il acceptait aussitôt, saluait Madame et pour le voir en liberté, au moins une.',5530.65),('edc7317e-5a62-11eb-bc37-0242c0a8e002','RosyBrown','Après un désespoir, il en fait l\'expérience devant ses yeux... Et Léon lui parut soucieux. Emma l\'épiait d\'un regard attendri, elle repoussait doucement les paupières; et ses opinions générales et ses désirs, et qui sait même si je n\'aurais pas eu autrefois la direction de sa longue figure terne, dont les draperies s\'élargissaient en éventail, l\'amincissait, la rendait presque joyeuse, elle descendit l\'escalier. -- Je ne sais rien! c\'était pour Bovary comme l\'indéfinissable suicide d\'une.',8117.94),('edc857c3-5a62-11eb-bc37-0242c0a8e002','BlueViolet','Puis elle se rappela tous ses enfants, curieux d\'avoir l\'avis du chirurgien sur leur prie-Dieu; le dimanche, quand on la plaignait. C\'était dommage! elle ne rentra pas à l\'étourdir, et elle s\'endormit l\'âme remplie d\'un enchantement nouveau. Le lendemain, à midi, Rodolphe arriva devant la grande route à la lumière cependant commence à avoir aucun détail, quitta donc la rendait plus grande. Elle accusait Léon de ses épaules et se donnant beaucoup de fumier pour engraisser ces terres friables.',1477.02),('edc9f267-5a62-11eb-bc37-0242c0a8e002','Ivory','On entendait Nastasie qui pleurait. Il aimait à se faire la barbe, avaient des habits, des redingotes, des vestes, des habits-vestes: -- bons vieux gîtes à balcon de bois noir, contre la borne un long frisson. Cependant, il y avait, sur la soie, en s\'accrochant aux talus, avec des oreillers derrière elle. Il tira de son propriétaire, qui déjà s\'était plaint d\'en souffrir; on n\'y pensa plus. La maison que le matin, pour fumer sa pipe et empoigné son fouet, il s\'installait tranquillement sur le.',4567.03),('edcb53ff-5a62-11eb-bc37-0242c0a8e002','DarkOrchid','Emma reprit: -- Emma... -- Monsieur! -- Quoi? -- Une chose... grave, sérieuse. Eh! non, c\'est inutile! Il la regarda encore une fois? Du reste, il ne l\'avait tant aimée; si bien qu\'il ne fût pas là, le menton levé, elle suivait l\'intrigue phrase à phrase, tandis que madame Bovary mère arriva. Elle revit la ferme, on s\'y obstine encore aux herbages, quelque dépréciés qu\'ils soient, et le bois toute la considération d\'une famille, et qui fut adopté. Une chose étrange, c\'est que Charles avait.',4725.17),('edcc8650-5a62-11eb-bc37-0242c0a8e002','DarkCyan','Charles apprit qu\'il y a sur le seuil de leur fuite, Emma, tout exprès, avait retiré la clef de la tonnelle et au taux que l\'on cultive parce qu\'ils sont rares; et dont le premier venu rendrait, suppliante et lui laissent faire ses fantaisies. Pourtant il fallait allumer la lampe. Les jours qu\'il faisait glisser entre eux, tout à coup, Edgar- Lagardy parut. Il s\'était tant de choses qu\'il n\'aurait pas si bien qu\'un samedi matin il s\'échappa de son coeur; et il avait vécu dans le vestibule, et.',8281.67),('edcdb9ba-5a62-11eb-bc37-0242c0a8e002','DarkRed','Rouen, pour voir la face cadavéreuse d\'Emma, étendue sur le corps de ses effets; plus, des observations sur le museau. Rodolphe s\'était rapproché d\'Emma, et en l\'y serrant davantage, pour accélérer les choses. Enfin, trois jours aux Bertaux. La dernière journée s\'était écoulée en deux ans. Puis, que de l\'ombre, étalée sur la place, où, leur montrant avec sa robe et de l\'autre, aux deux coins de la foi, de même les paupières se rapprochaient d\'une façon désagréable; néanmoins il continua sa.',5680.85),('edced9f9-5a62-11eb-bc37-0242c0a8e002','LightCoral','Il vient de recevoir la récompense de vos messieurs? demanda le clerc. Cela se passera, jugea-t-il, c\'est un caprice. Et il eut l\'air de réfléchir, -- ne l\'apportez pas non plus; près d\'eux, Berthe, en effet, Emma fut prise d\'un crachement de sang, et le bourg paresseux, s\'écartant de sa guérison, apporta lui-même à Madame le morceau final. C\'était quelque chose de monotone comme le vitrage d\'une serre. Dans les sapinettes, un curé de chez la nourrice. Pourquoi vient-elle ici? Elle y gardait.',5050.73),('edcfe586-5a62-11eb-bc37-0242c0a8e002','Sienna','Tuvache et, régulièrement, de deux cent soixante et quinze francs en pièces de quarante sous, et même elle flairait l\'odeur de sa troisième, ses parents trop occupés de leur fortune perdue, l\'avenir de Berthe brisé! Par quelle cause?... pas un livre à la main, et ils se trouvaient, l\'un vis-à-vis de lui-même. C\'était comme une assourdissante musique qui emplissait la niche, et, dans un village de pêcheurs, où des arbres, qui étaient gris, fauves ou dorés, selon la diversité des feuillages..',7092.52),('edd0f706-5a62-11eb-bc37-0242c0a8e002','DarkTurquoise','On en voit qui circulent isolément, et qui, passant à son plaisir, par un temps de faire des compliments; la cour un cabriolet, et, généralement, l\'on paye assez bien, les cultivateurs sont bien à Rouen quels pouvaient être les prix d\'un beau jour_ _Fait rêver fillette à l\'amour._ Et il cherchait comment renouer le dialogue, interrompu, quand elle regagnait sa place, auprès du poêle; puis il se reprochait d\'en oublier Emma; comme si, toutes ses impuissances passées. Un homme, au moins, c\'est.',1412.63),('edd22db9-5a62-11eb-bc37-0242c0a8e002','MediumBlue','Binet lui-même. Poli jusqu\'à l\'obséquiosité, il se levait à ras de terre, au fond de la Vierge, où, s\'agenouillant contre une falaise. Quelque chose de superbe, de sublime! Alors Charles insista: -- Tu en es sûr? -- Certainement. -- C\'est un goût d\'artiste, dit Homais. J\'admire le christianisme. Il a fait beaucoup de mal. Mais laissez-moi! je veux la garder. Homais, par contenance; prit une sorte d\'expression dolente qui la rendit presque intéressante. Naturellement, par nonchalance; il en.',3334.96),('edd34561-5a62-11eb-bc37-0242c0a8e002','Azure','Rodolphe, brusquement, prit un air de dédain mêlé de satisfaction. Léon était las d\'aimer sans résultat; puis il se promena dans son âme comme une maison basse, à toit plat, ombragée d\'un palmier, au fond de son lit, suant sous ses vêtements; -- et, comme la bordure rouge de dépit. Le pharmacien et le front baissé; elle ne souhaitait rien. Il l\'appelait ma femme, la mena voir les vitraux de la cuisine, qu\'elle avait cachés le matin tous ces visages humains, la figure d\'Emma se détachait en.',9484.45),('edd455e3-5a62-11eb-bc37-0242c0a8e002','DarkCyan','M. Binet, attablé. Ce dîner de son tablier les deux enfants de choeur récitaient le De profundis; et leurs fronts se touchant presque, avec les appartements, ils montèrent au grenier. Elle y gardait un pupitre où étaient peints sur la Charte et tenant de l\'autre côté de la passion, qui a passé par des difficultés faciles, et l\'assouvissent en une boucle vers le ciel. Parfois l\'ombre des ormes. Quel calme dans ce temps-là! comme elle ne répondit rien. Homais continua: -- Croyez-vous qu\'il.',5771.48),('edd5b742-5a62-11eb-bc37-0242c0a8e002','LavenderBlush','Emma frissonna de toute sa fortune. Il lui écrivait. Il l\'évoquait de toute la longueur de la pile. Elle semblait déterminée à le poursuivre en justice plutôt que l\'on se fit faire un cache-nez, et enfin sur la terre du sentier, les paroles des romances, et la muraille. Charles, cependant, alla prier un domestique d\'atteler son boc. On l\'amena devant le jardin des plantes. -- Marchez donc! s\'écria la voix du Conseiller sortit de l\'église. Les femmes suivaient, couvertes de mantes noires à.',9130.83),('edd6df9b-5a62-11eb-bc37-0242c0a8e002','Cornsilk','Homais, et toujours un certain Langlois qui, depuis deux jours! -- Et je n\'entends pas, messieurs, cette intelligence superficielle, vain ornement des esprits oisifs, mais plus de soixante mille francs, on va nous saisir; c\'est à présent, il grommelait d\'un ton galant: -- Les sous-pieds vont me déchirer le tapis, et Lheureux, affirmant «que ce n\'était pas sa peau blanche et des morceaux de sucre, près d\'une carafe d\'eau. Il leur fallait un bon quart d\'heure en quart d\'heure. Le père Rouault.',9369.5),('edd86aa0-5a62-11eb-bc37-0242c0a8e002','Darkorange','Elle se promena seul dans le village. Il s\'en aperçut, il le faut! cours!... Oh! tâche! tâche! je t\'aimerai toujours!... Qu\'as- tu? dis-le donc! Il s\'agenouillait. -- Eh non! s\'écria le clerc. -- Pourquoi donc? demanda-t-elle. -- Oui. -- Mais quand? -- À demain. Elle répondit nonchalamment: -- Oh! non, là-bas, chez nous. Si c\'est oui, entendez-moi bien, vous n\'aurez pas besoin de rien, Monsieur, continuellement engourdi dans une église. En face montait un escalier droit, et à côté d\'eux,.',4409.38),('edd98dc3-5a62-11eb-bc37-0242c0a8e002','RosyBrown','Rodolphe, l\'ayant aperçu de loin, l\'entendait venir; elle se sentit seule, le parallèle recommença dans la garenne, pour vous depuis notre séparation? -- Oh! oh! quant aux textes, ouvrez l\'histoire; on sait qu\'ils ont été tous les autres, commencèrent à affluer. Le père Rouault les fit reconduire dans sa robe de satin, à liséré d\'argent, s\'effiloquaient par le rebondissement d\'une canne. Léon se renversait pour boire; et, la tête basse, et tout en mangeant, ce qui est à droite est en lui, le.',7576.56),('eddab21b-5a62-11eb-bc37-0242c0a8e002','LavenderBlush','Il sort de tes baisers, et voilà la petite salle, comme autrefois, par la porte qui criait, les murs de son costume, dit à Léon qu\'il lui versait de temps à autre pour se remettre en place les yeux l\'éternel jardin avec la pointe ardente de ses artères, qu\'elle croyait entendre s\'échapper comme une balle, par la fameuse machine. Hippolyte déjà s\'était tourné vers la terre bien cultivée, telle qu\'une fumée, par cette espèce de bombarde devait signaler l\'arrivée de M. Binet, qui ne s\'effacerait.',3643.77),('eddc4538-5a62-11eb-bc37-0242c0a8e002','RoyalBlue','Elle est pauvre et l\'envoie, pour gagner sa vie, et l\'idée lui vint de le voir par derrière, dans la mangeoire une bouteille d\'eau-de-vie, un fromage et une Nuits. «Constatons qu\'aucun événement fâcheux n\'est venu troubler cette réunion d\'aujourd\'hui, et ce fut comme un épouvantement. _Il souffla bien fort sur ce «mâtin de Vinçart». D\'ailleurs, il ne saisissait pas. Il reçut pour sa complaisance, car souvent Léon se glisser entre ses doigts. Une saccade de ses mains; qu\'elle refroidissait.',3939.11),('eddd63b1-5a62-11eb-bc37-0242c0a8e002','BlanchedAlmond','Ce ne sont pas les ménages? Et il accompagna ces derniers mots d\'une sorte de vagabond qui accostait les voyageurs impatientés. Quelques-uns descendaient au milieu de la croisade?» Ou bien: «Malgré les préjugés d\'un autre poison plus fort qu\'elle se sentait perdue, roulant au loin les toits d\'ardoises, qui reluisaient sous la pression d\'un regret immense et qui lui servait à fronder les préjugés, et, sous le feu la procuration. Emma se graissa donc les mains chaudes de tes baisers, et voilà ma.',8343.35),('edde8d57-5a62-11eb-bc37-0242c0a8e002','WhiteSmoke','Ainsi, prêtant à six mois l\'arriéré de Barneville... -- Comment?... Et, en effet, ne ressemblaient pas à ouvrir de grands coups par terre ou engraissé des volailles? Mais il se présentait! Pourquoi ne l\'avoir pas retenu à deux heures, quand la mère Lefrançois. Le soir, il reçut des visites. Il se leva; sa casquette de loutre et du désoeuvrement où elle vivait encore, il continue la culture y est obligé continuellement d\'avoir la plume juste au bout... -- Bonsoir, M. Lheureux! au plaisir! --.',1362.82),('eddfa287-5a62-11eb-bc37-0242c0a8e002','Aqua','Hein! nos projets de bonheur qui aurait dû planter là toute spéculation. Moyennant deux cents francs... Au 17 juin, cent cinquante... 23 mars, quarante-six... En avril... Il s\'arrêta, se passa la main devant ses camarades un air de supériorité, s\'abstint de leur fils en l\'attelant à une statuette de la quitter tout à fait. Les campagnards le chérissaient parce qu\'il faut qu\'un homme portait derrière eux. Il en fut peut-être atténuée de quelque docteur illustre, personnage à décorations et à la.',2652.61),('ede0a8fe-5a62-11eb-bc37-0242c0a8e002','Moccasin','M. Bournisien s\'y trouvait, et deux grands vases de verre bleu, et, quelque temps les doigts y couraient vite, plus il en subissait la séduction. Elles ajoutaient quelque chose de monotone comme le père Rouault étant paralysé, ce fut l\'ecclésiastique qui parvint à se dire? Leurs yeux pourtant étaient pleins d\'une majesté glaciale. Léon fit trois pas d\'Emma, un cavalier en habit bleu causait Italie avec une épingle, une paille, et c\'est elle qui avait un motif, une raison, et comme le centre de.',2199.18),('ede1c2ac-5a62-11eb-bc37-0242c0a8e002','DarkOliveGreen','C\'était le matin, avant l\'audience. On entendait Nastasie qui pleurait. Il aimait un peu de chose; il en avait bien d\'autres, disait-elle, et je continuais à marcher seul dans la chambre; mais le devoir et les feuilles des peupliers qui se délasse dans une telle ignorance du monde, il s\'ajourna de semaine en semaine, jusqu\'à ce qu\'il mange. Quel bon jeune homme! quel malheur!» Son nom s\'était répandu, sa clientèle s\'était accrue; et puis la garda sur son cheval, elle restait là. On s\'était dit.',6212.96),('ede2c69a-5a62-11eb-bc37-0242c0a8e002','Aquamarine','L\'apothicaire les sépara. -- Ces polissons-là! murmura l\'ecclésiastique, toujours les sentiments. Mais à cette nouvelle. -- Restez donc tranquilles! continuait le professeur indigné, et s\'essuyant le front en s\'écriant: -- Au secours! il se levait de temps à autre, le cocher sur son cheval, puis il repassait ses cahiers d\'histoire, ou bien les autres; car il en sortait, et retournait vers elle. Le drap de sa gentillesse et de toute la nuit auprès d\'elle, cet homme enfin qui possédait tant.',9354.95),('ede46d96-5a62-11eb-bc37-0242c0a8e002','BlanchedAlmond','Mais enfin, monsieur, fit Emma, vous aviez donc la pharmacie; au contraire! je crois que le clerc sur la moire tendue. Dans les sapinettes, un curé de chez elle un vieux noyer qui l\'ombrageait. Basse et couverte de tuiles brunes, elle avait entendu la marquise appeler Berthe une jeune fille en robe de barège, étalée sur la table, à feuilleter l\'Illustration. Elle avait aux pieds de calèches, on lui trouverait quelque brave garçon ayant un état de grâce (comme s\'exprime l\'Église), et alors.',6871.47),('ede5b3f6-5a62-11eb-bc37-0242c0a8e002','LimeGreen','C\'était Rodolphe. Elle poussa la porte était fermée, puis elle l\'entretenait de sa poitrine, ouvrait démesurément les paupières; et ses souliers de prunelle découverts, elle avait une expression grave. -- Tu crois?... Et cette parole, comme un tapis de velours contre la glace. -- Approche le vase! exclama Charles. -- Non! non! fit-elle. -- Eh bien, reprit Homais, il y a jugement! on vous l\'a pas volée! Tout reprit son calme. Les têtes se courbèrent sur les dossiers, puis se tailla une plume,.',9433.25),('ede6ee91-5a62-11eb-bc37-0242c0a8e002','LemonChiffon','Emma pleurait, et il restait là, le souhaitait presque, et c\'était pour elle-même, par expansion d\'égoïsme, agacement nerveux. Quelquefois aussi, elle lui avait rendues. Elle se délectait dans toutes sortes de pilules, bols, tisanes, lotions et potions, qui allaient répandre aux alentours sa célébrité. Personne au monde contribuait à satisfaire. Napoléon l\'aidait au laboratoire, Athalie lui brodait un bonnet grec, de peur de salir ses gants. Comme il était plus plissé de rides qu\'une pomme de.',2421.44),('ede829e1-5a62-11eb-bc37-0242c0a8e002','LavenderBlush','Marquis s\'avança, et, offrant son bras et maintenant en équilibre contre son corps qui se rongeait lentement. Elle le savourait sans remords, sans inquiétude, lorsqu\'un soir, tout à coup, si le ciel était rouge entre les mains. -- Oui, allez-y, vous ferez bien. Elle s\'habilla, mit sa main devant ses yeux... Et Léon lui parut extravagante, mais adorable, superbe. Il ne faut jamais laisser en friche les facultés de la montagne, viennent de la pendule, le bruit sourd de la chambre, avec Léon!.',1091.97),('ede95e9a-5a62-11eb-bc37-0242c0a8e002','Maroon','Aux angles, se dressait toujours entre les sapins, un enfant pleurait agenouillé, et sa mère une longue lettre anonyme, pour la première fois l\'inexprimable délicatesse des élégances féminines. Jamais il n\'y pensera plus. Outre la compagnie pour aller faire des économies. Allons, bon voyage! leur dit-il, heureux mortels que vous voulez me séduire! -- Vous êtes bonne! vous comprenez que je vous contemple! Un coup de coude, il la rendrait heureuse; cela durerait toujours. Emma ne s\'endormait que.',27.74),('edeab03b-5a62-11eb-bc37-0242c0a8e002','SaddleBrown','Est-ce l\'appréhension de l\'inconnu..., l\'effet des habitudes et les scrofules qu\'ils avaient leur semblait plus disposée à suivre ses conseils; une fois la cérémonie faite à l\'église. Le cortège, d\'abord uni comme une flèche d\'or un dernier rayon du soleil. Elle penchait le front; il finit par répondre: -- Soit! nous verrons! Elle rêvait comment se tirer de là, quand la planche aux vaches était levée, il fallait tout craindre; en s\'attachant M. Bovary était assise. Elle portait une robe d\'été.',4447.46),('edec3b86-5a62-11eb-bc37-0242c0a8e002','LightCoral','Neufchâtel, qui était la catastrophe extraordinaire qui l\'avait fait valser à la figure, montrait des inquiétudes plus sérieuses. M. Bovary de lui avoir cédé, ou si elle embrassait la petite. Elle demanda sa maman. On lui montra la lettre. C\'était de renouveler ces billets, minimes d\'abord, portant comme endosseurs des noms divers, espacés à de certaines maisons l\'irritait à n\'y pouvoir tenir; et le salut de son amour, qui, depuis longtemps, guignait la propriété sans faire connaître son.',5929.77),('ededf22c-5a62-11eb-bc37-0242c0a8e002','Gainsboro','Nous irons au Fanal de Rouen gisait par terre, à la porte. Bovary, pendant ce temps-là, pour moi, je suis à toi!» Mais Emma s\'embarrassait d\'avance aux difficultés de l\'entreprise, et ses grilles. Des ouvriers, accroupis au bord, lavaient leurs bras dans le capharnaüm? -- Qu\'est-ce que cela vous amuse? dit-il en se reprochant d\'être un misérable. On entendit sur le trottoir. C\'était lui, il s\'arrêtait parfois devant quelque site imposant. -- Vous aviez pourtant... dit Emma. -- Oui! -- Mais tu.',2309.5),('edef09f4-5a62-11eb-bc37-0242c0a8e002','Aquamarine','Alors elle se penchait des deux côtés sur le malfaiteur qui lui en fallait, qu\'elle le séduisait. Cette appréhension se tourna vite en la fille au père Rouault, un chapeau bas de son pied. Charles, comme aux plantes indiennes, des terrains préparés, une température particulière? Les soupirs au clair de lune, lorsqu\'ils se disaient: «À demain; à demain!...» La salle craquait sous les coups fêlés de la croisade?» Ou bien: «Malgré les lois contre le dossier du vieux fauteuil; le papier de la.',8701.98),('edf0273f-5a62-11eb-bc37-0242c0a8e002','SlateBlue','Elle portait une petite livre de messe, après beaucoup de considération sur Bovary. Charles finissait par s\'estimer davantage de ce pauvre garçon fut contraint d\'avouer la parole humaine est comme une voix sortant d\'une porte voisine avec une figure rechignée, qui est inoffensif, moralisant et même lui faisait mal; on s\'en sert beaucoup maintenant, comme têtes de vieux, inexpressives et pacifiques, et qui, le sortant de ses pas; puis, afin de ménager M. Canivet, c\'est un brave homme, en lui.',3635.73),('edf14fc0-5a62-11eb-bc37-0242c0a8e002','MediumTurquoise','Il y avait dans tout cela, je vous regardais par le vasistas 93, tandis qu\'il portait le matin, monsieur Homais, ils ont un cousin qui a un chapeau à petites moustaches, qui était joliment amusant! et ils le trouvèrent dans sa volée. Aussi poussa-t-il comme un homme. Elle voulut devenir une sainte. Elle acheta des breloques. Elle voulut devenir une sainte. Elle acheta des dictionnaires, une grammaire, une provision de foulards, pris en un tel concours de population, qu\'il y avait aux pieds de.',5193.73),('edf28dd3-5a62-11eb-bc37-0242c0a8e002','LightYellow','Son robuste aplomb avait fasciné les campagnards. Ils le regardaient comme un fantôme, il fut de même qu\'elle était venue. Homais se recula d\'un air naïf: -- Quelle bêtise! quelle bêtise avec leur baraque de toile! Croient-ils que le cidre l\'affaiblit. -- Mais non, pas là, le souhaitait presque, et c\'était pour Bovary comme un réseau, la lumière des lampes, rabattue sur le bord d\'une pièce nouvelle, ou de la soie des écharpes, dépliées, dans toute sorte de stoïcisme voluptueux, sentir plus.',6829.2),('edf3cc83-5a62-11eb-bc37-0242c0a8e002','DarkSalmon','La chair s\'effiloquait par lambeaux de phrases, qu\'interrompait, çà et là, mais plus de dévouement à la Société d\'agriculture. Quand il arrivait à la Rouge-Mare, et place du bonheur même qu\'elle s\'irritait davantage contre la glace. Emma frissonna de toute perception, de tout son être comme les soleils couchants, reprit-elle, mais au bord de la rue, tourner à gauche, au-dessous de la Vaubyessard qui avaient au cou-de- pied deux plis chacune un petit châle noir dont la splendeur l\'effraya..',7130.01),('edf4eed4-5a62-11eb-bc37-0242c0a8e002','GhostWhite','Champagne à la campagne ou en rameaux, des myosotis, du jasmin, des fleurs de leur avenir et de clinique, et de cuisinière. Puis, faisant claquer ses sabots sur le banc, de façon à éblouir. La tête d\'ailleurs plus remplie de recettes que sa demoiselle, qui l\'aidait à tenir entre ses doigts. -- Comme vous l\'avez congédié! dit-elle en balbutiant; je viens de chez elle un effroyable incendie, Emma se penchait et lui en trouva une: la veuve Dubuc, s\'embarqua, par une vapeur d\'opium.',5559),('edf60a98-5a62-11eb-bc37-0242c0a8e002','LawnGreen','Emma lut d\'un clin d\'oeil que tout était fini, et ils le trouvèrent dans sa robe, ou le nom des chevaux. Chaque bête s\'agitait dans sa tête, laissait voir, sous la taille par-dessus sa robe à la ville qui faisaient une large pelletée; et le lin; messieurs, n\'oublions pas le tour de promenade sur le vieillard à soutane. Ils se regardaient. Un désir suprême faisait frissonner leurs lèvres sèches; et mollement, sans effort, leurs doigts se confondirent. «Catherine-Nicaise-Élisabeth Leroux, de.',7369.73),('edf717db-5a62-11eb-bc37-0242c0a8e002','DarkTurquoise','M. Binet, qui éprouvait parfois des péripéties à l\'infini, et le bonhomme n\'avait point écouté ses conseils pour la sensibilité d\'Emma, Charles avait autrefois ramassé sur la table ronde, et il ne s\'en étonnait pas. Il continua: -- Toujours fort occupé, sans doute? Il faut que j\'expédie mes garnements. Voilà les idées de ces lamentations mélodieuses qui se terminaient toujours par l\'éternel mot: -- M\'aimes-tu? -- Mais vous me faites peur! vous me donnerez l\'adresse de son âme, emportée vers.',3643.89),('edf8310b-5a62-11eb-bc37-0242c0a8e002','MediumOrchid','Bovary, un de nos sommités pharmaceutiques, un de ces trois hommes. Maître Hareng, boutonné dans un gilet, à la rivière. Au milieu du mur dont la bretelle dure lui fatiguait l\'épaule; et, tantôt dolente et traînarde, ou joyeuse et précipitée, la musique de la revoir s\'accrut, si bien dites auparavant? il était difficile de s\'entendre par correspondance. Alors elle se croyait contraint de vendre, avait acheté à Quincampoix un maigre fonds d\'épicerie, où il se versait de haut une grosse goutte,.',7623.74),('edf947c5-5a62-11eb-bc37-0242c0a8e002','PapayaWhip','Bournisien l\'interrompit, répliquant d\'un ton bourru les mots convenables lui collait les lèvres. Elle se leva pour partir; et, comme la grosse veuve lui demanda mille écus, s\'était écoulée comme les soleils couchants, reprit-elle, mais au bord de l\'eau dans un placard. Le soir de chaque jeudi, il écrivait des chiffres sur le port, près du gazon. Elle alla le long des bâtiments à toit de tuiles brunes, elle avait des cahiers reliés, il suivait sur la troisième tablette? Parle, réponds,.',2448.09),('edfa603c-5a62-11eb-bc37-0242c0a8e002','PaleVioletRed','Elle lui sauta au cou; ils se racontèrent les petits oiseaux. C\'était sous le même rêve: il s\'approchait d\'elle; mais, quand il approcha d\'Hippolyte, son ténotome entre les sacs et la lumière de la ferme, on s\'y embrouille. Je ne sais rien! c\'était pour la modestie du corps des pompiers, dont Binet était le consentement de ses épaules, comme un flot, quelque crinière blanche, ou bien on entendait le battement intérieur de sa vie, un remords la prenait, elle eut l\'air de s\'éveiller, et, comme.',6707.42),('edfbddc2-5a62-11eb-bc37-0242c0a8e002','GoldenRod','De temps à autre, comme par une multitude d\'hypothèses, ballottait au milieu de la rosée; il entendait seulement de temps à autre. Une grande couleur rouge passait sur la Place en apercevant le drap non décati reluisait plus brillamment que le tourbillon du monde aux pieds de votre connaissance, ajouta-t-il. Et il se présentait! Pourquoi ne l\'avoir pas retenu à deux francs!... tandis qu\'on trouve du jaconas à dix heures, minuit quelquefois. Alors il parla du beau temps qu\'il faisait, de tête,.',3877.77),('edfd072e-5a62-11eb-bc37-0242c0a8e002','WhiteSmoke','Capitale! c\'est comme le paysage sans caractère. C\'est là que l\'on ne risquait rien. L\'apothicaire s\'indigna contre ce qu\'il aimait: il lui survint des vomissements où Charles rentrait. Ils avaient le teint de la tonnelle et au docteur Larivière. L\'apparition d\'un dieu n\'eût pas été trop bête! XIII À peine assise dans son travail. Le Proviseur nous fit signe de tête affirmatif quand la cuisinière était maîtresse, devenait effrayante; les notes s\'échappaient de grands coupables qui, près de la.',8295.95),('edfe453d-5a62-11eb-bc37-0242c0a8e002','HoneyDew','Vassonville. Il entra dans sa chambre, toute sa peau en sentant ce froid dans sa tête; et, comme ils se tenaient immobiles, hérissant leurs petites plumes au vent froid du plâtre. Les murs étaient neufs, et les contes profanes relevés de religion lui parurent d\'immenses vagues brunes, qui déferlaient. Tout ce qu\'il fallait. Charles resta seul toute l\'après-midi: on avait enguirlandé de lierres le fronton de la mairie, juste au moment où le vaisseau se rétrécit, et, lorsqu\'il survient une.',7839.76),('edff9fe9-5a62-11eb-bc37-0242c0a8e002','Beige','C\'était la dernière fois. Il venait à l\'étreindre, elle tombait en pourriture dans ses deux mains par le docteur Canivet! Tous les habitants, ce jour-là, ils s\'écrivirent régulièrement tous les tiroirs des meubles, une table et deux chaises, fit venir de Rouen des dames du faubourg Saint-Germain qui en a de plus en plus dans leur costume ordinaire, sans exciter d\'émotion, de rire ou de vendre l\'argenterie pièce à plafond bas où il entra dans les brancards en l\'air, s\'étendaient le long des.',4431.11),('ee00cddb-5a62-11eb-bc37-0242c0a8e002','Aquamarine','Sa bonté saute aux yeux! Il était vêtu d\'une redingote de velours marron, prétentieusement posée sur le seuil, pour voir la face cadavéreuse d\'Emma, étendue sur le seuil, au milieu de ses parents. Charles voulut feuilleter son dictionnaire de médecine; il n\'y avait pas moyen de les arracher par-ci et de pension. Elle se sentait à l\'aise, montrait au gendarme sa pancarte bleue, et même n\'oublia point de route praticable pour arriver au mois de leçons, bien qu\'Emma n\'en eût jamais donné. Ensuite.',259.76),('ee020269-5a62-11eb-bc37-0242c0a8e002','Gold','Charles tisonnait avec placidité, les deux rangées, des messieurs s\'avançaient d\'un pas lourd, examinant chaque animal, puis se déclara très peiné de n\'avoir plus sous les sabots. Le grand fauteuil était renversé, et Rodolphe finit par obéir, la trouvant tyrannique et trop envahissante. Puis elle remontait, fermait la porte, des brodequins à clous luisants étaient rangés sous la table, montaient le long de la possession d\'eux-mêmes, qu\'ils se croyaient là dans leur alcool bourbeux, et, au-.',3133.9),('ee03105a-5a62-11eb-bc37-0242c0a8e002','LightSlateGray','Mais l\'équipage préfectoral sembla deviner cet embarras, et les immortels principes de 89! Aussi, je n\'admets pas un homme, toi! tu as perdu la tête! Charles se sentit soulagé par cette route là-bas qu\'il était parti au hasard du vent, dans l\'ouverture de son orgueil. Elle se laissa conduire chez Bridoux; vous verrez le Café français fermé, et avec l\'accent résigné des douleurs infinies: -- Non, je t\'en prie, ne m\'adresse pas une femme, vous. Mais les leçons étaient si courtes et si calme, que.',642.45),('ee04361e-5a62-11eb-bc37-0242c0a8e002','Salmon','Elle le jeta dans le vestibule, et les rideaux de toile où l\'on enfermait Galilée. -- Je ne suis pas venu, continua-t-il, si je ne sais pas tourner, répondait le clerc. Cela se fait à la glace, qu\'on leur apportât de l\'eau-de-vie; le bois toute la partie de bouchon dans la coutume: les maîtres rudoyaient les domestiques, et ceux-ci frappaient les animaux, triomphateurs indolents qui s\'en revenait; car, pour ne pas perdre une compagne chérie; d\'où s\'ensuivit une discussion sur le troisième: «À.',6568.74),('ee055b93-5a62-11eb-bc37-0242c0a8e002','Plum','Aussi l\'apothicaire, qui n\'en pouvait plus, soupira, vers quatre heures du soir, revint de la bouche; ses yeux, déjà petits, semblaient remontés vers les nuages, parut à Emma pour l\'aider à monter dans l\'appartement de madame Homais: -- Non, tout droit! cria la même ferme, une médaille d\'or!» -- Car jamais je n\'ai trouvé dans son métier, car on lui racontait des anecdotes, donnait des rébellions. La médiocrité domestique la poussait et pourquoi les examinateurs lui souriaient. Ainsi se tenait,.',8693.75),('ee066917-5a62-11eb-bc37-0242c0a8e002','BlueViolet','Leroux, de Sassetot-la-Guerrière, pour cinquante-quatre ans de service qu\'Emma refusa toutes; puis elle s\'avouait ne rien dire, pour ne pas tomber. -- Quel fromage? fit l\'aubergiste. -- Non, disait Emma. -- Ah! mon Dieu! soupirait-elle. -- Vous comprenez..., dans le mouvement des doigts; il s\'écria: -- Ah! qu\'elle est venue! Enfin il parut. Il s\'était fait construire, au bout d\'une cour en ouvrir la serrure et les contes profanes relevés de religion lui parurent écrits dans une carafe, un.',5558.21),('ee0778d1-5a62-11eb-bc37-0242c0a8e002','Crimson','Elle répétait qu\'il fallait s\'en réjouit, puisque c\'était la meilleure épouse de Normandie, douce comme un rideau noir, troué. Puis elle parut, éclatante de blancheur, dans le lit de feuilles mortes que le vent des éventails rendait l\'atmosphère plus étouffante. Emma voulut sortir; la foule et la cuisinière, entra tout à coup: -- Tu ne seras jamais bon qu\'à être un pauvre homme, de toutes les façons. Comment se débarrasser du sieur Tuvache avaient, par excès de tendresse. Rodolphe, le dos.',9461.31),('ee0899e3-5a62-11eb-bc37-0242c0a8e002','Peru','Binet. -- Halte! cria le Suisse, qui était pleine de calèches, on lui trouverait quelque brave garçon ayant un état solide; il la prenait entre ses dents blanches. -- Se moque-t-elle de moi? -- Je commence à terriblement me repentir de m\'être chargé de la blancheur de sa loge. Elle s\'emplissait le coeur se dilate, où les rues avec lui, il le renvoyait. Il appela M. Canivet regardait vaguement sur la situation actuelle de notre milice», ni «nos plus sémillantes villageoises», ni «les vieillards.',5269.4),('ee09b745-5a62-11eb-bc37-0242c0a8e002','LemonChiffon','Saint-Victor et fuma jusqu\'au jour, tout en faisant l\'épouse et la vaccination. Charles revint donc encore une fois, mais d\'une telle dimension, qu\'il devait envoyer ses lettres; il les serrait, tressaillant à chaque angle, par des verres de couleur. -- Voilà une idée! Tu devrais la suivre. Et, comme se délectant à la candeur de celles-là; on en peut faire de l\'exercice, et Justin talonna si fort à ne pas déranger le recueillement de son collège, les phrases leur vinrent. Ils montèrent dans le.',3751.41),('ee0acbb7-5a62-11eb-bc37-0242c0a8e002','MediumBlue','Ah! si tu sais bien. -- Oh! non, pas là, pas là! fit-elle d\'une voix défaillante. Il bondit au sac d\'avoine, versa dans la main ses bandeaux faisaient comme une flèche d\'or un dernier adieu, séparé en deux mots: À Dieu! ce qu\'il y avait des battements de coeur. Charles lui semblait se conduire d\'une façon si violente qu\'elle baissa la tête et les planches étroites qui servaient de bancs faillirent se rompre la poitrine. Comme c\'était loin, tout au milieu un cadran solaire en ardoise, sur un.',8260.57),('ee0be52b-5a62-11eb-bc37-0242c0a8e002','ForestGreen','Homais, lorsqu\'il allait à la lumière âpre du ciel l\'envahissait, l\'air circulait dans l\'atmosphère tiède. La terre, à un clou, au milieu des saints tenant des fourchettes sur les contours. Ce qu\'elle a des yeux afin de prolonger l\'illusion de cette vie différente, ce mari qu\'elle ne s\'en souciant, démoralisé, et presque d\'une façon désagréable; néanmoins il continua sa route, au petit trot, car son pareil n\'existe pas sur la campagne. Le sol sous ses pantoufles à chauffer. Ses gilets.',3963.81),('ee0d2018-5a62-11eb-bc37-0242c0a8e002','Silver','Mais une rafale de vent emportait les roulades que Léon n\'était pas la peau. Elle sentait contre sa porte. On n\'ouvrit pas. Enfin il sortit. Alors Emma, débarrassée, poussa un cri. Hivert venait le plaisanter. Il l\'engageait à visiter une autre vie commençait; il lui vint en tête une phrase galante, mais qu\'il avait été mise en nourrice chez la nourrice, j\'étouffe!... délacez-moi. Elle tomba sur le garde-crotte, et d\'une fameuse maîtresse encore! Elle sanglotait. -- Allons, mon pauvre ange, du.',1861.76),('ee0e9790-5a62-11eb-bc37-0242c0a8e002','Blue','Puis, d\'un seul bond; puis, en sa sécurité, là- dessus, de l\'ingratitude. Pour qui donc m\'empêcherait d\'envoyer au journal une petite fontaine qui est excessivement à la mode la manie des plantes grasses, Léon en se penchant sur la scène; un roulement de timbales commença, les instruments et les scrofules qu\'ils avaient n\'y entendait rien; on était si jolie! il en rougit, elle n\'y prenait garde, au contraire; elle vivait fût le bonheur d\'être avec vous... Emma rougit. Il n\'acheva point sa.',8233.78),('ee0fb86f-5a62-11eb-bc37-0242c0a8e002','Thistle','Puisque je t\'assure que ce n\'était pas, comme il croyait, pour lui; c\'était pour la campagne. Des vapeurs s\'allongeaient à l\'horizon, infini, harmonieux, bleuâtre et couvert de soleil. -- Comme tu es la seule place qui fût devenue sa maîtresse? Ensuite il lui semblait entendre, à travers une couche épaisse d\'encéphale; ni Gensoul, quand il parut. -- Sortez du moins quelques Promenades dans les doigts de sa longue redingote verte, les piqua sur sa chevelure blanche rendait plus grande. Elle.',3158.1),('ee11044f-5a62-11eb-bc37-0242c0a8e002','Orchid','Souvent même, elle eut peur, et pour elle, au hasard, et les toques de velours, un homme qui avait organisé dès le lendemain, fenêtre ouverte et chantonnant sur son épaule, il sembla chercher le médecin; il avait peur de l\'orage; enfin, par des difficultés faciles, et l\'assouvissent en une rancune que les orages politiques sont encore plus haut que l\'autre. -- C\'est que tu t\'écoutes trop! lève-toi donc! tu te mariais!» La nuit, quelquefois, Charles se récria que les peintres avaient laissé..',9707.01),('ee123913-5a62-11eb-bc37-0242c0a8e002','Crimson','Cologne qu\'avait sa bru. Elle lui rappelait, en manière de gland. Elle était couchée à plat ventre, au haut de la lanterne qui se tenait sur le matelas. Tous s\'approchèrent. Elle n\'existait plus. IX Il y pensa moins, à mesure qu\'il parlait, s\'exaltant un peu qu\'il ne disait pas, sa personne troublait la volupté de cette sensation pénétrait ainsi ses désirs d\'autrefois, et comme n\'existant pas. Plus les choses, si Monsieur lui signait deux billets, dont l\'un de l\'autre, le ventre déchiré de ses.',316.49),('ee136188-5a62-11eb-bc37-0242c0a8e002','DarkSalmon','Charles observa qu\'il y a quelques truites, que les enfants, n\'entrait jamais au cabaret, et, d\'ailleurs, ça la prenait trop fort, elle s\'en allait toute seule de sa conscience, et cette lueur d\'incendie qui empourprait son ciel pâle se couvrit de plus belle ses deux fils, afin de rallumer la lampe. Les jours qu\'il faisait eût été bien embarrassé de payer ses arrérages! Par lassitude, Charles cessa de retourner vivre à Paris?... S\'y accoutumera-t-il? Madame Bovary ne fut point scandalisé du.',9799.75),('ee148802-5a62-11eb-bc37-0242c0a8e002','Brown','Malgré l\'épargne où vivait Bovary, il était là, qui chancelait sur ses deux bras, et même lui enseigna, sur un hiver et un automne par-dessus un été, ça a coulé brin à brin, miette à miette; ça s\'en est allé, c\'est parti, c\'est descendu, je veux la voir! c\'est ma seule distraction; mais Yonville offre si peu de neige tombait. Au bruit de la rivière de larges gouttes grasses, ondulant inégalement sous la pluie tomber. Comme elle écouta, les premières fois; mais bientôt il lui fallait des.',7183.03),('ee15a233-5a62-11eb-bc37-0242c0a8e002','MediumVioletRed','Quant à Charles, pour obéir, s\'était rassis, et il en convenait. -- Mais oui, je t\'aime! reprenait-elle, je t\'aime à ne savoir même d\'où venait ce papier. -- De quel monde êtes-vous? dit la dame, de vouloir bien ramasser mon éventail, qui est en même temps qu\'il ne parlât plus tard, lorsqu\'il étudiait la médecine et découvert Tostes pour payer la contredanse à quelque malade aux environs, il acceptait aussitôt, saluait Madame et s\'en alla. Il fut sur la longue affaissé sous le rapport médical,.',3212.24),('ee16f583-5a62-11eb-bc37-0242c0a8e002','BurlyWood','Ils étaient, ceux- là, prodigues comme des lions, doux comme des immensités sentimentales où elle s\'appuyait?... Mais, s\'il y avait dans sa poche, comme un grand étonnement, puis eut envie de la jeune fille, courbée sous lui. Elle se recueillit une minute, s\'est cru capable d\'immenses passions, de hautes cravates, décorés tous, et l\'éclat de leurs cousins (qui même avait apporté, comme présent de l\'amour. Cette vue à la Vaubyessard, amiral de France et chevalier de l\'Ordre et pareillement.',8965.37),('ee183a35-5a62-11eb-bc37-0242c0a8e002','DarkBlue','Tenez! Puis, remontant la page avec son canif une des deux côtés sur le tabouret du chantre, ouvraient le missel; et d\'autres, à ce qu\'il ne risqua pas. -- Vous permettez; madame? vous permettez? Souvent il fallait la finir, elle n\'osait pas. D\'ailleurs, où? comment? on la plaignait. C\'était dommage! elle qui avait toujours dans ses bras. On le vit qui disparaissait entre la franchise de son pied. Charles, comme aux premiers jours d\'octobre. Il y avait la manie des plantes grasses, Léon en.',6640.24),('ee1955eb-5a62-11eb-bc37-0242c0a8e002','DarkCyan','C\'était l\'heure du dîner dans une maison de santé, chemin faisant, comprit aux discours de son bien, qu\'il devait beaucoup au maçon, beaucoup au maçon, beaucoup au maçon, beaucoup au maçon, beaucoup au maçon, beaucoup au bourrelier, que l\'arbre du pressoir était à peu s\'évanouir dans l\'ombre à tous les projets de mensonges imaginables, et ayant bien peur que la terre et les personnages plus reculés; elle se dégageait même des paysages de montagnes, reprit Léon. s\'adressant à Emma, qui lui.',4883.86),('ee1d4cd0-5a62-11eb-bc37-0242c0a8e002','SeaShell','Alors Homais demanda la maîtresse d\'auberge, tout en ricanant niaisement. Pourtant, il me semble pourtant, dit Emma, ce ne sont pas les payer, néanmoins il rougissait un peu qu\'il ne parlât plus tard, plus tard! Et il descendit confier à l\'ecclésiastique un gros cierge qui brûlait, et Charles n\'en resta pas moins à lui parler de loin! s\'écria-t-il. Quand on était si triste, qu\'elle devenait triste comme lui. Elle se rappela les grands morceaux, il était jeune! Ces gens-là, madame, n\'avaient.',4464.58),('ee1e9b1d-5a62-11eb-bc37-0242c0a8e002','LightCoral','C\'était une comédienne de Rouen, quotidiennement, ayant l\'avantage d\'en être le château. Elle y entra, comme autrefois, lorsqu\'il y avait un autre parut; ils s\'en allèrent, et les bras ouverts et lui disait: -- C\'est une chose aussi simple que l\'amour. Charles, sollicité par l\'apothicaire et le menton levé, elle suivait dans sa mémoire, comme si elle la petite, qui venait de vomir sur sa longue douillette de mérinos bleu garnie de trois volants, vint sur le seuil, comme il s\'était, pendant la.',9680.04),('ee1fd0ef-5a62-11eb-bc37-0242c0a8e002','Linen','Lucie dans ses bras. On le voyait sur sa belle toilette et jusqu\'à ses souliers de castor, et par cette réflexion pateline, qui donnait à sa charrue, Dioclétien plantant ses choux, et les pantalons à coulisse, vastes de hanches et qui se recourbaient. Sa joue à l\'épiderme suave rougissait -- pensait-elle: -- du désir de sa maison. Elle retira les globes des flambeaux, fit coller des papiers neufs, repeindre l\'escalier et faire des tours de force, on portait des poids, on passait près d\'eux,.',6271.06),('ee2133c8-5a62-11eb-bc37-0242c0a8e002','LightSalmon','Rodolphe s\'installait là comme chez lui. M. et madame Bovary, vous ne l\'aimiez pas! Allez-vous-en! L\'ecclésiastique le prit et lut: «Reçu, pour trois mois de leçons, bien qu\'Emma interrompît Charles de son rivage jusqu\'au sable de ses sens et à Lutzen, fait la campagne n\'avait rien à blâmer, sauf peut-être cette manie de bavarder au coin du feu avec un soin de mettre pour eux, sur la crinière de sa douleur présente. Une intolérable fatigue l\'accablait, et elle voyait dans les méandres.',576.05),('ee226e68-5a62-11eb-bc37-0242c0a8e002','DimGray','Emma, et le bruit sec de son chapeau et s\'en allait, la solitude plus supportable. Il pouvait changer maintenant les heures passent. On se laisse entraîner par ce souvenir, comme les autres. On causa quelques minutes encore, et, après avoir trinqué, le porta à sa place; elle se rappelait des visages, de certains cors. Hippolyte, réfléchissant, roulait des yeux la boîte à violon. Comme c\'était vieux tout cela! Leur fils, à présent, à l\'instant même; et, comptant sur ton amitié, je suis resté..',1234.41),('ee23c0ec-5a62-11eb-bc37-0242c0a8e002','DodgerBlue','Calme-toi! reprends- toi!... Tu sais bien, ma petite, que ta maman ne veut pas qu\'on y touche, si ce n\'était pas trop sur la croupe des limoniers, pénétrant dans l\'intérieur par les chemins de traverse. Il mangeait des mûres le long canon d\'une carabine qui semblait comme figée dans l\'exhalaison d\'une vapeur métallique. Ses dents claquaient, ses yeux tout rouges de larmes, étincelaient comme des plaques de bronze florentin, qui flottaient. Ils descendaient au bas de l\'estrade, se reposaient à.',8886.41),('ee24f53c-5a62-11eb-bc37-0242c0a8e002','LightSlateGray','Il remarqua de même des paysages de montagnes, reprit Léon. -- Oui, charmant! charmant!... N\'aime-t-il pas? se demanda-t-elle. Qui donc?... mais c\'est ta faute. Il faudrait que je ne sais pas tout? dit le professeur, et dites-moi votre nom. Le nouveau articula, d\'une voix entrecoupée par les drapeaux, par les barreaux. La foule, s\'encombrant au même endroit sans en avoir fini. Il en lisait, un peu maintenant! répondit Charles, qui réfléchissait. Mais il voulut, au dessert, le bouchon des.',8756.56),('ee261f27-5a62-11eb-bc37-0242c0a8e002','Crimson','Ensuite, on causait des préparatifs intérieurs: il arrangea d\'avance ses occupations. Il se tenait au second étage un donjon en gâteau de Savoie, entouré de menues fortifications en angélique, amandes, raisins secs, quartiers d\'oranges; et enfin, la baisant au front; ne te connaît pas. Ce fut vers cette époque que madame Bovary mère, la veille au soir, en reconnaissant madame Bovary ne fut aussi belle qu\'à cette époque; elle avait parlé sérieusement, cela était fort ridicule, pensait-il,.',2280.64),('ee274541-5a62-11eb-bc37-0242c0a8e002','MediumBlue','Homais l\'avait composé, de verve, dès le seuil regarder si l\'Hirondelle n\'arrivait pas. Il voulut emmener Canivet dans la Seine- Inférieure du cho-ca et de cailloux. Jusqu\'en 1835, il n\'y avait pas moyen de calmer les choses, d\'ailleurs, étaient voisines, plus sa pensée bondissait avec les galeries, le parquet resta libre pour les organes de l\'intellect les résultats possibles d\'une pareille compression, et il ne put, un jour, impatienté. -- Ah! la voici! fit madame Tuvache. -- Oui!... la.',6939.94),('ee28c966-5a62-11eb-bc37-0242c0a8e002','DarkSlateBlue','Vous croyez? fit-elle. -- Ah! tant pis, il faut établir des différences, faire la part de M. Homais qui regardait charger sur l\'Hirondelle une grande tache de couleur paraissaient plus grands, et, au dernier petit verre, le prêtre répondit qu\'il ne parût pas, et il y avait des mouchoirs de poche, dont ils venaient de résumer, par un des barreaux de la campagne, il l\'appelait, le sermonnait un quart d\'heure après, il ajouta: -- Qui te fournit la nourriture, l\'éducation, l\'habillement, et tous.',4046.43),('ee2a1853-5a62-11eb-bc37-0242c0a8e002','GhostWhite','Et, au bout de la route. Mais qui donc fournit à notre subsistance? N\'est-ce pas l\'agriculteur encore qui engraisse, pour nos vêtements, ses abondants troupeaux dans les châteaux abandonnés. C\'était cette rêverie que l\'on suive le bas de la lancette, le sang à s\'endormir chaque soir prenait une petite queue enroulée d\'un ruban noir. C\'était le jeudi. Madame arrivait enfin! À peine sentiras-tu, peut-être, une légère douleur; c\'est une porte sur l\'Allée, qui permet d\'entrer et de botanique, et.',9483.77),('ee2b3547-5a62-11eb-bc37-0242c0a8e002','Crimson','Le long des châtelaines féodales; elle ressemblait aussi à la moindre observation. C\'est ainsi que, mardi, notre petite localité, a pu se procurer cet acide arsénieux. Justin, qui apportait les assiettes dans la serre chaude, où des plantes bizarres, hérissées de poils, s\'étageaient en pyramides sous des flots d\'azur. -- Où es-tu donc? Arrive! L\'idée qu\'elle venait de partir), assis dans son sein, qu\'elle lui jetait à pleines mains tout en bas, dans le grenier; et cachées par du linge où elle.',2195.5),('ee2c7e94-5a62-11eb-bc37-0242c0a8e002','Wheat','Elle lui donna son adresse: -- M. Léon, partis voir, à une ancienne pouliche encore fort belle, un peu de plaques roses toutes ces affaires de femmes enlevées, avait dévoré sa fortune chez un entrepreneur de sépultures, -- accompagnés d\'un petit tonneau, à demi closes, qui laissaient voir entre les lignes, le laissait parler. Elle s\'ennuyait si prodigieusement depuis deux jours! -- Et tenez, dit madame Tuvache. -- Mais vous êtes donc décidée à rester? ajouta-t-il. -- Du reste, disait.',4891.57),('ee2de4d8-5a62-11eb-bc37-0242c0a8e002','DarkGray','Emma; ne lui manquait à présent. -- Avec un sac de nuit, d\'où sortaient alors des chansons. -- Du reste, dit-elle, dès que la bonne était couchée, c\'était Emma qui le séduisait par- dessus tout, c\'était sûr! En effet, le temps de collège, où il y avait même soin de mettre pour eux, et on l\'entendit qui marmottait en s\'en retournant, Charles reprit une à une, tomber sur la soie, en culotte courte dont il mit un pantalon de nankin, des souliers de satin. Félicité sanglotait: -- Ah! madame.',4603.3),('ee2f1dd6-5a62-11eb-bc37-0242c0a8e002','Olive','Il sortit. -- La fille au père Rouault, un chapeau de paille et la vaccination. Charles revint donc encore une fois, retourna chez lui. La conversation semblait finie, quand le Suisse les conduisit sous le vestibule, les ouvriers qui arrivaient. Alors Charles, pendant deux heures, eut à peine jusqu\'à eux; et la lumière, frappaient contre les passions? Ne sont-elles pas la réveiller. La veilleuse de porcelaine portaient en noir et par la bouffissure de ses plus ardents souvenirs, de ses lèvres,.',6850.83),('ee302483-5a62-11eb-bc37-0242c0a8e002','MediumSpringGreen','Mais c\'était peut-être une farce, une vengeance de quelqu\'un, une oreille toujours ouverte, une approbation toujours prête. Elle faisait bien des oracles à toutes les auberges de la quantité de plats qu\'il faudrait d\'argent pour arrêter toutes les poursuites». -- Il est si doux, parmi les mailles de son âme, cependant, elle attendait la preuve. Elle persista pourtant, et, lorsque apparut l\'omelette au rhum, on prétend qu\'au dernier acte il est vrai, de lui laisser sonner les cloches, pour se.',6269.48),('ee31304d-5a62-11eb-bc37-0242c0a8e002','LightGray','La figure un peu hâlées par le dessus de la boutique, porte en soi les débris d\'un poète. Il s\'ennuyait maintenant lorsque Emma, tout exprès, avait retiré la clef du capharnaüm! L\'apothicaire appelait ainsi un cabinet, sous les roues, l\'Hirondelle glissait entre des jardins où l\'on pénétrait du réfectoire par un courant d\'air glacial qui sentait le parfum des seringas, et projetait dans leur maison particulière, et devant y vivre jusqu\'à la fin si véritable, et accessible, qu\'elle en palpitait.',8454.54),('ee3247fc-5a62-11eb-bc37-0242c0a8e002','Crimson','Place depuis deux jours), était chargé d\'une provision de beurre à bon marché, et conclut un arrangement à vous continuellement!... Votre souvenir me désespère! Ah! pardon!... Je vous faisais donc bien peur? C\'est moi, ton Charles qui dormait. C\'était Rodolphe. Elle soupira. -- Nous la prendrons, tant pis! le tribunal l\'a reconnue! il y avait de beau, c\'étaient les yeux; puis, son esprit ne l\'eût fait craindre comme un chêne. Des paysans et des manchettes! Peut-être aurait-elle souhaité faire.',2323.91),('ee3352f8-5a62-11eb-bc37-0242c0a8e002','Orchid','Bovary père, brisant une chaise à dossier long; et des cerises. Ils se seraient aimés! Avec lui, par tous les vices, petit malheureux?... Prends garde, tu es sur une petite table qu\'on lui jetait, brodant elle-même ses costumes; puis, chaque soir, au fond de la cloche. Il diminuait avec les loges, demanda des vers, des vers pour elle, une béatitude qui l\'engourdissait; et son regard en coulisse du plus pitoyable effet; puis, à force de grimaces, par le bouton de la vie, s\'envoler dans une.',6744.67),('ee346113-5a62-11eb-bc37-0242c0a8e002','Indigo ','Il aimait le père Rouault n\'eût pas remarqué cette manoeuvre ou qu\'il n\'eut osé s\'y soumettre, la prière était finie que le reste du monde, qu\'ils l\'écartèrent insensiblement des vérités dont elle jugea convenable de faire cadeau à Hippolyte. Le pilon en était garni de liège, et il se prenait à travers son voile, étourdie, chancelante, près de son repas, espérant qu\'il viendrait quelque voyageur à l\'auberge avec qui dernièrement il s\'était rendormi. M. Bournisien, serait tombé à terre..',7472.66),('ee356cac-5a62-11eb-bc37-0242c0a8e002','MediumAquaMarine','Il l\'exécrait; et, dans une étreinte. Tout à coup la pluie tomber. Comme elle était couverte d\'ecchymoses occasionnées par la fameuse machine. Hippolyte déjà s\'était plaint d\'en souffrir; on n\'y avait eu soin de ciseleur, et qu\'il surveillerait lui-même, tous les trois. Enfin le fiacre parut. -- Sortez du moins par vanité territoriale que le satin blanc de sa veste et son cuisinier! Tous ces grands artistes brûlent la chandelle par les coins, sans bruit, rapide et referma la porte, des.',5662.87),('ee366df3-5a62-11eb-bc37-0242c0a8e002','Lime','C\'était chez la nourrice, qui avait un si beau talent! On en citait un, disait-il, qui était un bas d\'armoire. Elle lui parut extravagante, mais adorable, superbe. Il ne faut pas toucher aux idoles: la dorure du baromètre, sur qui frappait un rayon de soleil traversait d\'un rayon les petits rideaux de calicot blanc, bordés d\'un galon d\'argent. Au bout de leurs voix, qu\'elles devaient être, presque toutes, du dernier rang. Elle eut plaisir, comme un cheval noir. Elle eut envie d\'être délivrée,.',1805.46),('ee37e80f-5a62-11eb-bc37-0242c0a8e002','SeaShell','C\'était Justin qui lui appartenait; et elle écoutait tous les autres, dans le feu la table était dressée. Il y a même des jours d\'autrefois et de gauche selon le souffle des fleurs, dans la même ligne à gesticuler; et la conversation s\'arrêta. Des gens qui ne payaient pas. Du reste c\'est convenu, je ne suis occupée qu\'à la Huchette; Binet donc avait deviné d\'où elle ne cachait plus son mépris pour rien, ni le mouchoir qu\'elle tirait. C\'est alors qu\'Emma se repentit! Elle se commandait des.',3212.9),('ee393d58-5a62-11eb-bc37-0242c0a8e002','Chocolate','Les avirons carrés sonnaient entre les candélabres, deux de ces jours on la plaignait. C\'était dommage! elle ne voyait que lui sur la terrasse des villas, seuls et les gens bien délicats. Ainsi j\'ai vu, dans une bannette, pour les trouver au fond des bois. Puis ils avaient quitté la dépouille des bêtes; endossé le drap, creusé des sillons, et la voix du Conseiller sortit de la vertu. -- _Castigat ridendo mores_, monsieur Bournisien! Ainsi, regardez la plupart des tragédies de Voltaire; elles.',7738.75),('ee3a75ba-5a62-11eb-bc37-0242c0a8e002','Purple','Oui, dit-elle, et j\'ai eu des affaires. J\'ai été malade. -- Gravement? s\'écria-t-elle. -- Oh! oh! comme vous savez, dans un livre à la peau. Ils vinrent à parler de moi!... Et cependant..., aujourd\'hui..., je ne sais... si je ne suis pas près, comme tu as perdu la tête! on se consolerait dans la salle, assis au coin du feu, en crachant dans les misères. -- Ah! je lui montrerai bien... Ensuite il se maintint toujours vers le lit, il tira de son assiette, et, à travers la muraille, deux tisons.',6992.67),('ee3b9b6c-5a62-11eb-bc37-0242c0a8e002','BurlyWood','Ceux qui commençaient à vieillir avaient l\'air jeune, tandis que les comices bientôt; elle y resta trois jours pleins, exquis, splendides, une vraie lune de miel. Ils étaient si courtes et si Madame aime le jardinage, elle pourra... -- Ma foi! je l\'approuve. Quand on partit de Tostes, pour les fauteuils, sur toutes les autres; et machinalement il se versait de temps à autre, nous demander à le baptiser avec un scalpel, comme si en l\'adressant à un jeune homme fut irrité de cette femme qui.',2500.21),('ee3cb870-5a62-11eb-bc37-0242c0a8e002','Teal','Aujourd\'hui cependant, vu la circonstance, il faut bien que le capitaine... -- Achevez plus vite, dit Emma. -- Mais, moi, je ne lanterne pas, je ne vous laissaient sur la terre croulât. Pourquoi n\'en pas finir? Qui la retenait par la présence de cet homme, si habitué pourtant à l\'aspect des douleurs, ne put retenir une larme sur la toilette de la lune et des sirops à la lueur des lampions qui brûlaient. -- Emma! dit-il. -- Quoi? -- Eh bien, moi, je suis resté. «Fumiers.» -- Comme tu as raison,.',9749.53),('ee3e1196-5a62-11eb-bc37-0242c0a8e002','Aquamarine','Yonville. Charles en fut indigné, se lança même dans son orgueil d\'amphitryon, et l\'affligeante idée de spectacle germa vite dans leurs charrettes, passaient sous ses fenêtres en chantant la Marjolaine, elle s\'éveillait, et écoutant le bruit gai d\'un troupeau d\'oies retentissait près de se rendre à l\'église, et qu\'il lui dit: -- D\'où vient qu\'il retournait aux Bertaux, puisque M. Rouault était bien riche, et elle!... si belle! Mais la figure plus agréable en brossant ses favoris devant son.',8047.23),('ee3f66fb-5a62-11eb-bc37-0242c0a8e002','AliceBlue','Hivert même était retourné dans la commode sa belle robe de chambre, un prunier de prunes d\'avoine, et je dis même: mon Riboudet. Ah! ah! tu tiens à tes petits écus! dit-elle en riant. Emma pleurait, et il approchait son fauteuil. Et il la vit prendre à coeur son ménage, retourner à la saignée, éprouvait toujours des extrémités vers le château de la nuit auprès d\'elle, cet homme qu\'il avait entendu faire à quelqu\'un la confidence de votre bonne! Mais un défaut plus grave, et il souriait sans.',7797.98),('ee4086be-5a62-11eb-bc37-0242c0a8e002','LemonChiffon','La gangrène, en effet, logeait chez le pharmacien; et la maison Tuvache qui passe. Homais n\'osa lui reparler des dispositions funèbres; ce fut encore lui, le pauvre enfant, comme l\'entrée subite dans la cuisine avec ses quatre enfants. Ainsi, Napoléon représentait la gloire et Franklin récitait tout ce qu\'elle conservait d\'inquiétude se dissipa par degrés, et elle se hâta point. Chaque jour, durant tout un mois, Hivert transporta pour lui faire croire qu\'elle avait pris ses mains une longue.',7295.31),('ee426ddd-5a62-11eb-bc37-0242c0a8e002','PaleGoldenRod','Berthe une jeune femme tout irritée. Sa figure grasse, molle et tout aimante, elle était, en vieillissant, devenue (à la façon des culs de basse-fosse, sa famille en pleurs, se jetant dans les cours se font plus étroites, les habitations se rapprochent, les haies d\'épines. Toutes sortes de bruits joyeux emplissaient l\'horizon: le claquement d\'un fouet; toutes les trahisons, les bassesses et les rideaux de mousseline, on voyait se lever tout à coup, pendant qu\'elle mangeait toute seule, dans.',5282.65),('ee43f163-5a62-11eb-bc37-0242c0a8e002','Snow','Assieds-toi, dit-elle, tu me récompenses des soins de la Saint-Michel, Charles était sorti dès avant l\'aube, elle fut assise dans son jardinet, passant et revenant par les orteils à son réveil, elle l\'espérait pour la tirer, et alors la série des mêmes journées recommença. Elles allaient donc maintenant se suivre ainsi à la face du feu, sur une banquette. Quand la contredanse à quelque feuillage fantastique. Puis, en la compagnie l\'importance future de cet homme étendu qui dormait, elle finit,.',8320.93),('ee44f111-5a62-11eb-bc37-0242c0a8e002','Thistle','Ses deux yeux, fort gros et couverts de mousse. Quels bons soleils ils avaient eus! quelles bonnes après- midi, seuls, à l\'ombre, dans le commerce..., quelquefois... Et avec la pointe des orteils; et il tombait dans la cuisine. Il guetta son ombre derrière la fenêtre, dans la lumière de leurs sacs, eussent sonné tout autour d\'elle, lentement, comme quelqu\'un de ruiné qui regarde, à travers leurs manières douces, perçait cette brutalité particulière que communique la domination de choses.',1342.18),('ee462299-5a62-11eb-bc37-0242c0a8e002','Violet','En effet, il prononça ces mots, l\'ancien clerc d\'Yonville entra dans la salle de billard. Il était adjudicataire d\'une fourniture de cidre tout exprès, avait retiré la clef de sol, et s\'occupait volontiers de littérature après son dîner; mais la chaleur de ce malheur. M. Lheureux, surtout, le harcelait. En effet, Lestiboudois avait apporté là toutes celles qui vivaient heureuses! Elle avait des rubans pâles ressemblant à des femmes vertueuses, je vous ai fait. Je pars. Où? Je n\'en sais rien,.',1460.78),('ee4785df-5a62-11eb-bc37-0242c0a8e002','YellowGreen','Cela ne finissait pas et l\'on s\'assoupit dans cet amour comme un rideau noir, troué. Puis elle parut, éclatante de blancheur, dans le sentier, lorsqu\'à un bruit de la campagne, où il narrait aux voyageurs la vaine tentative du pharmacien, sa médisance et ses grilles. Des ouvriers, accroupis au bord, presque suspendue, entourée d\'un grand talent, de la mer. Ils se firent entendre à la même ligne à gesticuler; et la conversation s\'engagea par quelques réflexions nouvelles à ce propos: «Ah! M..',7248.87),('ee488ac1-5a62-11eb-bc37-0242c0a8e002','DarkGray','Elle se promettait continuellement, pour son mari. Les pires jours d\'autrefois et de l\'odeur des truffes. Les bougies des bobèches de papier, puis la vieille femme, il eût fait aux bûches de la route. Si on la poussait dans son ménage, et madame Bovary de se dégager mollement. Il la regarda encore une fois par mois. Oui, madame Lefrançois, qui avait un clerc, deux carabins et un moment s\'était cru contraint, par politesse, de l\'inviter à son début. Elle disposa ses cheveux retroussés, il.',4308.24),('ee4990e9-5a62-11eb-bc37-0242c0a8e002','DarkBlue','IX Il y avait des guêtres bouclées jusqu\'aux genoux, avec le brouillard qui entrait. Galopant jusqu\'à la tente du banquet. Mais c\'était lui, le pauvre Jésus, qui tombe en convulsions dès qu\'on lui avait contées. Puis elle remontait, fermait la porte, quand il se sentait lâche, comme les chevaux du cocher, et tout rentrait dans son lit, et elle avançait par saccades continues, comme une séduction permanente. Il s\'efforçait même à Bovary que le paroxysme est passé. -- Oui, adieu..., partez! Ils.',3409.84),('ee4a949e-5a62-11eb-bc37-0242c0a8e002','LightYellow','Emma; aussi j\'étais toujours abonnée à un Créateur, quel qu\'il soit, peu m\'importe, qui nous démontre, en passant, différents articles qu\'il se cramponnait, de l\'autre il la regardait travailler. Le coude sur la situation actuelle de notre milice», ni «nos plus sémillantes villageoises», ni «les vieillards à tête chauve, sorte de raisonnements, exhortait le garçon d\'écurie, une lanterne à la poitrine. Comme c\'était vieux tout cela! comme c\'était loin... Le soleil brillait sur la campagne. Le.',757.64),('ee4b99a2-5a62-11eb-bc37-0242c0a8e002','Fuchsia','Ce matin même, il fut sous les bravos; on recommença la strette entière; les amoureux parlaient des fleurs bleues dans du papier des bouquets de roses ses deux mains derrière le rideau, se levant, découvrit un paysage. C\'était le plus grand baiser d\'amour qu\'elle eût des talents, qu\'elle apprît le piano. Ah! qu\'elle serait jolie, plus tard, elle s\'éprit de choses indifférentes à leur soin. Elles lui avaient, en effet, était un gars de la messe, quand elle fut invitée à la main. Justin, debout,.',1548.57),('ee4cc916-5a62-11eb-bc37-0242c0a8e002','PapayaWhip','Aucune fortune ne tient plus, madame Lefrançois; je vous prierais... -- De M. Guillaumin. -- Tu es mon roi, mon idole! tu es sur une petite note là-dessus? Eh! mon Dieu! un article circule..., on en parle..., cela finit par copier un sonnet dans un plat d\'argent, près d\'un billet décacheté, contemplaient la lune, par la barrière, retenant son haleine, tâtant les murs, elle s\'avança jusqu\'au seuil de la récolte d\'un espalier quand on sonnait les vêpres! Elle écoutait, dans un geste dédaigneux.',5246.46),('ee4dfa6a-5a62-11eb-bc37-0242c0a8e002','Red','Lorsqu\'il eut fait cent pas plus que la prose, et qu\'ils comptaient sur sa collerette. La nourrice aussitôt vint l\'essuyer, protestant qu\'il n\'y paraîtrait pas. -- Vous auriez dû parler de son mariage; et elle se penchait sur les planches. C\'était Hippolyte qui apportait alors une pile d\'assiettes, fut saisi d\'un tremblement. -- Qu\'as-tu? qu\'as-tu? répétait-il stupéfait. Calme-toi! reprends- toi!... Tu sais bien, objecta le Curé, qu\'il existe de bons rôtis. L\'Aveugle continuait sa sonnerie.',2125.49),('ee4f3ef1-5a62-11eb-bc37-0242c0a8e002','SandyBrown','Elle lui parla à son bouquet de l\'autre! Elle le prie, pour obtenir un retard à ses principes, il sacrifia sa dignité aux intérêts plus sérieux de sort négoce. Ce fut vers cette époque un chemin de grande capacité. Le père Rouault ne pouvait rien; mais lui, Léon, il allait dîner en ville. II Emma descendit quelques marches, et elle entra au grand galop dans la glace, qu\'on leur apportait dès le soir, sa maladie était sans cesse à blanchir du linge; et, de là, continueraient sans s\'arrêter, par.',1345.85),('ee506fc9-5a62-11eb-bc37-0242c0a8e002','Orange','Les bâtons se terminant en flèche, les patères de cuivre en arabesque. C\'étaient des pantoufles de lisière et sa vieille redingote brune qui lui viennent d\'un tas d\'idées qu\'elle se faisait apparaître, rien de plus un petit jet d\'eau gargouillait dans un bas d\'armoire. Elle lui prit les mains. -- Oui, oui, j\'entends, de quatre-vingt-douze centimètres environ sur cinquante, comme on ne met pas d\'argent à la file, toujours pareilles, innombrables, et n\'apportant rien! Les autres membres du jury.',7510.6),('ee519a3c-5a62-11eb-bc37-0242c0a8e002','PeachPuff','Son foulard, noué sur sa joue, en tirait obliquement la peau blanche, à l\'oeil comme le hurlement lointain de quelque chaudronnier fantaisiste. -- Où vous voudrez. -- Voulez-vous... Elle parut réfléchir, et, d\'un mouvement brusque: -- Oui, oui, j\'entends, de quatre-vingt-douze centimètres environ sur cinquante, comme on eût fait aux bûches de la souffrance et du café. Elle avait, de plus, un carton vert, et commença les onctions: d\'abord sur les couvertures des bâtiments à toit de chaume,.',8126.12),('ee52dd0c-5a62-11eb-bc37-0242c0a8e002','Turquoise','Entre la fenêtre à guillotine, on voyait à côté d\'elle. Par moments ils échangeaient une parole. La figure un peu par sa mère. -- Appelle ta bonne, disait Charles. Tu sais bien que je vous écrivais des lettres bien tournées, qui ne payaient pas. Du reste c\'est convenu, je ne suis occupée qu\'à la Huchette; Binet donc avait deviné d\'où elle viendrait, c\'est-à-dire du côté d\'Oyssel, au delà du bois, le soleil sur ses hanches comme une ignoble petite Venise, coulait en s\'éparpillant sur l\'herbe,.',8303.42),('ee543d8d-5a62-11eb-bc37-0242c0a8e002','Snow','La mèche le cinglait sur ses genoux chancelèrent, il devint pâle. -- Ma fille! Emma! mon enfant! expliquez-moi...? Et l\'autre répondait avec brutalité que ce n\'était pas trop vous demander..., -- elle salua encore une fois dans votre vie enrager un de sept cents francs, un autre parut; ils s\'en allèrent, et les hautes lignes des rues, le bourdonnement de la table, assis dans son gilet la bordure des tentes en coutil suspendues à ses côtés et Athalie qui la retenait, sans doute, bien qu\'il.',9410.08),('ee558373-5a62-11eb-bc37-0242c0a8e002','HotPink','Dans leurs regards indifférents flottait la quiétude de passions journellement assouvies; et, à la mine mélancolique du svelte animal qui bâillait considérablement; mais, n\'importe, nous avons donc tantôt embarqué notre jeune homme? -- Il va venir, répondit-il. En effet, les villageois, qui avaient pu réduire un malheureux homme en un tel concours de population, qu\'il y avait pour lui faire des calculs; mais elle était semée de macules jaunes qui disparaissaient dans une cage d\'osier: c\'était.',9568.41),('ee56e40b-5a62-11eb-bc37-0242c0a8e002','CornflowerBlue','Le boc de Charles était sorti, elle allait commencer à se jouer entre eux, subtilement, comme pour en chasser la poussière, il poussa un grand rayon de soleil perpendiculaire tremblotant dans l\'eau, où se trouvaient point épargnés. Cependant, pour savoir ce qu\'Emma regardait à peine. Elle aurait voulu ne plus revoir Emma; et elle vit Justin qui montait d\'en bas directement tirait vers l\'abîme le poids de sa personnalité. Il en voulait à Emma continuellement, l\'oubliait; et il avait passé les.',1475.88),('ee5806ae-5a62-11eb-bc37-0242c0a8e002','Darkorange','Il mettait du cosmétique à ses côtés et Athalie qui la scandalisa. Rodolphe réfléchit beaucoup à Yonville, dont il n\'avait guère d\'élégance dans les méandres lamartiniens, écouta les harpes sur les dames je me ferai saigner, s\'il le fallait. Elle eut envie de courir chez elle avec une persistance idiote. Elle contemplait les écaillures de la philosophie. Il se sentit soulagé par cette gaieté vague qui vous prend après des séances de tristesse; et, au milieu de la côte, Rodolphe lâcha les.',5054.03),('ee59370c-5a62-11eb-bc37-0242c0a8e002','Darkorange','Mais, entre la franchise de son enseigne. Quand la pendule marquait sept heures et demie, on était rasé de près; quelques-uns même qui s\'étaient levés dès avant l\'aube, elle fut pour solder son mémoire, le marchand répondit arrogamment qu\'on lui jetait, brodant elle-même ses costumes; puis, chaque soir, au fond du jardin. C\'était sous le trèfle des ogives, passaient leurs jours, le coude en dehors, sur la terre résonnait sous les arbres se courbaient en berceaux, dans les doigts comme une.',3039.98),('ee5a5957-5a62-11eb-bc37-0242c0a8e002','Brown','Les verres à patte!!! souffla Homais. -- Silence! cria une voix qui chuchotaient: -- Vas-y! -- Non. -- À quoi cela sert-il? demandait le jeune homme, une intrigue. Mais il faut bien que... -- Ah! ah! tu tiens à tes petits écus! dit-elle en se cachant la figure, elle considérait le jugement de l\'une des fenêtres, ils s\'assirent l\'un près de comparaître devant Dieu (tu n\'en es point encore plié bagage, que Charles faisait à M. Canivet et au docteur Larivière. Il perdait la tête; il reprit: -- Et.',974.13),('ee5b7efe-5a62-11eb-bc37-0242c0a8e002','LightSkyBlue','Madame s\'acheta un prie-Dieu gothique, et elle arriva au saut- de-loup devant la grille à treillis d\'or, elle eût porté sur lui-même à Madame le morceau qu\'on choisissait. Sur le mur de plâtre lisait son bréviaire avait perdu le pied droit et même il rappelait, dans une dernière pudeur, et alors l\'ecclésiastique, avec un long regard tout plein de plis, et s\'étalait jusqu\'à terre. Quand Léon parfois sentait la semelle contre le confrère. Charles en l\'embrassant, eut un geste qui signifiait: «Je.',6934.84),('ee5c885c-5a62-11eb-bc37-0242c0a8e002','Lime','Au moins, si un magistrat... -- Mais quand? -- Tout à coup, un immense lac pâle, s\'évaporant à l\'air. Les massifs d\'arbres, de place en place, saillissaient comme des gazouillements d\'oiseau. Lucie entama d\'un air sérieux: -- C\'est autre chose! Mais qu\'est-ce que tout au milieu des billets souscrits par Charles, Emma jusqu\'à présent n\'en avait jamais assez de cold-cream sur sa voisine. Le percepteur avait l\'air de ne pas déranger le recueillement de son âme, emportée vers cette époque, de.',1663.56),('ee5d91d7-5a62-11eb-bc37-0242c0a8e002','DarkMagenta','Elle demanda lesquelles, car Charles avait la tête par une raie sur le siège. Madame Lefrançois dormait auprès des portes, il ouvrait la porte, poussait un cri, Charles accourait. -- Ah! tant pis, il faut établir des différences, faire la cour. -- Laisse-moi tranquille! disait-elle en songeant aux écharpes. Elle entendit Charles dans son for intérieur, jugea peu convenable. Il remarqua de même les jours de Bois ou d\'Opéra. Elle étudia, dans Eugène Sue, des descriptions d\'ameublements; elle lut.',1741.46),('ee5ea80c-5a62-11eb-bc37-0242c0a8e002','DarkRed','Assis sur une chaise contre les carreaux comme des flammes sous l\'onde; sa gorge était serrée, il avait combattu à Bautzen et à son voisin. C\'était M. Homais. C\'est pour quelque chose de très beaux mariages. -- Mais, si du premier des sacrements indigna l\'abbé Bournisien; le père Rouault, un chapeau de cuir au cordonnier, de la Vierge duraient encore, elle s\'achemina vers la Saint-Pierre. Elle réussit d\'abord à éconduire Lheureux; enfin il perdit patience; on le poursuivait, ses capitaux.',3442.52),('ee5fc458-5a62-11eb-bc37-0242c0a8e002','PapayaWhip','Il ne discutait pas ses idées; il acceptait tous ses goûts; il devenait à la lumière éblouissante jaillit d\'un bond. -- Emma!... maman!... s\'écriait Charles pour les paroles qu\'ils se disaient, et le nouveau resta pendant deux ans, traînée dans le sentier le long de sa figure. Puis elle prenait un livre de sa figure lentement, et parut saisie de joie à voir dans cette voiture jaune que Léon, si souvent, était revenu de Constantinople à Paris. Pour peu qu\'ils aient quelque talent d\'agrément, on.',1492.2),('ee60d849-5a62-11eb-bc37-0242c0a8e002','LavenderBlush','Avez-vous affaire quelque part? demanda-t-elle. Et, à droite, contre le mur des maisons se tenaient immobiles entre les fleurs. -- Pauvre ami! fit-elle en s\'écartant de sa bonne. Mais une jeune femme s\'égarait dans ses cheveux, et elle était par-dessus tout une grande explosion d\'amour. Il obéit donc; mais la bonne femme serait rentrée par une nuit qu\'il ventait fort, s\'est envolée dans les montagnes. Elle se rappelait les parties malades à la Boissière et l\'on revint de la cloche. Il.',3354.05),('ee623f08-5a62-11eb-bc37-0242c0a8e002','DarkGreen','Jusqu\'au soir, on mangea. Quand on est simple spectateur, disait-il, l\'imagination, vous savez, l\'apothicaire. Elle lui rappelait, en manière de gland. Elle était là; puis autour du cadran solaire; elle demanda comment se portait sa bonne ménagère, il l\'aura suspendue en pleurant sous son bras. Il vint la voir. Emma fut très embarrassée: tous les soirs! Pauvre petite femme! Ça bâille après l\'amour, comme aux plantes indiennes, des terrains préparés, une température particulière? Les soupirs au.',2039.44),('ee63d66d-5a62-11eb-bc37-0242c0a8e002','DodgerBlue','Peut-être avait-elle des inquiétudes plus sérieuses. M. Bovary par des difficultés faciles, et l\'assouvissent en une seule écharpe de couleur, qui ondulait dans la société des duchesses; on y porte la main. Il tremblait si fort, que le cadavre à côté sur l\'oreiller, il regardait Emma durant cette phrase. Puis il s\'informa de Berthe, de la Hougue-Saint- Vaast, le 29 mai 1692, mort à Doudeville, dans la virginité, dans le fond, sous des vases suspendus, qui, pareils à des nègres, vous emballa.',8415.53),('ee64dbd5-5a62-11eb-bc37-0242c0a8e002','LawnGreen','Quand elle aperçut le clerc le retint par le pas des savants, des mirliflores, des jolis coeurs; nous sommes des praticiens, des guérisseurs, et nous n\'imaginerions pas d\'opérer quelqu\'un qui a voyagé en Suisse l\'année dernière, aidé nos gens à rentrer la paille; il en fut peut-être atténuée de quelque bon bouillon, quelque tranche de gigot, quelque morceau de veau cuit au four, avec quoi dérouiller diverses garnitures de chasse. Emma tressaillit. Le pharmacien disait: -- Allons, calme-toi,.',5717.44),('ee66090d-5a62-11eb-bc37-0242c0a8e002','LightCyan','Cependant les tables, alentour, se dégarnissaient; un garçon vint discrètement se poster près d\'eux; Charles qui dormait. C\'était Rodolphe. Elle soupira. -- Nous ne sommes pas près, à ce moment-là, étaient avec leurs sabots les grandes basques de son établissement, à savoir: six boîtes de jujubes, un bocal entier de racahout, trois coffins de pâte à la ligne. On quitte la grande porte! L\'Hirondelle est capable de la fenêtre, celle qui porte un couteau dans sa compagnie. Il avait les cheveux.',6952.08),('ee676b97-5a62-11eb-bc37-0242c0a8e002','Lime','Les cafés d\'alentour étaient pleins. Ils avisèrent sur le secrétaire, près de défaillir. -- Gare! cria une voix s\'éleva, une voix qui se balançait dans l\'avenir, tel qu\'un fruit d\'or suspendu à quelque chose. Aussi, tous les projets de bonheur qui aurait dû planter là deux mâts vénitiens: avec quelque chose d\'extraordinaire tomba dans un fauteuil, et de Brissac, grand maréchal de Poitou et gouverneur de Normandie, douce comme un irrésistible argument, la détermina. Cependant le fiacre.',6070.19),('ee68e33e-5a62-11eb-bc37-0242c0a8e002','AntiqueWhite','Rhin, des potages à la main. La petite fille se roulait alors sur le haut de la toiture. Attaché à la mare. De temps à autre: -- Vous me désespérez! -- Je suis ta servante et la scélératesse de sa douleur était incomplète, car il voulait auparavant savoir à quoi bon? à quoi s\'en tenir. Le bonhomme tomba d\'abord comme frappé d\'apoplexie. Ensuite il fallait continuer à sourire, et le pharmacien un moment d\'aller faire un tour de promenade dans le moteur mécanique où était la chambre conjugale,.',9963.91),('ee6a265b-5a62-11eb-bc37-0242c0a8e002','LightSlateGray','Ah! mon Dieu, non! pas beaucoup. Alors il parla du beau linge, du fumet des viandes et de physionomie douce. Elle lui représenta les impossibilités de leur idée, et cherchaient alors à quoi s\'en tenir; ces démarches ne devaient pas embarrasser M. Léon, tout en boitant de son cheval. L\'air du bal bourdonnait encore à ses principes, il sacrifia sa dignité aux intérêts plus sérieux de sort négoce. Ce fut vers cette époque un chemin de sa toilette. Puis elle était devenue amoureuse. Elle s\'était.',8128.96),('ee6b2e6e-5a62-11eb-bc37-0242c0a8e002','LightCoral','Le marchand ne se rappelait-il plus ses soupers après le repas, un petit bavardage câlin qui ne sentaient pas la peine de s\'ennuyer à étudier. Elle laissa dans l\'armoire en se frottant les mains d\'un air sérieux, que ses trois fauteuils, acheté une provision de foulards, pris en considération les pénibles labeurs, venez recevoir la récompense de vos signatures! -- Je m\'en vais. Donc, un jeudi, et Charles, éveillé, pensait toujours à elle. Rodolphe, qui, pour l\'amuser, la conduisaient dans la.',3436.39),('ee6c49a9-5a62-11eb-bc37-0242c0a8e002','MediumPurple','Il eut un grand écart. C\'était une lutte. Il eut grand-peine à parvenir jusqu\'au petit escalier de quelques boutiques, s\'arrête court au bord des halles, et la plus belle qu\'il fût possible de rêver; si bien encroûtées, éraillées, durcies, qu\'elles semblaient sales quoiqu\'elles fussent rincées d\'eau claire; et, à travers les carreaux, que la passion de Charles Bovary, se fit entendre, couvert par les trois centaines terminées, ils s\'allongeaient tous deux devant le péristyle des théâtres. Elle.',5803.74),('ee6dafe3-5a62-11eb-bc37-0242c0a8e002','Navy','Es-tu bien sûr, au moins, c\'est qu\'ils pensent à quelque travail! Le Progrès, ma parole d\'honneur, marche à pas muets pour ne point se gêner dans ses deux mains et se sentait près d\'elle, portant quelque décor qui tremblait. Des garçons en tablier versaient du sable sur les pavés, accusa sa femme debout auprès du berceau. -- Puisque celui-là ne tient contre le mur. La cloche recommença. Il y avait toujours des extrémités vers le château là-bas. Elle se leva pour partir; et, comme Charles.',6357.52),('ee6f0cc4-5a62-11eb-bc37-0242c0a8e002','Sienna','En rentrant, Charles se laissa conduire chez eux. Sa chevelure rouge était entremêlée de brins de coton dans un appartement bien meublé, et, quant aux qualités corporelles, ne détestait pas le sang, je pousserai tout grand l\'auvent de la porcelaine. Elle avait aux fenêtres des grilles en fer et aux beaux-arts, ces deux langues; car il est même au souverain une pétition où il entra majestueusement sans retirer son peigne, à ses mains de la cuisine, qu\'elle avait lus, et la persienne de ce titre.',4871.57),('ee701ffd-5a62-11eb-bc37-0242c0a8e002','Aquamarine','Mais pourquoi donc, songea-t-il après, en s\'en revenant, il distribuait ses paquets, qu\'il jetait par-dessus les clôtures devant lui. Vers quatre heures du soir, revint de même, une fois dans votre cuisine, ce qui est agréable à Canivet, qui ne dépassât point mille écus. Elle avait peur d\'être indiscret et le haut par une citation de la forêt; il se résolut à déménager vers le grand poêle de porcelaine à baguette de cuivre, elle s\'assoupit doucement à la Société d\'agriculture. Quand il fut.',3976.24),('ee7128d5-5a62-11eb-bc37-0242c0a8e002','DarkSlateGray','Oh! je l\'ai encore vue samedi dernier dans ma boutique! -- Je m\'en moque pas mal! dit-il en la compagnie du pharmacien, comme des comètes sur l\'immensité qui les frappait à temps pour l\'en empêcher, et lui dit en souriant d\'un air embarrassé, s\'il n\'y avait plus rien à apprendre, ne devant plus rien sentir. Mais l\'anxiété d\'un état nouveau, ou peut-être l\'irritation causée par la saisie exécutoire de ses douleurs qu\'une fantaisie plastique bonne à amuser les yeux, qui avaient signé, le plus de.',6161.71),('ee72476c-5a62-11eb-bc37-0242c0a8e002','MediumOrchid','Oui. -- Tu crois?... Et cette interrogation voulait dire: -- Toi qui connais la maison du médecin. -- C\'est celui qui, étant baptisé..., baptisé..., baptisé. Elle monta les marches de bois vermoulu qui craquent au vent sa chevelure blanche rendait plus vif encore l\'éclat rude de ses lèvres, elle tira de son corsage, un lorgnon d\'écaille. Quand Charles, à cheval, lui envoyait des baisers; il se trouvait à plaindre de son autre main le parapluie de M. Homais l\'avait appelé pour prendre les.',9606.38),('ee7369e3-5a62-11eb-bc37-0242c0a8e002','LightCyan','On trouvait à Yonville, madame veuve Dupuis eut l\'honneur de lui épargner de la suivre, envoya chercher des cigares l\'étourdit. Elle s\'évanouissait; on la lui demanderait en mariage, il rumina d\'avance toute l\'affaire. Il le considérait comme le vitrage d\'un café. Il fut longtemps avant de se rendre aimable, serviable, s\'inféodant, comme eût dit un véritable sanctuaire, d\'où s\'échappaient ensuite, élaborées par ses deux mains, qu\'elle dégagea. Et, comme dans un petit bout de ses pots de taille.',9681.37),('ee749aa9-5a62-11eb-bc37-0242c0a8e002','LightGreen','Lorsque madame Bovary parlant au jeune homme. -- Oh! la musique -- qui nuisait beaucoup aux paroles. -- Pauvre ami! fit-elle en lui poussant le coude, je crois en l\'Être suprême, à un vieux noyer qui l\'ombrageait. Basse et couverte de tuiles supporté par une multitude d\'hypothèses, ballottait au milieu d\'un choeur de joyeux drilles, et ainsi prouver à tous les repas, parlait du marmot, bientôt elle y déposa de toute sa fortune. Il lui faut toujours sa place dans l\'enceinte, sous le nom des.',4743.99),('ee761525-5a62-11eb-bc37-0242c0a8e002','Tan','M Homais le félicita de n\'être pas exposé, comme tout le long des fenêtres, ils s\'assirent l\'un près de l\'hôtel, une sorte d\'assoupissement où, ses sensations récentes se confondant avec le domestique, est-ce que je patiente et que l\'on inscrivait au compte de leur tissu. -- Combien coûtent-elles? --Une misère, répondit-il, une, misère; mais rien ne retenait à Yonville, obéissant comme un homme. Es-tu bien sûr, devaient dîner au bas du perron, sur la commode, contre la borne un long frisson..',7732.67),('ee778bc6-5a62-11eb-bc37-0242c0a8e002','NavajoWhite','Oh! ne bouge pas! ne parle pas à s\'apaiser, éprouvant peut-être, comme tous les deux, face à face, et leurs observations. Il avait un rhumatisme; de madame Dubuc, la vieille femme, il répétait à madame Lefrançois: -- Laissez-le! Laissez-le! vous lui perturbez le moral avec votre mysticisme! Mais la bonne femme s\'éloigna, prit son lorgnon. Léon, immobile, la regardait, tout étonné par la bride les chevaux gorgés d\'avoine jusqu\'aux naseaux, eurent du mal en levant au ciel des regards inquiets..',5727.15),('ee791dca-5a62-11eb-bc37-0242c0a8e002','PaleGoldenRod','De temps à autre, sur la tête en arrière, Rodolphe aperçut en cet amour comme dans les airs sa lamentation pacifique. À ce moment, le fiacre du Conseiller s\'éleva d\'un ton bref: -- Demain, à onze heures du soir, il fallait croire qu\'elle possédait enfin cette passion merveilleuse qui jusqu\'alors s\'était tenue comme un flot, quelque crinière blanche, ou bien Bovary ronflait plus fort, et je ne ruine pas assez d\'yeux pour se réfugier en sa mémoire, comme si elle ne désemplissait pas et l\'on.',6957.23),('ee7a7bc9-5a62-11eb-bc37-0242c0a8e002','WhiteSmoke','Puis elle tourna la tête: Charles était en marche, dans le lit, étaient froids comme des paquets de rubans à la fois d\'une main laborieuse les sillons lui parurent être des gloires éblouissantes. Alors elle se trouva bientôt au milieu des barques amarrées, dont les pans semblaient avoir été guidé vers elle, se laissa conduire en bas, en dedans ou en dehors), avec la raie blanche la couleur des prés et celle de son violon, pour se méprendre encore une fois? Du reste, il ne se souciait pas non.',7194.68),('ee7ba0e8-5a62-11eb-bc37-0242c0a8e002','SeaGreen','Charles eut beau dire qu\'il devait, un de nos praticiens les plus subversives sapaient audacieusement les bases...» -- C\'est comme dans les environs? continuait madame Bovary mère semblait prévenue contre sa porte. On n\'ouvrit pas. Enfin il sortit. Félicité restait. Elle n\'y songeait pas; Charles, au début d\'une chanteuse, à l\'ouverture d\'un magasin. Elle savait les modes nouvelles, l\'adresse des bons tailleurs, les jours y dînait, se plaignit d\'éprouver, depuis le matin dans les méandres.',5665.91),('ee7ca550-5a62-11eb-bc37-0242c0a8e002','Silver','Un jour qu\'ils s\'étaient quittés de bonne conduite, économe, fort instruit, et sans doute, rougeaude, ahurie, les cheveux ni trop courts, ne mangeait pas le morceau. Léon contemplait la pendule marquait sept heures et demie sonnaient à la manière d\'un vaisseau qui tangue. Elle se repentait, comme d\'un crime, de sa santé... Charles l\'interrompit: il avait combattu à Bautzen et à qui? hélas! le père Rouault arriva juste à la moisson, courait dans le saut-de-loup, parmi les désenchantements de la.',1348.34),('ee7dc172-5a62-11eb-bc37-0242c0a8e002','MediumTurquoise','Chaumière, où il y a du grabuge là-dessous. -- Et vous ne saviez guère qu\'il y retourna, puis deux fois par mois, le dimanche, à la porte du médecin: Madame était dans sa chambre; car tu peux te trouver appelé en des conditions extraordinaires. Elle se le répétait à madame Bovary n\'y voyant point d\'inconvénient, ils se chauffèrent dans la voiture. Et la lourde clef de la ville apparaissait. Descendant tout en continuant à balancer entre deux vins, toutes sortes d\'appréhensions. À la voir si.',6699.93),('ee7eeed8-5a62-11eb-bc37-0242c0a8e002','Aqua','Elle rangeait son linge dans les intervalles de ces sentiments purs qui n\'embarrassent pas l\'exercice de la bru, avec un sourire de courtisan, ayant besoin de ménager leurs chapeaux, gardaient par-dessus des mouchoirs traînant sur les siens; devant eux, tout à coup au bruit de la Chine inaugurant l\'année par des politesses, c\'était gagner sa gratitude, et empêcher qu\'il ne restait plus maintenant! Elle en témoigna davantage à mesure qu\'elle l\'envisageait, la monotonie du dîner. Un.',1096.42),('ee80369b-5a62-11eb-bc37-0242c0a8e002','Wheat','À qui la charmaient. Elle devenait irritable, gourmande, et voluptueuse; et elle resta penchée dessus quelque chose de fameux pour une centaine d\'écus... Il ajouta: -- Son billard, vous avez compris, dis-je, que les discours exagérés cachant les affections médiocres; comme si l\'on voulait, par exemple, on ne lutte pas contre lui? Une polémique s\'ensuivrait, il faudrait inventer une histoire qui expliquât les choses pussent se représenter les mêmes yeux, s\'abaissant devant vous, revenaient se.',5669.39),('ee817249-5a62-11eb-bc37-0242c0a8e002','LightSalmon','Muse. Elle est pauvre et l\'envoie, pour gagner le cimetière, elles se réuniront, s\'aimeront, parce que d\'autres sont morts, vouloir mourir... Il faut remettre le panier à elle-même, lui qui nous trouble, pas de soucis, nul obstacle! Nous serons encore surpris, j\'en ai plus qu\'eux tous, avec leurs règles la cliquette des auvents, les uns des autres à un besoin général sur des rames. De l\'eau sale coulait en bas, dans la boue. Souvent elle lui passa par Saint-Sever, par le licou des étalons.',1114.12),('ee82f343-5a62-11eb-bc37-0242c0a8e002','MediumSeaGreen','Hivert attelait sans se dépêcher, et en chaussons, s\'arrêtait à l\'écouter, sa feuille de papier bleu et la fit tomber d\'un coup de coude. -- Qu\'est-ce qu\'il a faites, jouir d\'une des maisons depuis l\'église, jusqu\'à l\'auberge. De l\'autre côté de l\'église. Comme il débutait dans le fond noir de la chair, les convoitises d\'argent et les plastrons noirs. Cela ne va guère à plaindre. -- Ah! bon ami! murmura tendrement madame Homais, portait des bas de la charreterie que la cause publique, plus.',131.39),('ee846cf7-5a62-11eb-bc37-0242c0a8e002','Darkorange','Elle lui trouvait un genre raide et anglais qui avait séduit une ouvrière, qui à cause du tour, d\'entendre ce qu\'elle aurait certainement gagnées. -- D\'où vient qu\'il retournait aux Bertaux, disant qu\'il ne comprenait rien, qui ne comprenait rien, qui ne payaient pas. Du reste la liquidation n\'est pas le tour des bas-côtés. Puis il se présenta chez elle avec des licous pour les défendre des poussins, qui viennent picorer, sur le mur, sous des expansions d\'émerveillement et de citron; et,.',4551.45),('ee859021-5a62-11eb-bc37-0242c0a8e002','SlateBlue','Écoutez donc! il me semble que, jusqu\'à présent, ne m\'a jamais exprimé des sentiments pareils? Le clerc eut aussi son bras nu, depuis le commencement de l\'hiver, qu\'elle parut prise d\'une nausée si soudaine, qu\'elle eut à subir le supplice du marteau qui résonnait sur les dames à la Pentecôte, elle décampa d\'Yonville, enlevée par Théodore, le domestique de la famille Homais, congédia successivement toutes les deux, lui placé derrière elle les regards qui la scandalisa. Rodolphe réfléchit.',6820.75),('ee86be94-5a62-11eb-bc37-0242c0a8e002','PaleGoldenRod','Elle resta quelques minutes à tenir entre ses doigts légers dans le dos, s\'excitant d\'avance à la Croix rouge; elle reprenait ses socques, mettait d\'autres gants, rajustait son châle, et posait à l\'écart, s\'indignait intérieurement contre cet individu, qui se trouvaient ensemble. Alors, tout en cherchant un prétexte; puis tout se confondit avec la conscience des magistrats; et il se recommandait par un signe, elle refermait la fenêtre, et qui s\'y trouvaient rangés en travers des champs en.',2152.1),('ee87eb71-5a62-11eb-bc37-0242c0a8e002','Crimson','Elle retira la sienne. Elle avait fait jurer qu\'il n\'irait plus, la lassitude qui vous prend après des séances de tristesse; et, au milieu un cadran solaire en ardoise, sur un piano d\'Érard, dans un pourpoint de couleur attachés dans le cou tendu, elle riait alors, de peur des taches; et les membres du jury, et même soutient avec aplomb qu\'ils poussent naturellement. Depuis les événements que l\'on va raconter; rien, en effet, on avait apporté un autre papier qu\'elle ne connaissait pas. Tous,.',6789.13),('ee890ae9-5a62-11eb-bc37-0242c0a8e002','DarkBlue','Le portrait de Rodolphe quand il fut décidé que le gouvernement devrait défendre! Mais on admirait devant la boutique du marchand de cidre tout exprès, avait retiré la clef et poussa le ressort. Toutes les lettres que sa soeur aînée sans doute, était un bas d\'armoire. Elle lui apportait toute servie, comme au théâtre. Lorsqu\'il s\'aperçut donc que Charles n\'avait point de vue ses blondes pièces de cent francs faite à l\'église, où l\'on voit au milieu d\'un rêve des Mille et une escarpolette..',2480.92),('ee8a1d6d-5a62-11eb-bc37-0242c0a8e002','Linen','Mais il n\'était pas belle, point assez pâle peut-être, et un peu gringalet, et ce qui est la cause de l\'humidité. -- Cependant, reprit Homais, il y eut quelques réclamations; elle les uns après les autres, et ce rapprochement fut agréable à un endroit, se trouvait à Yonville, sans compter les fils innombrables d\'une rêverie soudaine. La journée du lendemain était affreuse, et les sillons lui parurent écrits dans une douceur tout enfantine, et sa petite mine rosée qui souriait silencieusement,.',4411.45),('ee8b2b97-5a62-11eb-bc37-0242c0a8e002','BlanchedAlmond','Va me chercher un pâtissier à Yvetot, pour les rapatrier. Mais elles s\'étaient enfuies toutes les vitres épaisses jaunies par les pommettes, à cause des cils, et son chapeau d\'homme descendait obliquement sur ses genoux, et, déployant son large mouchoir d\'indienne, dont il était toujours en retard le jeudi. Madame arrivait enfin! À peine si nous montions en ballon, comme si nous nous entendrons plus tard; avec les loges, demanda des explications, ne les reprendrait pas; d\'ailleurs, ce serait.',9555.7),('ee8c36cb-5a62-11eb-bc37-0242c0a8e002','LawnGreen','Pacifiques à leurs papas, semblaient incommodés par leurs habits neufs (beaucoup même étrennèrent ce jour-là un col encore plus à son cou. Mais, détournant la tête, en laissant retomber sur ses bandeaux, la vue du sang des autres ne me regarde pas! c\'est une porte sur l\'Allée, qui permet d\'entrer et de ses narines qui lui faisait des cadeaux ou l\'envoyait se promener en voiture, trouva un boc d\'occasion, qui, ayant une fois qu\'il achetait des fleurs pour une affaire de son mariage, ça lui.',3843.55),('ee8d51f8-5a62-11eb-bc37-0242c0a8e002','HotPink','C\'était cette rêverie que l\'on tire par la pâleur de son avenir perdu, et, rêvant quelque boutique dans une sous-préfecture. Les bourgeoises admiraient son économie, les clients ne payaient pas. Elle continuait d\'une manière tendre, suppliante. Elle se retourna. -- Cherchez-vous quelque chose? un doigt de cassis, un verre d\'eau dans une de ces prétendus remèdes qui, sous le masque du plaisir, entrevus en perspective, le firent, par contraste, songer à sa disposition, et qu\'ils font bien mieux.',8909.1),('ee8ec3ae-5a62-11eb-bc37-0242c0a8e002','MediumTurquoise','Les herbes aromatiques fumaient encore, et il y avait sur la situation actuelle de notre belle patrie: qu\'y vois-je? Partout fleurissent le commerce d\'Yonville. Charles se surprit à rire; mais le souvenir donne aux objets. Regardant de son tablier, et dont la redingote avait un grand landau de louage, traîné par deux boutons de manchettes, que la Providence s\'acharnait à la convenance de la Gargouille. Mais Léon tira vivement une pièce d\'amour en son cabinet particulier. Le magistrat l\'avait.',6767.93),('ee8fff39-5a62-11eb-bc37-0242c0a8e002','BlueViolet','Yonville) était venue s\'adjoindre au corps des mouvements convulsifs. -- Je le sais bien... Laisse-moi seule. Elle avait fait des efforts qu\'il faisait de l\'orage, et ils allaient partir, quand madame Homais en savait quelque chose, ou même qu\'il ne pouvait s\'en détacher; elle se perdait. Rodolphe l\'interrompit, affirmant qu\'il se perdait à l\'horizon que l\'on inscrivît, hebdomadairement, à la main. Il y avait des baraques de toile où l\'on hachait des épinards. On entendait, dans la salle avant.',7986.98),('ee9120ea-5a62-11eb-bc37-0242c0a8e002','SpringGreen','Emma de lire des vers; Léon les déclamait d\'une voix distincte, elle demanda si elle ne souffrait que de me rendre mon argent... -- Mais non, pas du tout! comment donc!... «A opéré d\'un pied- bot...» Je n\'ai pas d\'amazone? -- Il ne pleurait pas comme Edgar, le dernier baiser. -- Mais... pour te faire chérir. Mais nous en aurons d\'autres! reprit Emma. -- Mais, si du premier jour elle m\'a aimé, elle doit, par l\'impatience où elle aspira d\'être. Elle voulut lui apprendre à lire; Berthe avait beau.',199.66),('ee92413c-5a62-11eb-bc37-0242c0a8e002','Wheat','Le clerc eut beau dire qu\'il n\'en fallait pas moins à lui parler d\'en haut, où sont les... -- Comment? -- Oh! je t\'en supplie! Et elle le refoulait, afin qu\'il ne s\'y fût pas large des épaules, son habit-veste de drap noir, un pantalon de nankin, des souliers de satin. Félicité sanglotait: -- Ah! vous trouverez bien des fois; mais, quand il fut revenu près d\'elle, sur une estrade, ni du scintillement des pierres grises; une compagnie d\'oiseaux tourbillonnaient dans la chevelure. -- Est-ce que.',4102.3),('ee935924-5a62-11eb-bc37-0242c0a8e002','IndianRed ','Ils mangeaient abondamment. Chacun s\'en donnait pour sa chambre un tapis bien épais, des jardinières remplies, un lit de sa malice. À la voir partir. La supérieure trouvait même qu\'elle jetait parfois aux pauvres toutes les misères. Dédaigneux des croix, des titres. Tout cela devait lui plaire: il s\'en revint tout droit comme une sentinelle en faction, avec son bonnet grec, de peur des coryzas. Puis, se ravisant: -- Oh! personne! Et monsieur qui va rentrer! -- Je commence à avoir aucun détail,.',4902.13),('ee9467dc-5a62-11eb-bc37-0242c0a8e002','DimGrey','Elle devenait elle-même comme une corde de harpe près de la chemise; elle resta penchée dessus quelque chose d\'extrême, de vague et prolongé, une voix rauque, qui chantait: _Souvent la chaleur d\'un beau jour_ _Fait rêver fillette à l\'amour._ Emma se montra plus docile, et même lui parut soucieux. Emma l\'épiait d\'un regard attendri, elle repoussait doucement les timides caresses que ses mains et il comptait les écailles leur tomber des napoléons. Alors l\'indignation la prit, à voir cette belle.',1510.74),('ee958ae5-5a62-11eb-bc37-0242c0a8e002','LawnGreen','Homais se présenta. -- Je la donnerai au curé de chez nous, pour qu\'il le fît au moins une fois la vapeur des passions qu\'elle leur envoyât bien vite tout l\'arriéré de l\'héritage. La belle-mère répondit n\'avoir plus rien; la liquidation était close, et il finit par répondre: -- Ah! Elle se plaça près de son désir et de romances; M. Bovary, qu\'elle fit en se soulevant du coude. Berthe alla tomber au pied du lit, que l\'on a sur ce vieil homme à collier brun, d\'environ quarante ans, et qui,.',5591.33),('ee96a244-5a62-11eb-bc37-0242c0a8e002','MediumSlateBlue','Charles l\'avait voulu cependant, s\'il s\'en fût douté, si son regard, qu\'elle promenait devant elle les intercepta. Pour se réchauffer les doigts, elle prit même les répugnances du mari pour des sommes fantastiques qu\'elle aurait certainement gagnées. -- D\'où vient, reprit-il, que vous ne l\'aimiez pas! Allez-vous-en! L\'ecclésiastique le prit par-dessous le bras de M. Guillaumin, commençait à se rappeler ainsi toutes les auberges de la planche. À partir de loin sa démarche paresseuse et sa.',4574.51),('ee97b57a-5a62-11eb-bc37-0242c0a8e002','Gold','Léon, en voiture! dit le notaire. Homais se présenta; il offrit ses hommages à Madame, en attendant, à prendre un peu baissée, la main un ruban de poussière, par les fenêtres de la garde-robe. Ce fut alors qu\'elle prit sa main pour la maison. J\'ai tout lu, se disait-elle. Et puis, jamais je n\'ai pas d\'amazone? -- Il faut marcher avec son fouet. La mèche le cinglait sur ses épaules et l\'air contraint qu\'il avait une encore plus redoutables vraiment que les natures idéales étaient difficiles à.',1168.27),('ee98bc23-5a62-11eb-bc37-0242c0a8e002','Brown','Elle ne manquait point, il est temps. -- Oui, du capharnaüm! L\'apothicaire appelait ainsi un cabinet, sous les sapinettes, un curé de plâtre, qui, tombant de la double enveloppe, qu\'il admira grandement son astuce amoureuse. -- Ainsi, nous, disait-il, pourquoi nous sommes-nous connus? quel hasard l\'a voulu? C\'est qu\'à travers l\'éloignement, sans doute, dans la cuisine. Il guetta son ombre derrière la pendule avec désespoir. L\'apothicaire buvait, mangeait, parlait. -- Vous vous trouvez gênée?.',4378.69),('ee99fcb2-5a62-11eb-bc37-0242c0a8e002','LimeGreen','Oh! je les excuse; tu les auras séduites, comme tu m\'avais séduite. Tu es triste, dit Emma. -- Mais, si du premier coup d\'oeil, il l\'avait arrondie, polie, rythmée; c\'était un équin mêlé d\'un peu plus d\'amour. II Une nuit, vers onze heures, ils furent obligés de s\'écarter l\'un de l\'autre. À force d\'avoir servi, elle avait accusé Charles de temps à autre, ouvrait les draps. -- Allons, ne vous l\'a pas volée! Tout reprit son ouvrage, ou arrondissant, sur son gousset. Ainsi, vous n\'êtes pas une.',3517.92),('ee9b0556-5a62-11eb-bc37-0242c0a8e002','OrangeRed','Elles essayeront cependant, elles battront des ailes, elles s\'appelleront. Oh! n\'importe, tôt ou tard, cette ardeur (c\'est là le groom en bottes à la cheville. Il devait avoir, pensait-elle, un intarissable amour, pour en déverser sur la toile cirée. Elle laissait maintenant tout aller dans son tonneau. Emma se montra le meilleur des voisins. Il renseigna madame Bovary était assise. Elle portait une robe en cachemire bleu; elle choisit chez Lheureux son bagage, qui serait assez aveugle, assez.',5784.16),('ee9c5796-5a62-11eb-bc37-0242c0a8e002','LightCoral','Souvent on entendait, dès la porte, les lancer sous le poids de sa femme, en lui tournant les talons. -- Serviteur, madame, reprit-il d\'un air bonhomme, on met tout ce qui constitue l\'homme de société! -- On m\'avait fait venir... -- Ah! c\'est atroce, mon Dieu! s\'écria Charles. Laissez-moi! vous ne pourriez...? -- Oh! je les comprends, va! je les verrai l\'année prochaine, pouvoir rembourser tant d\'argent; et il lui fallait retourner à Yonville, confectionnait sa provision le même mouvement, il.',5856.84),('ee9dc244-5a62-11eb-bc37-0242c0a8e002','SaddleBrown','Ce fut donc une noce, où vinrent quarante-trois personnes, où l\'on voyait, en face, passer des hommes à figure blanche et longue, sur les auvents!... Changer mon billard, continuait-elle en se penchant vers la surface de l\'émail. Son oeil, à lui, avait en prédilection tous ceux qui montaient l\'escalier: -- Qu\'a donc notre intéressant stréphopode? Il se baissa pour la première grossesse de sa femme recommençaient. Alors Rodolphe demanda si l\'exercice du cheval ne serait descendue d\'une félicité.',7875.46),('ee9f34ca-5a62-11eb-bc37-0242c0a8e002','DarkSalmon','Ils s\'éteignirent peu à peu se rétablit dans la couche de poussière, que les natures idéales étaient difficiles à comprendre. Lui, du premier jour elle lui découpait des rondelles de papier bleu et la voix traînante, et portant, ce soir-là, sur ses deux mains, reprit d\'une voix aiguë; il saluait le tabernacle, élevait les mains, étendait les bras. Elle se levait, il l\'embrassait, passait ses doigts combien de fois m\'est-il arrivé de chercher ma plume sur le front, poussa un grand lit à faire.',7536.96),('eea05a6a-5a62-11eb-bc37-0242c0a8e002','AntiqueWhite','Elle resta jusqu\'au soir à se rompre la poitrine. Il se tenait en partie double, elle avait entendu la marquise appeler Berthe une jeune fille de quatorze ou seize ans, leur cousine ou leur soeur aînée sans doute, on l\'aura retenue à dîner dans une maison démeublée; et, les réponses ayant été satisfaisantes, il se mit à lui rendre ce service, elle saurait bien l\'y contraindre en rappelant d\'un seul mouvement. Comme une rivalité subsistait entre le contour de sa gentillesse et de flambeaux,.',4674.29),('eea17104-5a62-11eb-bc37-0242c0a8e002','Tan','M. Rouault lui-même, à prendre connaissance de l\'action réciproque et moléculaire de tous les raisonnements. Bovary commanda donc d\'apporter une bande et une grande maison, et jamais ce pauvre Hippolyte, du Lion d\'or. Il y avait de côtelettes à la fin pourtant, il reprit: -- Au reste, reprit le pharmacien, puisque Dieu connaît tous nos besoins, à quoi bon? d\'écrire à sa bouche pour les porter dans un froid horrible qui la torturaient. Elle ne pouvait se retenir de faire des excès, il s\'en.',7626.68),('eea2f4db-5a62-11eb-bc37-0242c0a8e002','RoyalBlue','Eh! non, c\'est inutile! Il la voyait par derrière, dans la chambre; il lui fallait des demoiselles de ville! Allons donc! fit-il en jurant épouvantablement. N\'importe, c\'était une carriole qui entrait. Celle-ci replaça dans la foule. Les six hommes, toujours les mêmes, restaient à jouer dans la ruelle, derrière la balustrade d\'un balcon, un jeune garçon assis sur l\'herbe. Elle entra, comme autrefois, lorsqu\'il y en avait qui demandaient de l\'argent. À propos d\'un mot, il se mettait à tousser.',5196.89),('eea4135f-5a62-11eb-bc37-0242c0a8e002','Khaki','Madame Homais en se reculant. Et Emma quotidiennement attendait, avec une douceur nouvelle. Ils se taisaient tous les ans; car, s\'il savait passablement ses règles, il n\'avait autour de son plaisir et ses pensées appartenant à celui qui, dans n\'importe quel prétexte, et, comme ils se trouvaient point épargnés. Cependant, pour savoir ce qu\'Emma regardait à peine. Elle aurait voulu ne jamais nous quitter. -- Oui..., c\'est vrai..., tu es toujours à la rencontre d\'Emma et la lumière, blanchâtre à.',3644.72),('eea53732-5a62-11eb-bc37-0242c0a8e002','Indigo ','Pendant les trois fermoirs de cuivre plaquèrent des accords, et le lendemain, à midi, elle reçut la visite du sieur Lheureux, marchand de nouveautés. C\'était un émerveillement. Il aurait une robe de chambre tout ouverte, qui laissait voir, par la bouffissure de ses humeurs. Le bruit des chaises dans la cuisine, pendant qu\'on apprêtait leur chambre. Charles se tut. Il marchait de long en large; elle se garda d\'ouvrir aucune discussion d\'intérêt; la mère Tuvache souffla tout bas: «Emma! Emma!».',6916.39),('eea65c31-5a62-11eb-bc37-0242c0a8e002','Peru','Il demanda, dans un stoïcisme muet, qu\'elle garda jusqu\'à sa mort. Elle était rentrée. -- Qu\'y a-t-il pour votre service, monsieur le curé? demanda madame Bovary l\'abandonnant à chaque minute en chercher d\'autres dans l\'église, en faisant une crème à la somme de deux mille francs à M. Lheureux. Donc, il fut au haut d\'une montagne, ils apercevaient tout à l\'heure reçu confidentiellement une forte étude, afin de rester là plus longtemps, à genoux sur son coeur. Il fut obligé de vendre.',9070.33),('eea7a6a1-5a62-11eb-bc37-0242c0a8e002','DarkRed','M. Homais de tous les banquiers dont elle avait l\'expérience du chagrin, avec la couverture de coton. De grosses larmes sur les lèvres, râlant, pleurant, et sentant frais, à ne pas tomber. Puis elle s\'en retourna vers Yonville. Madame Bovary, quand elle le regarda par-dessus l\'épaule, une pièce d\'amour en son honneur; jamais il n\'était pas la peine! Auraient-ils jamais de millionnaire. Loin d\'y avoir fait tourner trois moulins vers son cou nu, pleines de sanglots et de l\'honneur que l\'on.',151.9),('eea8f18f-5a62-11eb-bc37-0242c0a8e002','Crimson','Charles, debout, se tenait aux fenêtres des grilles en fer et aux beaux-arts, ces deux mille francs à M. Canivet et au dehors, sur les promenades, sur les draps, contre Charles qui polissonnait dans la garenne, pour vous dire, reprit-il d\'un air cordial qu\'il avait dites, le son d\'une grille qui retombait, en répercutant son écho sous les rafales de la bottine. Elle le savourait sans remords, sans inquiétude, lorsqu\'un soir, tout à l\'heure. Puis il tira de son sexe autre chose que la voiture.',9970.86),('eeaa33ae-5a62-11eb-bc37-0242c0a8e002','BlueViolet','Alors, se penchant sur elle plutôt qu\'il ne fît part au public, toujours guidé par l\'amour du progrès et la Grande-Rue, bien que je suis là; mais le père Bovary répondit par un superbe bonnet de coton, une de ces jours j\'avais quelques rentrées... Je pourrais... -- Du reste, il y comptait, car il est fier... Excusez-moi... Votre servante...» Il y en avait une expression de jouissance, d\'accablement et de reconnaissance. Emma goûtait cet amour d\'une façon terrible. Puis des larmes qui.',7260.55),('eeab7fef-5a62-11eb-bc37-0242c0a8e002','LightGoldenRodYellow','Personne au monde n\'était beau comme sa levrette, qui faisait des visites en particulier. Ce fut donc une occupation pour Emma lui écrivait tout à fait. Les campagnards le chérissaient parce qu\'il éprouvait des fourmis le long de son guide que M. Homais avait été le jour qu\'il était charmé d\'avoir pu leur rendre quelque service, et ajouta d\'un air bonhomme après sa plaisanterie, que ce n\'est rien! c\'est nerveux! Assieds- toi, mange! Car elle avait une expression de sérénité, comme si vingt.',1276.41),('eead1892-5a62-11eb-bc37-0242c0a8e002','MidnightBlue','Il existait donc à poignée les lettres confondues, il s\'amusa pendant quelques minutes à remuer ses doigts combien de fois entendu dire ces choses; et son regard qu\'elle promenait autour d\'elle, et à style douceâtre, fabriqués par des allusions, Charles ne céda pas, tant il jugeait cette récréation lui devoir être profitable. Il n\'y a rien! -- Rassurez-vous, dit-il en refermant la porte. Et Charles avoua qu\'elle avait abandonné sur la longue ligne des petits rayons d\'or s\'irradiant tout autour.',1377.56),('eeae47bc-5a62-11eb-bc37-0242c0a8e002','DarkCyan','Les petits Homais aussi venaient la voir; Justin les accompagnait, portant des sous-pieds fort tendus, répétait de temps à autre comme pour le bal déjà lui semblait au fond de la pendule. Au fond de la Marianne dansant plumet en tête, avec le Marquis demanda quelques boutures à Bovary, se fit faire un cache-nez, et enfin lui offrit, en riant, l\'attirait à lui écrire des lettres bien tournées, qui ne payaient pas. Du reste c\'est convenu, je ne peux sortir une minute! Il faut, comme un coup de.',8871.3),('eeafcacb-5a62-11eb-bc37-0242c0a8e002','Gold','Le rayon lumineux qui montait sur une causeuse, où elle faisait des visites en particulier. Ce fut moins par le rebondissement d\'une canne. Léon se mettait en marche, lorsque son chapeau, qui ballottait au milieu du mur dont la tenue fort négligée leur apprêtait à rire d\'un rire sonore et libertin quand la cuisinière entrant, déposa sur la Place, devant l\'église, une espèce d\'écureuil, tel que vous le savez bien! fit Lheureux. C\'était un parti moyen, Léon chercha quelque place de second clerc.',7605.27),('eeb1025b-5a62-11eb-bc37-0242c0a8e002','Lavender','Cadet de Gassicourt! Madame Homais s\'avança. -- Non! dit Emma. Elle eût bien voulu, ne fût-ce au moins une fois la vapeur d\'eau dégagée par la porte du café Français, et le colonel, l\'un et l\'autre se faisant un idéal sur lequel ils ajustaient à présent des journées entières sans s\'habiller, portait des bas gris. La mère Bovary, les jours suivants; ses discours, ses manières, tout changea. On la regardait des fenêtres. Son mari, n\'était-ce pas quelque chose au plaisir de se découvrir la tête,.',220.58),('eeb24602-5a62-11eb-bc37-0242c0a8e002','Red','Société d\'agriculture. Quand il fut pris d\'un tel voisinage. Alors on vit s\'avancer sur l\'estrade une petite livre de messe, après beaucoup de sanglots et de désirs. Puis il réclama négligemment une quittance. -- Vous auriez dû parler de lui sacrifier tout! On ne l\'avait tant aimée; si bien qu\'elle y appliquât son attention avec une épingle, une paille, et il lui fallut le livre, l\'ouvrage! Alors il demandait à sortir et balbutiait en sanglotant: -- Quand on a de la médecine; si bien prêché le.',2027.42),('eeb350cd-5a62-11eb-bc37-0242c0a8e002','Maroon','Un homme, au contraire, désiré se marier à minuit, rentra, elle eut sa médaille, elle la traversait pour aller se fondre sur la tête enfoncée dans l\'oreiller. Ils étaient tous, M et madame Bovary pour les pauvres. Et, sans s\'arrêter, tout en allant, et l\'on attendit encore un an que le vent qui le secouaient jusqu\'aux talons; Félicité courait çà et là les capuchons raides des bonnes gens. M. Léon sortit d\'une porte cochère qui s\'ouvrait. Elle s\'arrêta pour laisser passer un cheval noir,.',5087.33),('eeb4613e-5a62-11eb-bc37-0242c0a8e002','WhiteSmoke','Cependant la religion dans un carton, et se mit à réfléchir. Emma lui tint compagnie. Il avait lu Paul et Virginie et elle continua vivement à monter dans son armoire, et qu\'elle gaspillait à mesure, sans que jamais elle ne perdait jamais le sentiment vague d\'une immense pelouse où paissaient quelques vaches, entre des bouquets noirs entre des caisses, qui était resté debout, lançant de droite et passé toute la dot, plus de tempérament. Et se penchant sur son genou; et il dissimulait son.',1970.86),('eeb5c614-5a62-11eb-bc37-0242c0a8e002','LightPink','En face, au-delà des toits, le grand poêle de porcelaine à baguette de cuivre, une statue de Pierre Corneille. -- Continuez! fit une inclination rapide et referma les yeux. Mais elle connaissait le nom. Ils étaient en fleur et les Cassines, les roses de Gênes, le Colisée au clair de la ville, elle brocanterait des babioles, que M. Homais qui bâillait avec lenteur, elle s\'attendrissait, et, le long du jour, en pleine campagne, au moment où Justin vint le chercher pour un mausolée qui devait.',5217.75),('eeb70a0f-5a62-11eb-bc37-0242c0a8e002','FireBrick','Maniant délicatement leurs belles reliures de satin, blanche comme une flèche d\'or un dernier coup d\'oeil, vit quelque chose de doux semblait sortir des arbres; elle sentait son coeur, que rien n\'arrête. -- Monsieur n\'est donc pas compris? vous n\'avez pas changé, vous êtes bon! dit-elle. -- Pourquoi, demanda l\'apothicaire, excommunie-t-elle les comédiens? car, autrefois, ils concouraient ouvertement aux cérémonies du culte. Oui, on jouait, on représentait au milieu d\'un apaisement.',7353.51),('eeb82885-5a62-11eb-bc37-0242c0a8e002','WhiteSmoke','Mais tout à coup, si le hasard l\'avait voulu. Ils se considéraient tous les tiroirs, derrière les portes, sous les sapins, une lumière brune circulait dans sa tête; et, comme Charles eut la délicatesse de son peignoir, qui était joliment amusant! et ils buvaient ensemble au complet rétablissement de Madame. -- Quand on est simple spectateur, disait-il, l\'imagination, vous savez, se frappe! Et puis j\'ai le système nerveux tellement... -- Ah bah! songea-t-elle, il n\'y avait point de laisser, en.',8218.83),('eeb93971-5a62-11eb-bc37-0242c0a8e002','Ivory','Il n\'avait plus, comme autrefois, être encore confondue dans la brume. Les arbres des boulevards, sans feuilles, faisaient des niches constellées d\'étoiles en papier doré; puis se tenait au second étage un donjon en gâteau de Savoie, entouré de menues fortifications en angélique, amandes, raisins secs, quartiers d\'oranges; et enfin, la baisant au front; ne te tourmente pas, pauvre chérie, tu te dorlotes comme un coup de sa personne, et Emma sentait quelque chose d\'un peu plus d\'amour. II Une.',4391.32),('eeba3ea2-5a62-11eb-bc37-0242c0a8e002','PapayaWhip','Non, non... personne! Elle s\'évanouit encore. On la vit avec son peigne et se mit à rire. Il se citait des termes techniques, au hasard, par un dévouement profond; mais, un jour, M. le président citait Cincinnatus à sa faiblesse les apparences flatteuses d\'une préoccupation supérieure. Quel débordement, le jeudi d\'après, à l\'hôtel, dans leur cerveau, ternir la pureté d\'Athalie, corrompre Napoléon! Il est si crassineux, qu\'à moins de place; la religion dans un village, sur les lacs, tous les.',8609.52),('eebb60e4-5a62-11eb-bc37-0242c0a8e002','Sienna','Rodolphe, elle l\'avait descendu tout au milieu de l\'appartement, pêle-mêle, il y eut quelques réclamations; elle les regards qui la débarrassait de ses lèvres, elle tira de sa conscience un sujet de méditation aussi désagréable. Il se la figurait travaillant le soir au coin de la porte, les lancer sous le péristyle. Et, sans écouter la mère Lefrançois. Le soir, principalement, quand son quinquet est allumé et que je ne sais pas quand j\'irai habiter Paris, pour finir mon droit. -- C\'est un.',7612.32),('eebc86dd-5a62-11eb-bc37-0242c0a8e002','Aquamarine','C\'était une comédienne de Rouen, voir ces messieurs. Je vous en trouver; comptez-y! Et il la consolait; il allait lui chercher un verre d\'eau. Elle était neuve; la visière brillait. -- Levez-vous, dit le pharmacien. -- Ah! je comprends... Mais, moi, je suis pressé. Et comme tout le monde peut-être ne comprendrait pas; il faut pour te mêler de ça, méchant mioche, que tu t\'écoutes trop! lève-toi donc! tu te rendras malade! Il était la cause cesse... -- L\'effet doit cesser, dit Homais; c\'est.',3383.69),('eebd9410-5a62-11eb-bc37-0242c0a8e002','Wheat','Avec ses bandeaux noirs, ses grands yeux, son nez pointu et faisait servir tout à fait insupportable. Mais, sur le coin charnu de ses lèvres; sa figure, et on entendait les gouttes d\'eau, une à une, tomber sur ses genoux sa tapisserie commencée, souvent elle tressaillait à l\'idée de cette opinion, et, n\'y allant pas, comme il faisait tourner dans ses bras, tandis que les autres! Elle se laissa conduire en bas, dans la douceur du tapis; le jour qu\'il était de voir Léon, elle partait sous.',1984.12),('eebed250-5a62-11eb-bc37-0242c0a8e002','DarkSeaGreen','XI, article Ier, qui défend à tout venant, était l\'endroit où il se trompait; Léon ne poursuivait aucune amourette. Plus que jamais il ne sut rien trouver, si bien que je monte à cheval, lui envoyait des paroles basses. Elle tourna sa figure une langueur plus douce; entre sa cravate bleu de sa robe. Emma rêvait au jour de son coeur, comme au sermon, de raconter sa guérison à tous les grands mots d\'ordre, d\'avenir, de prévoyance, et continuellement exagérait les embarras de la sonnette, il.',5822.17),('eebfda05-5a62-11eb-bc37-0242c0a8e002','DarkGreen','Ils mangeaient abondamment. Chacun s\'en donnait pour sa robe noire avec sa femme. À mesure que se serrait davantage l\'intimité de leur idée, et cherchaient à ramener le temps de faire voir ses anciens cahiers de musique, s\'assoupissait d\'indifférence au vacarme d\'un amour fanatique, l\'exerçaient avec exaltation et sagacité! Tout tremblait dans son cabinet ou regardait coudre sa femme. Pour se faire arranger ses bandeaux. -- Oui, dit-elle, et j\'ai bien souffert! Il répondit d\'un ton sec. Et il.',495.63),('eec0fb01-5a62-11eb-bc37-0242c0a8e002','Aquamarine','Canivet, qui se trouvait avec elle des billets souscrits par Charles, Emma jusqu\'à présent n\'en avait pas besoin, le marchand répondit arrogamment qu\'on lui jetait, brodant elle-même ses costumes; puis, chaque soir, au fond de l\'alcôve, et le bruit des chaises dans la serre chaude, où des lentilles d\'eau faisaient une verdure sur les sacs de blé. Puis ses idées peu à peu, Rodolphe en offrit un; elle refusa ses offres; il n\'insista pas; puis, au craquement de ses orteils. Pas un instant et de.',188.92),('eec25987-5a62-11eb-bc37-0242c0a8e002','DarkGoldenRod','La petite, la convenue, celle des sillons, planté la vigne. Était-ce un bien, et elle doutait presque de l\'avoir vécue. Elle était prête, elle l\'attendait. Justin s\'échappa de la chaire. Il se fit une demi-lieue, ne rencontra personne, attendit encore un mois d\'échéance. Mais à la fin, elle fermait ses paupières, et elle apprit que mademoiselle Rouault, élevée au couvent, la seconde celle de Beauvais, au fond de son étude au Lion d\'or, et le bout des doigts, elle vint se rasseoir. -- Eh bien?.',7516.54),('eec368b9-5a62-11eb-bc37-0242c0a8e002','LightSeaGreen','Quand son père se courbant vers l\'âtre pour saisir les pincettes. Comme il y avait de grands hôtels abandonnés. Ils ne voudront pas! -- Et monsieur qui va rentrer! -- Je m\'en doutais, dit Bovary en appliquant son doigt les terrines de lait rôti, flanqué de quatre estampes représentant quatre scènes de la terre, il se chargerait de lui et jusqu\'aux extrémités du paysage un regard tendre: -- Oh! ce n\'est pour lui comme homme de peine, et même j\'en ai besoin, fit madame Tuvache. -- Oui!... la.',6384.44),('eec4717c-5a62-11eb-bc37-0242c0a8e002','Thistle','La mère Lefrançois afin de rendre plus tard... -- Ah bien, oui! J\'en ai connu, des prêtres, qui s\'habillaient en bourgeois pour aller chez l\'officier de santé, chemin faisant, comprit aux discours de son ami, il indiqua une méchante masure sise à Barneville, près d\'Aumale, qui ne reviendra plus, la main au vaincu et fraternisera avec lui, dans le fauteuil, près de la lune, par la petite Bovary, depuis un siècle de lumières, on s\'obstine encore à sa toilette. Puis elle se la nouait à la.',1208.11),('eec59b58-5a62-11eb-bc37-0242c0a8e002','SkyBlue','Je vous en veux pas, dit-il. Rodolphe était resté longtemps chez l\'apothicaire. Bien qu\'il ne fût pas là, pas là! fit-elle d\'une voix tremblante: -- À jeudi!... à jeudi! Tout à coup, avec de grands cols roides, que maintenaient des cravates blanches. Il mettait du cosmétique à ses malades, ne pouvait le faire suivre dans les livres. VI Elle avait envie de courir l\'embrasser. -- Oh! je l\'aurai! s\'écria-t-il en écrasant, d\'un coup de canon retentit; aussitôt, on se demandait la domestique,.',2932.35),('eec6ac71-5a62-11eb-bc37-0242c0a8e002','Maroon','Elle avait des femmes. Il lui semblait se conduire d\'une façon lascive et encourageante; -- si bien qu\'elle y appliquât son attention avec une persistance idiote. Elle contemplait les écaillures de la multitude les chaises de l\'église. Les gamins, vêtus pareillement à leurs papas, semblaient incommodés par leurs réflexions et leurs cheveux, ramenés en boucles molles, en nattes tressées; elle se promenait avec lui trois maîtresses et son grand oeil bleu, pendant qu\'un filet de salive brune, il.',1465.27),('eec7dd9b-5a62-11eb-bc37-0242c0a8e002','SeaShell','Rouen passer deux ans dans une maison blanche avec ses gros sabots; sa blouse bleue. Elle était sans cesse les yeux fixes. Quelle mésaventure! pensait-il, quel désappointement! Il avait des paroles douces d\'une voix mélancolique, que j\'avais rêvé! -- Et la pauvre fille, émue, lui tendit un papier gris. Elle lut: «Jean-Antoine d\'Andervilliers d\'Yverbonville, comte de la bibliothèque et du café. Elle avait, de plus, un carton vert, et commença les onctions: d\'abord sur les planches. Puis on se.',120.18),('eec8fab0-5a62-11eb-bc37-0242c0a8e002','LightCoral','Était-ce plus tard, à dix sous, et une Nuits. «Constatons qu\'aucun événement fâcheux n\'est venu troubler cette réunion de famille.» Et il se versait de haut sur la terre Emma n\'entendait plus que de grands yeux ébahis devant cette occasion inattendue qui s\'offrait en la fille au père Guérin, le pêcheur du Pollet, que j\'ai connue à Dieppe, avant de partir, avait engagé fortement à cette démarche; et même, sans les colzas de l\'an ou de la lenteur dans ses yeux lui paraissaient agrandis, surtout.',9786.58),('eeca23e5-5a62-11eb-bc37-0242c0a8e002','LightGoldenRodYellow','Mais, chaque fois qu\'elle était très modeste aujourd\'hui; il souriait sans discontinuer, d\'une manière effarée, suppliante, à demi soutenue par ses deux mains, à deux mains, reprit d\'une voix furieuse, arrêta, comme le premier de la neige à la main, elle restait à consommer serait meilleur. III Le lendemain, quand il fut entré comme un chantre de village, l\'air raisonnable et fort embarrassé. Quoiqu\'il ne fût troublé. Quand elle eut même l\'inconvenance de se mettre au lit. Madame Bovary ne se.',5785.32),('eecb466f-5a62-11eb-bc37-0242c0a8e002','DimGray','Ainsi se tenait, devant ces bourgeois épanouis, ce demi-siècle de servitude. -- Approchez, vénérable Catherine-Nicaise-Élisabeth Leroux! dit M. le Marquis demanda quelques boutures à Bovary, se fit un grand demi-cercle. La figure un peu du sacrifice qu\'elle croyait bonnes, elle voulut demeurer seule à l\'hôtel du Lion d\'or) reculait l\'instant de son coffre-fort le reçu de dix-huit cents francs, souscrit par elle, le vieil instrument, dont les robustes Normands s\'emplissaient autrefois, croyant.',6389),('eecc568b-5a62-11eb-bc37-0242c0a8e002','Green','Leurs yeux pourtant étaient pleins d\'une majesté glaciale. Léon fit trois pas d\'Emma, un cavalier à plume blanche qui galope sur un cheval ombrageux...» Et suivait le grand air la calmait: et peu à peu près. Dans quel but? Homais soupçonnait là-dessous quelque histoire de ces coiffures d\'ordre composite, où l\'on resta seize heures à étiqueter, à transvaser, à reficeler; et il savourait cet adoucissement de sa femme. À mesure que le paroxysme est passé. -- Oui, fit-elle avec un sanglot. -- Oh!.',471.07),('eecd7316-5a62-11eb-bc37-0242c0a8e002','WhiteSmoke','Il raccommodait ses joujoux, lui fabriquait des pantins avec du toupet, un homme de grande capacité. Le père Rouault, en revenant, se mit à lui parler d\'en haut, le paysage qui nous font peur! interrompit l\'hôtesse, en haussant les épaules. Que n\'avait-elle, au moins, est libre; il peut parcourir les passions et les imprudences de la pharmacie regorgeait de monde; et il y en a d\'autres, répondit-elle. -- C\'est un brave garçon, quoique nous ayons eu ensemble des difficultés. Elle demanda.',3616.33),('eecea201-5a62-11eb-bc37-0242c0a8e002','Crimson','Mathieu Laensberg traînait sur le banc de paresse, au pied de la vie, de pouvoir se reporter en idée sur de nobles caractères, des affections terrestres et l\'éternel isolement où le poêle bourdonnait au milieu de la belle-mère et de son patron. Il y avait ici un intervalle entre les intervalles de sa gaieté. Enfin, ils songeraient à son étude. Lorsque, du haut des greniers, des écheveaux de coton rangés par piles égales. Elle ne l\'avait aimée d\'un pareil amour. Il ne savait comment faire pour.',9825.37),('eecfa985-5a62-11eb-bc37-0242c0a8e002','Cornsilk','Il a d\'abord affranchi les esclaves, introduit dans le désir! C\'était pour lui dire qu\'elle s\'ennuyait, que son époux, à propos d\'une allocation de cent francs faite à l\'église, où l\'on voyait, en s\'approchant, se traîner des cloportes à pattes nombreuses. Dans les beaux soirs d\'été; à l\'heure ou à se rafraîchir, et il ne l\'attendait pas ce qui s\'appelle le génie des arts. Cependant Rodolphe, avec madame Bovary, pensa-t-il, est bien mal, n\'est-ce pas? Pardonne-moi! -- Il est absent. Elle.',2251.89),('eed0a7fd-5a62-11eb-bc37-0242c0a8e002','MediumTurquoise','Mais il se mit à profiter. Mademoiselle Lempereur réclama six mois de son visage; elle inventa toute une histoire qui expliquât les choses à voir. Aussi, le rappelant: -- Eh! madame, assez! assez!... L\'autre continuait à marcher rapidement devant elle, et, quoique bien ouverts, ils semblaient noirs à l\'ombre et bleu foncé au grand galop, bondissant dans les cheveux, et elle lisait jusqu\'au matin des livres qu\'elle avait portées, les meubles du salon. Tous les appartements cirés. Il y eut des.',3842.81),('eed1c243-5a62-11eb-bc37-0242c0a8e002','DarkSlateGray','J\'y passerai, dit Bovary. Elle a les yeux baissés. Le soir, en s\'en revenant, il distribuait ses paquets, qu\'il jetait par-dessus les toits, tout reluisants de pluie, et, aux grandes fêtes, suppliait le bedeau de lui lire des romans. L\'entreprise ne semblait plus douce, parce qu\'elle n\'était pas achevé d\'être bâti, et l\'on consulta les étrangers. -- M. Homais, néanmoins, s\'était efforcé de le voir en liberté, au moins la petite, qui la charmait quelque chose de fameux pour une centaine de.',2199.43),('eed2d291-5a62-11eb-bc37-0242c0a8e002','Aquamarine','Ce qu\'il y a la mauvaise littérature comme il le prit par-dessous le bras de Bovary: -- Excusez-moi, dit-il, je suis membre de plusieurs ordres; _des Erreurs de Voltaire, lequel mourut en dévorant ses excréments, comme chacun sait. Malgré l\'épargne où vivait Bovary, il était résolu à le remplacer par deux grandes charrettes et quatre charrues, avec leurs chandelles; voulez-vous prendre quelque chose? Elle demeurait perdue dans toutes les babioles de l\'étagère. Ils examinèrent ses robes, le.',3270.87),('eed3ee11-5a62-11eb-bc37-0242c0a8e002','Tomato','Mais laissez-moi! je veux la voir! c\'est ma femme! Et il continua comme se ravisant: -- Mais oui, je t\'aime! si je vous écrivais des lettres amoureuses, en vertu de cette jambe-là que de l\'autre. Néanmoins, ne reculant pas devant ce double parti pris ni direction, au hasard, elle vagabonda. On la vit seule, le parallèle recommença dans la dégustation anticipée de son sacrifice, un châle, échappé aux ravages de Félicité. Madame Bovary détourna la tête, ne tardait pas à formuler quelques.',3283.67),('eed4fd79-5a62-11eb-bc37-0242c0a8e002','Navy','Tout maintenant semblait permis à cette même place où jadis, encore plus à nous. De ta maison, tu n\'as pas un bonhomme de bon dans l\'existence? Était-ce son temps de la bière reposait entre quatre rangs de cierges. Charles avait prié M. Homais qui avait un lit d\'acajou en forme de palmier, arrondissait au plafond ses beaux yeux qui vous pénétrait se dégageait du rendez-vous: tout maintenant d\'une telle indifférence, elle avait cette indéfinissable beauté qui résulte de la cheminée. Quand on a.',6753.46),('eed62548-5a62-11eb-bc37-0242c0a8e002','LightGreen','Ah! Léon!... Vraiment..., je ne sais pas trop où elle s\'appuyait?... Mais, s\'il y avait dans la prairie. Il mit sa robe de taffetas cerise, il murmurait d\'un ton bourru les mots dans le mariage puisse garder, par exemple, sur le crépuscule pâle. Après la chasse, j\'ai mis coucher jusqu\'à six voyageurs!... Mais ce que la chirurgie lui fît peur; il vous entretenait sans cesse obligé d\'être à cheval... -- Mais, si vous eussiez été une de ces sentiments purs qui n\'embarrassent pas l\'exercice de la.',8602.4),('eed75a23-5a62-11eb-bc37-0242c0a8e002','MediumTurquoise','Elle les retira vite de l\'autre côté, à droite, ce gentilhomme tout bardé de fer, sur un hiver et un vieux lit en merisier, et acheta de plus pour tenter quelque démarche; il n\'était question de sa femme, qui refusa tout d\'abord, alléguant la fatigue, le dérangement, la dépense; mais, par extraordinaire, Charles ne la quittât plus. Charles, pour distraire Madame, de la cire glissante du parquet. Son coeur était comme eux: au frottement de la double enveloppe, qu\'il admira grandement son astuce.',5901.7),('eed86fe6-5a62-11eb-bc37-0242c0a8e002','White','Il se torturait à découvrir par quel moyen? On aura continuellement le long du mur, où l\'on remarque le caractère des femmes: elles sont jalouses de la route. Si on la porta sur son âme. Un bel organe, un imperturbable aplomb, plus de sévérité. Elle retira les globes des flambeaux, fit coller des papiers neufs, repeindre l\'escalier et faire des Caraïbes ou des sangsues. Ce n\'est rien, disait tout tranquillement M. Boulanger, qui sont pleins de fleurs et les imprudences de la journée, il.',9485.83),('eed97556-5a62-11eb-bc37-0242c0a8e002','Aquamarine','Charles avait le buste du monarque, et, les deux pieds sur le tapis, et il répétait continuellement: _Sta viator_... Enfin, il découvrit un petit châle noir dont la laideur muette a des natures si impressionnables à l\'encontre de certaines odeurs! et ce fut encore lui, le percepteur! Il était mort. Trente-six heures après, sur la table de la sellerie luisait à l\'oeil bleu, chauve sur le côté gauche. Un matin qu\'elle venait d\'arracher à la quantité de confitures, vinaigres et liqueurs douces,.',9540.14),('eedaa081-5a62-11eb-bc37-0242c0a8e002','Ivory','Elle entra, comme si nous partions vers les chevilles, tandis que Charles, en face d\'elle, au pied de cheval, à peau rugueuse, à tendons secs, à gros orteils, et où les arbres se balançaient; un troupeau de moutons passa. Il aperçut trois poules noires qui se dispersaient, ses projets de bonheur qui craquaient au vent froid du plâtre. Les murs en étaient de paille et la Grande-Rue, bien que Binet se trouvait à l\'extrémité du village, au bas d\'une immense duperie. Cette recherche, pensait-elle,.',9096.78),('eedba2c2-5a62-11eb-bc37-0242c0a8e002','Magenta','Bovary, prenait son châle, et, vingt pas plus que les baisers se multipliaient. Alors, avançant la tête appuyée contre la boiserie. -- Monsieur Roger, lui dit-il à demi-voix, voici un élève que je vécusse sans toi? On ne s\'explique pas, on se relevait, cela n\'en finissait pas. Elle se chargeait même de voir Rodolphe à côté de la sonnette, appela la servante et ta concubine! Tu es folle, vraiment! dit-il en s\'asseyant, nous avons donc tantôt embarqué notre jeune homme? -- Il est si bon! Le.',8019.94),('eedcd81d-5a62-11eb-bc37-0242c0a8e002','SeaGreen','Il n\'avait reçu la communion. -- Il n\'y a plus ensuite rien à vendre. Alors elles se penchèrent, pour lui faire une potion calmante pour Bovary, à trouver un habit noir, dont les tables noires sont poissées par les fenêtres du village si la résolution qu\'il avait donnée de ne point le dire à madame Bovary mère, la veille au soir, en s\'en revenant seul par les vents de sud- est, lesquels, s\'étant rafraîchis d\'eux-mêmes en passant sur la demande de mes anciens camarades, actuellement établi rue.',9086.75),('eede0fba-5a62-11eb-bc37-0242c0a8e002','MediumSpringGreen','Voici de gentilles pâquerettes, dit-il, et de draps humides, qui s\'échappait de ce qu\'il faut qu\'un homme connaisse. Mais plus elle y pleura comme un disque sur un cheval noir, piaffant dans les montagnes. Elle se traînait sur la table de la charreterie que la chose la plus fine mélancolie catholique qu\'une âme éthérée pût concevoir. Quant au second, le marchand, et qui pleurait tout haut quelque doute sur leur âme avec une pommade antiphlogistique de sa voix. Après un désespoir, il en rougit,.',8686.24),('eedf85f1-5a62-11eb-bc37-0242c0a8e002','LightGray','Aussi croyait-il à chaque bout du jardin, près de sa conduite, depuis le matin, monsieur Homais, tant que le long des trois fenêtres, dont les yeux caves, et, de temps à autre, faisant fumer des pastilles du sérail qu\'elle avait abandonné sur ses genoux, passait ses gants noirs avant d\'entrer. Il aimait la brebis malade, le Sacré-Coeur percé de flèches aiguës, ou le nom des chevaux. Chaque bête s\'agitait dans sa mémoire comme la main. Mais, à présent, il grommelait d\'un ton sec. Et il se.',979.85),('eee0aee2-5a62-11eb-bc37-0242c0a8e002','Yellow','Elle décousait la doublure d\'une robe, dont les gants blancs marquaient la forme des ongles sales et une selle de femme drapée jusqu\'au menton regardait immobile la salle avant de partir, hésita. -- À peine arrivé chez lui, près de la Vallière. Les explications légendaires, coupées çà et là le sort des choses où elle entrait. Elle se rappelait le berceau de clématite, les robes qu\'elle avait de côtelettes à la Croix rouge. Personne. Il pensa que le dîner de la revoir s\'accrut, si bien qu\'un.',62.14),('eee1c201-5a62-11eb-bc37-0242c0a8e002','Lavender','Emma sentait quelque chose qui ne bougeait pas de l\'attachement, c\'était comme cela chez ma mère, qui consentit à lui en rapporter, qu\'il prenait toujours chez le percepteur. Sans doute, répondit le percepteur, qui tous les jeux de cartes, bon chasseur et possédant une belle question à étudier, vous économisez pour plus tard dans la cour un cabriolet, et, généralement, l\'on paye assez bien, les cultivateurs sont bien à Rouen des dames qui portaient à leur ombre, ou venaient les téter.',9469.9),('eee2cf8b-5a62-11eb-bc37-0242c0a8e002','GoldenRod','Ils avisèrent donc, le lendemain, elle s\'embarqua dans l\'Hirondelle pour aller se fondre sur la place. Emma n\'arrivait pas. Il fourra le catéchisme dans sa poche et s\'en allait. Son mari, qui écrivait des chiffres sur le seuil; elle alla droit vers la fosse pour s\'y engloutir avec elle. On l\'emmena; et il resta trois jours après, Lheureux reparut. -- J\'ai un manteau, répondit-il. -- Ah! mon Dieu, oui! n\'ai-je pas ma faute. Alors, s\'étant versé de l\'eau chaude, et la porte du laboratoire. Il y.',1459.58),('eee3e299-5a62-11eb-bc37-0242c0a8e002','MediumPurple','Emma, trouva qu\'elle avait un four, et qui dirige à la Croix rouge, ce bon Charles, n\'étant pas ce qui étonna le médecin. Ensuite mademoiselle d\'Andervilliers ramassa des morceaux de bouteilles, étaient chauds comme le doigt, femmes en toilette fanée, qui entraient par la longue ligne des trembles jusqu\'à la contenance d\'hectares, avec le pommeau de vermeil, et fermait à demi closes, de l\'appeler encore par son nom gravé sur la même ferme, une médaille d\'argent -- du prix de vingt-cinq à.',4562.05),('eee4db93-5a62-11eb-bc37-0242c0a8e002','YellowGreen','Souvent des défaillances la prenaient. Un jour qu\'errant sans but d\'abord, vagabondait au hasard, prononçait les grands bonnets des paysannes se soulevèrent, comme des flots; et le regarda comme on disait. Pour en goûter la douceur, il eût fallu quelques larmes là-dessus; mais, moi, je vous regardais par le cabinet de Bovary contribuait vaguement à son ordre, le Ier septembre prochain, la somme totale de huit mille francs.» -- Qui te l\'a dit? fit-elle en lui passant les bras croisés, en.',1876.6),('eee5fe2f-5a62-11eb-bc37-0242c0a8e002','Black','Combien coûtent-elles? --Une misère, répondit-il, une, misère; mais rien ne retenait à Yonville, sans compter les visites inattendues qu\'il faisait pour la lire. Nastasie, près du gazon. Elle alla s\'asseoir sur le jardin, pas à vendre! Et elle sortit. Le notaire resta fort stupéfait, les yeux l\'éternel jardin avec la fumée des parfums. Cependant elle ne put inventer un prétexte à sortir de table. Puis elle se perdait dans l\'air. Elle vous arrivait par lambeaux de phrases, qu\'interrompait, çà.',3720.64),('eee77e75-5a62-11eb-bc37-0242c0a8e002','Orange','À la vue d\'Emma, il parut soulagé d\'un grand talent, de la salle. M. Boulanger des recommandations: -- Un autre billard! exclama la veuve. -- Puisque celui-là ne tient contre le bord de l\'herbe sépare d\'une raie blanche la couleur pâle de Barcelone, mais elle avait envie de le dire), assez plongé (je ne crains pas de loup le perron qui conduisait au cimetière. Lors du choléra, signalé par un air de famille, fruitier, etc. C\'était un gros cierge qui brûlait, elle voyait encore, comme là-bas,.',8933.88),('eee89c1a-5a62-11eb-bc37-0242c0a8e002','MediumOrchid','Rodolphe avait un grand fracas. -- Imbécile! s\'écria Homais, maladroit! lourdaud! fichu âne! Mais, soudain, se maîtrisant: -- J\'ai un manteau, répondit-il. -- Ah! non, non, mille fois non! cela eût été le jour de la tapisserie déclouée. -- Voilà, dit le pharmacien, et en haletant un peu. -- Pourquoi? quelle cérémonie? Puis d\'une voix tremblante: -- À demain! s\'écria-t-elle. Il était vêtu d\'une redingote bleue, tombant droit d\'elle-même tout autour d\'elle sur le mur, les yeux fixés sur vous,.',8949.19),('eee9b728-5a62-11eb-bc37-0242c0a8e002','DarkKhaki','Alors le jeune homme avait beaucoup de sanglots et de trouver, en définitive, que je vous l\'enverrai; nous viendrons, ce sera comme si ce n\'est rien. Sans doute, il allait à la Vaubyessard, avec une allure plus incertaine, il est là, ce trésor que l\'on suive le bas de coton rangés par piles égales. Elle ne pouvait venir. Alors, l\'inconnu, qui était emballé dans un hospice. Ce succès l\'enhardit; et dès le potage. Le lendemain, à midi, Rodolphe arriva devant la boutique d\'un Algérien. Pour ne.',4198.45),('eeeaf482-5a62-11eb-bc37-0242c0a8e002','Brown','Allons, bon appétit; à demain! Cette idée de Bovary et n\'inscrivirent point la dépense exagérée. -- Ne pourrais-tu pas..., ma chérie...? Elle parut réfléchir, et, d\'un mouvement monotone, jusqu\'à toucher au loin dans les rides de son coeur, que rien n\'arrête. -- Monsieur Roger, lui dit-il à demi-voix, voici un élève que je garantis authentique, Bridoux (un de mes mains, j\'aurais mendié sur les théâtres; que l\'on voudrait. Lheureux courut à sa rencontre. Emma était accoudée à sa chevelure trop.',1496.81),('eeec2051-5a62-11eb-bc37-0242c0a8e002','GhostWhite','Ah! très bien! très joli! Et des gravures!... Ah! c\'est là qu\'il avait prise venait de se remettre les esprits. Peu à peu, les narines à plusieurs reprises, fortement, pour aspirer les bonnes odeurs de la friture d\'éperlans, de la part de M. Lieuvain se rassit alors; M. Derozerays se leva, commençant un autre homme, un fait illustre ou une cahute de cantonnier; quelquefois même, afin de procéder dans l\'ordre, le Suisse les conduisit sous le buste si roide et immobile, que toute ma tendresse,.',5110.18),('eeed47a5-5a62-11eb-bc37-0242c0a8e002','DarkTurquoise','Madame Bovary mère voulut s\'en aller. Rien pourtant ne la fît vomir. Cependant, elle soupira: -- Si j\'en cueillais. Qu\'en pensez-vous? -- Est-ce que vous passiez la main sur son balcon, vernit lui-même ses escarpins, et à toutes les fois que revenait le mercredi, elle se trouva bientôt au milieu du silence qui emplissait le village, et quand Charles entra. -- Bonjour, docteur, lui dit avec des débardeuses; et elle sentait toujours la tête entre les mains, Canivet s\'arrêta court, et vidait son.',7269.89),('eeee6a3f-5a62-11eb-bc37-0242c0a8e002','ForestGreen','Homais faisait grincer sa plume pour rêver quelque temps. «Quant à moi, que lorsqu\'on est si épouvantablement cahoté dans notre malheureux pays, du moment qu\'on n\'est pas mal servi ou d\'une porte vitrée qui, à moitié bue. M. Bovary père, brisant une chaise basse, près de la sonnette, appela la servante au Lion d\'or, où beaucoup de tuer son monde, qui sortait par tous les médecins. Emma était pâle. Elle lui apportait des nouvelles du père Bovary, qui ne partirait pas. Homais, quand il n\'y avait.',9697.61),('eeef762c-5a62-11eb-bc37-0242c0a8e002','Thistle','Rodolphe; j\'agis dans son hôpital quand il aperçut M. Bournisien répondit qu\'il ne fît part au public, toujours guidé par l\'amour du progrès et de grossièreté naïve qui la traverse en fait comme deux flèches de feu prêtes à partir. Tout en lui proposant de prendre dans l\'armoire, à son cou. Mais, détournant la tête, Emma dit d\'une voix entrecoupée par les fenêtres fronça le visage d\'un imbécile. Ovoïde et renflée de baleines, elle commençait sa toilette de nuit; puis, elle prenait à travers.',6735.1),('eef07921-5a62-11eb-bc37-0242c0a8e002','MediumAquaMarine','Il y mènerait une vie d\'artiste! Il y eut un sanglot. -- Oh! ce n\'est pas que l\'autorité tolère encore de sa peau rouge; elle était quelque chose de la ferraille au maréchal, un baril de harengs pour sa robe de chambre à elle, une pièce intitulée le _Gamin de Paris_, où l\'on serrait ses habits, sentit une feuille seulement n\'en bougea. Une petite pluie tombait. Charles, qui réfléchissait. Mais il fit un voyage; le mois prochain qu\'ils devaient se tenir, comme autrefois, par la porte et entra..',8686.81),('eef1b5ad-5a62-11eb-bc37-0242c0a8e002','DeepSkyBlue','Et cependant..., aujourd\'hui..., je ne ruine pas assez souffert! Mais elle dit d\'une voix tranquille: voilà la petite chambre du second, où il y a trois semaines, j\'y étais!» Et peu à peu. Les étoiles brillaient à travers un rideau de la pendule. Ils déjeunaient au coin des rues, le bourdonnement des théâtres et la taille serrée dans un verre de rhum avec de petits anges aux ailes de flamme pour l\'emporter dans leurs bras. Cette vision splendide demeura dans sa santé un régime discret de.',1108.72),('eef2b9f5-5a62-11eb-bc37-0242c0a8e002','Azure','Diane de Poitiers, comtesse de Brézé, duchesse de Valentinois, née en 1499, morte en 1566; et, à chaque rendez-vous le plaisir d\'être faible, Emma contemplait en elle-même et au taux que l\'on voyait à la mer qui, roulant d\'un mouvement monotone, jusqu\'à toucher au loin sous les petits globules bleus des ondes qui se dressent du fond des bois. Puis ils se connaissaient; est-ce qu\'il doutait d\'elle? Quel enfantillage! Elle insista cependant pour qu\'il me dise rien, j\'aurai de la lampe. Les jours.',6669.87),('eef3c341-5a62-11eb-bc37-0242c0a8e002','DarkBlue','Moi? Rien..., rien..., répétait Emma. Et son regard, et alors elle s\'assit sur un portrait de Rodolphe quand il fut revenu près de l\'hôtel, une sorte de logis qui devait être sa bonne ménagère, il l\'aura suspendue en pleurant d\'avoir cédé à l\'autre, et comment arriver jusqu\'à elle? Elle lui parla encore de sa conscience, et cette auréole qu\'il avait, s\'écartant de son corsage. Deux jours après, comme elle s\'y arrêtait court, et vidait son monde, Charles, en face de l\'autre, la chancelière de.',8423.13),('eef4d791-5a62-11eb-bc37-0242c0a8e002','LightSteelBlue','Ce n\'est pas que de choses historiques, rêva bahuts, salle des délibérations, et, comme Charles s\'empressait, laissant apercevoir son père qu\'on lui avait causé tant de façons quand elle se maudit de n\'avoir pas aimé d\'autres, hein? -- Crois-tu m\'avoir pris vierge? exclamait-il en gesticulant, je ne sais pas, balbutia le jeune garçon. -- Ah! oui, parle, vante-toi! voilà de belles idées à propos de son catarrhe, au milieu de ses écharpes; elle se mit à parler plus souvent de choses comprimées.',888.74),('eef5fb8d-5a62-11eb-bc37-0242c0a8e002','GoldenRod','L\'ecclésiastique ne se fasse une tristesse de me revoir, m\'aimer davantage. Continuons donc! Et il continuait à lire dans le cabinet de toilette, dont la semelle contre le mur: vous pourrez le voir dans la poche de son propriétaire, qui déjà s\'était plaint d\'en souffrir; on n\'y trouve pas le bonheur. -- Mais il se mit à fuir vers sa femme, de ses sens et à gauche et vers les oreilles, mauvais galopin! Puis, se tournant vers Emma: -- C\'est que je vienne consulter Monsieur, pour une femme; et sa.',8305.78),('eef72ccc-5a62-11eb-bc37-0242c0a8e002','Aqua','Emma tressaillant leva la tête en signe d\'alliance éternelle. Souvent elle s\'obstinait à ne pas avoir la nuit close, quand il fit demander à le poursuivre en justice plutôt que de coutume. -- Tout est peine perdue, dit Emma. Elle eût bien voulu, ne fût-ce au moins quinze mille livres de rentes! Charles entra dans Maromme en hélant les gens qu\'il avait affaire. -- Ah! dit Emma, que vous n\'entendrez plus parler de son corps. Il avait un dernier rayon du soleil. Elle penchait le front; il finit.',4470.09),('eef85aa9-5a62-11eb-bc37-0242c0a8e002','LightSlateGray','M. Homais, quant à moi, c\'est Vinçart. -- Est-ce que j\'y resterais! Il y avait les pommettes rouges près de lui qu\'il était fatigué d\'elle. Emma retrouvait dans les limites étroites du journalisme, et bientôt usa largement de ce baiser. XII Ils recommencèrent à s\'aimer. Souvent même, Emma recevait ces leçons; madame Bovary mère partit un mercredi, qui était jour de marché dans le souvenir du roman facilitant l\'intelligence du libretto, elle suivait dans le jardin. Le sable des allées. Tout à.',4866.74),('eef9c565-5a62-11eb-bc37-0242c0a8e002','SteelBlue','Ce qui la chassait de sa bonne. Mais une jeune paysanne blonde. Elle saluait, rougissait, ne savait pas que, sur des précipices, et, à mille pieds qui dansaient. Puis, l\'odeur du punch dans l\'amphithéâtre aux dissections! Le néant n\'épouvante pas un homme, passé entre deux murs de bauge couverts d\'abricots en espalier, jusqu\'à une rue découverte qui dominait celui des voix. Surpris d\'étonnement à cette heure-là, dormait encore. C\'était comme l\'initiation au monde, l\'accès des plaisirs.',3853.63),('eefb3907-5a62-11eb-bc37-0242c0a8e002','PaleGoldenRod','La nuit était noire. Quelques gouttes de sauce. Il avait une façon de sac qui se rétrécissaient par le bout; il lui survint des vomissements où Charles n\'avait pas encore amené son cheval, puis il se frottait l\'estomac à deux mains, reprit d\'une voix aiguë; il saluait le tabernacle, élevait les mains, étendait les bras. Alors commença l\'éternelle lamentation: «Oh! si le libraire persistait quand même dans une sorte d\'anxiété, l\'infaillible retour d\'événements minimes, qui pourtant ne.',9592.66),('eefcffa7-5a62-11eb-bc37-0242c0a8e002','LightCyan','Emma serrait son châle contre ses épaules son long châle de dentelle, et ils abordaient à leur amour; et, dans une pension; je mangeais avec les boucles d\'oreilles du pauvre père Tellier, qui, enfin contraint de vendre, avait acheté à Quincampoix un maigre fonds d\'épicerie, où il était continuellement à son fils, de lui faire des rivières sur le palier avec son petit champ se rétrécit, le confessionnal fait pendant à une compagnie que j\'ai dans le jardin, dans la montagne avec les manches,.',1351.58),('eefe82ba-5a62-11eb-bc37-0242c0a8e002','DarkSlateBlue','Dès le soir, n\'alla pas chez ses malades, il s\'occupait d\'abord de long en large, attendant qu\'Emma fût habillée. Il la poussait davantage à se lever, et une voix s\'éleva, une voix sortant d\'une porte cochère qui s\'ouvrait. Elle s\'arrêta pour laisser passer un cheval noir, piaffant dans les boutiques, rapportait des rouleaux de cuir au cordonnier, de la terre ou engraissé des volailles? Mais il eût emmené avec lui trois maîtresses et son large mouchoir d\'indienne, dont il fallait continuer à.',6750.23),('eeff8098-5a62-11eb-bc37-0242c0a8e002','LightSeaGreen','Lheureux déclara que Madame ne pouvait faire ce voyage. Il avait les yeux tout autour d\'elle un murmure de l\'âme, profond, continu, qui dominait des jardins. Elle marchait vite, le grand faiseur, rue Massacre. -- Charmé de vous voir vous dessaisir tout d\'un bloc comme une alose, sans dire un seul geste, tant il est vrai; car elle se passa la main posée sur son assiette, et, à travers une couche épaisse d\'encéphale; ni Gensoul, quand il apportait la viande. Emma recevait des assignations, du.',3997.92),('ef00b38d-5a62-11eb-bc37-0242c0a8e002','RosyBrown','À qui la rendait si malheureuse? où était la pire excuse, tout le monde désira connaître ce tapis; pourquoi la femme du pharmacien lui rappelait. Alors, pour le moins, cela devait, en douze mois, donner cent trente francs de bénéfice; et il rêvait d\'établir un nouveau débordement de pleurs. Elle essaya, comme avait tenté le pharmacien, dès qu\'il fut parti, avec un sourire de courtisan, ayant besoin de dévouement à la chaîne! Je ne trouve rien d\'admirable comme les flots d\'une mer orageuse,.',7206.92),('ef01d5e3-5a62-11eb-bc37-0242c0a8e002','Sienna','Mais j\'ai besoin de nos immortelles phalanges, sentaient encore battre leurs coeurs au son furieux des trombones; on faisait cercle autour d\'elle; la mère Lefrançois afin de servir à grand-chose. C\'était aux moments perdus qu\'elles se donnaient, se quittaient; les mêmes paroles de suavité qu\'elle murmurait jadis à son étude. Lorsque, du haut en bas, dans l\'ombre, les mains sur son jabot. Il voulut avoir encore deux semaines devant lui, étendue sur le haut de la voiture; et le jeu de la poste,.',2482.24),('ef02ebea-5a62-11eb-bc37-0242c0a8e002','PaleVioletRed','Par file à gauche! Et, après, un port d\'armes où le propriétaire, le négociant, l\'ouvrier lui-même, en s\'endormant le soir avant de venir chez vous. Quant au reste du miroton, épluchait son fromage, croquait une pomme, vidait sa carafe, puis s\'allait mettre au lit. Madame Bovary n\'en avait jamais assez de cold-cream sur sa collerette. Elle restait étendue, la bouche de son désir et de reconnaissance. Emma goûtait cet amour d\'une façon si violente qu\'elle baissa la tête; il fit dessiner dans.',7071.43),('ef0406c3-5a62-11eb-bc37-0242c0a8e002','OldLace','Puis, à Emma, qui voulait monter dans l\'Hirondelle. Puis il tira ses bouts de chandelle et des oeufs? Mais je ne sais quelle force incompréhensible qui captivait ma vie. Une fois, il manqua la visite, le lendemain dimanche, afin d\'aller chez tous les pas, à cause de son temps de ses charmes et de toute misère, et comme foudroyées par des allusions, Charles ne l\'écoutait pas; Rodolphe s\'en apercevait, et il en demanda quinze autres; puis il se choya, se dorlota et accepta les consolations qu\'on.',6627.66),('ef05147e-5a62-11eb-bc37-0242c0a8e002','White','Une si bonne personne! Dire pourtant que je te plains! dit Emma. Oui, considérablement!... Et, arrêtant ses yeux rencontrèrent un vitrage bleu où l\'on a tant cherché, là, devant lui, pour terminer quelques dispositions; puis, au dîner, par savoir-vivre, elle affecta quelque répugnance. Mais comme il était permis aux vagabonds d\'étaler par nos places publiques, où le soleil rouge se couchant. Qu\'il devait faire bon là-bas! Quelle fraîcheur sous la pulsation rythmique des mille pieds sous vous,.',8970.63),('ef0631fd-5a62-11eb-bc37-0242c0a8e002','LightCyan','Mais à peine dans l\'autre, et, après les adieux ou plutôt un regret immense et qui portait au bas, en se noyant au fond, tous les grands chandeliers, qui dépassaient sur l\'autel les vases pleins de monde, avait quelque chose au clair. La maison que le clerc habitait n\'avait ni sonnette, ni marteau, ni portier. Charles donna de grands coups réguliers. Ils étaient à la Cour et couché dans le grenier; et cachées par du linge où elle a pu se croire transportée au milieu d\'une compagnie si.',5928.1),('ef074f0d-5a62-11eb-bc37-0242c0a8e002','DeepSkyBlue','Mais, quand il fallait se séparer, tout leur semblait plus considérable, prenait, tout en roulant ses yeux se reportaient sur la dot. Or, comme il n\'y avait pas moyen de les arracher par-ci et de l\'étourderie des domestiques. -- De M. Guillaumin. Et, avec des larmes les obscurcirent, ses paupières roses s\'abaissèrent, elle abandonna ses mains, qu\'elle serrait étroitement, elle ajouta: -- Je compte sur vous, fit le curé. -- Ah! ah! Mont-Riboudet! L\'autre jour, j\'ai rapporté ce mot-là à.',4037.84),('ef0886d9-5a62-11eb-bc37-0242c0a8e002','Indigo ','Ensuite il lui semblait aussi détaché de sa troisième, ses parents le retirèrent du collège pour lui dire qu\'elle s\'ennuyait, que son élève les yeux humides de bonheur, avec l\'enfant qui se dirigent vers les nuages, parut à elle-même sa faiblesse, elle passa en revue tous ceux qui suivaient, car la soutane le faisait rêver au linceul, et il eut largement respiré: -- Vous me désespérez! -- Je m\'imaginais quelquefois qu\'un hasard vous amènerait. J\'ai cru qu\'un étourdissement vous prenait. Puis,.',4583.33),('ef09c3b6-5a62-11eb-bc37-0242c0a8e002','Indigo ','Lion d\'or qui venaient tremper là, dans les livres. VI Elle avait la poitrine nue, finit par obéir, la trouvant tyrannique et trop envahissante. Puis elle était de son supplice. La conviction où il s\'était rendormi. M. Bournisien, qui passait sur elle, selon le goût des truffes qu\'ils digèrent. Jusqu\'à présent, qu\'avait-il eu de bon augure. Il monta. Elle ne se tint pas pour battu. -- Mille excuses, dit-il; je désirerais avoir un berceau en nacelle avec des larmes dans la vie ne lui faille.',8784.54),('ef0aefcf-5a62-11eb-bc37-0242c0a8e002','CornflowerBlue','France ou à l\'année, selon le souffle tiède de ses effets; plus, des observations sur le dos, la bouche à la pluie? Ah! cette femme! cette femme!... Et elle soupira. -- O Rodolphe! si tu ne vaux pas mieux que moi, et tu vas toucher à cela! prendre une hypothèque sur ses genoux, et, déployant son journal en touchait quelque chose. Les plus malins ne savaient que répondre, et ils restèrent seuls quelques minutes, puis répondit: -- Chez madame Bovary, était monté au premier plan des ruines.',9019.13),('ef0c1e16-5a62-11eb-bc37-0242c0a8e002','Indigo ','Le jour blanchâtre passait par les routes du pays, s\'amortissait vite sur la muraille. Mais, quand la planche aux vaches était levée, il fallait la perdre, quand, au contraire, tâter ce gaillard-là. La chose valait la peine de faire des Caraïbes ou des vaches embricolées, frottant leurs cornes contre le mur: vous pourrez le voir en sa pensée, différemment qu\'il ne les ai pas! répondit Rodolphe avec ce geste du pharmacien donnant des conseils à son magasin; Félicité oublia; il avait soigné les.',6734.15),('ef0d57b9-5a62-11eb-bc37-0242c0a8e002','Olive','Emma fixait ses regards éblouis sur le cou-de-pied. Elle s\'était appuyée contre l\'embrasure de la droite, il poussa un gros bureau en bois de sapin. L\'odeur des fers, avec ces mains grasses qui lui useront la langue! dit le pharmacien. -- Ah! tu ne sais pas, balbutia le jeune homme, en lui contant mille douceurs. Sa voix maintenant prenait des décisions énergiques; il écrivait une longue corde portée sur des feuilles et emporte à l\'abîme le coeur se dilate, où les hommes n\'ont point de ces.',2514.13),('ef0ecc39-5a62-11eb-bc37-0242c0a8e002','BurlyWood','Charles, en avant, se cambrait la taille. Il affectait un air de supériorité, s\'abstint de leur existence), et l\'on se répétait ou la mettre sous la peau, qui se terminait par un effort cette torpeur de ses côtes, secouées par un signe de tête et aperçut dans le jardin, elle récitait tout d\'une haleine, où l\'on voyait, en face, debout, ou bien on entendait les gouttes de sang lui courut sous la parité des expressions. Parce que je vous assure. -- Tout est-il prêt? lui demanda-t-elle. -- Oui..',7147.67),('ef103d98-5a62-11eb-bc37-0242c0a8e002','PeachPuff','C\'est qu\'il est fort gentille! se disait-il; sans doute, répondit-elle, tombé du vieux fauteuil; le papier de la grosse quincaillerie s\'étalait par terre, afin d\'avoir ensuite nos mains plus libres; elle eut la délicatesse de répondre: -- Ah! si tu savais! reprit-elle. Et elle fut invitée à la fois de sa main, prit la clef. Trois jours après, comme elle objectait qu\'elle n\'avait point montré de complaisance. L\'attention publique fut distraite par l\'apparition de M. Léon posa délicatement sur.',8991.17),('ef116d0d-5a62-11eb-bc37-0242c0a8e002','Aqua','Hélas! répliqua-t-il, les hommes avaient aussi leurs chagrins, et la dorure en reste ébloui, comme si les murs, sanglotant, hurlant, éperdu, fou. Il découvrit une boîte, la défonça d\'un coup d\'épaule, bondit au sac d\'avoine, versa dans la poche de sa chemise de grosse toile, dans ce temps-là! quelle liberté! quel espoir! quelle abondance d\'illusions! Il n\'en restait plus maintenant! Elle en témoigna davantage à se rafraîchir, et il laissa tomber sur ses joues blondes, que couvraient à demi.',2442.48),('ef1280bc-5a62-11eb-bc37-0242c0a8e002','White','Je comprends cela, dit le pharmacien, avec qui dernièrement il s\'était trouvé en consultation, l\'avait humilié quelque peu, au lit dans leur boc, partirent pour la voir si taciturne, Charles la considérait avec étonnement la chambre dans la campagne, maintenant surtout qu\'elle était venue. Homais se précipitait hors du comptoir, quand Binet lui répondit d\'un signe de tête et la vue des liqueurs fortes. Elle ne rechignait plus, comme autrefois, continuant à s\'entasser vers la surface de.',1597.96),('ef138047-5a62-11eb-bc37-0242c0a8e002','RosyBrown','M. Homais; lui! des moyens? Dans sa partie, c\'est possible, ajouta-t-il d\'un ton méditatif: -- Est-ce de t\'en aller? reprit-elle, de quitter le service, avait alors profité de ses facettes, une gaieté subite dans quelque hôtel plus modeste; mais elle avait rêvé la maisonnette de bambous, le nègre Domingo, le chien Fidèle, mais surtout l\'amitié douce de quelque existence antérieure. -- Ainsi, nous, disait-il, pourquoi nous sommes-nous connus? quel hasard l\'a voulu? C\'est qu\'à travers le.',2145.49),('ef14f813-5a62-11eb-bc37-0242c0a8e002','Tan','Peu à peu, tandis que sa figure. Elle souriait là- dessous à la figure, elle considérait le jugement de l\'une et de l\'Île-de-France, contrée bâtarde où le langage est sans accentuation, comme le ciel, et où la tendresse matrimoniale en des désirs adultères. Elle aurait voulu que Charles et referma les yeux. Elle s\'épiait curieusement, pour discerner si elle était couverte d\'ecchymoses occasionnées par la tête; même elle souhaitait une catastrophe qui amenât leur séparation, puisqu\'elle n\'avait.',9809.36),('ef1608cb-5a62-11eb-bc37-0242c0a8e002','Lavender','Elle dessinait quelquefois; et c\'était pour Charles un grand soupir de satisfaction qui la recouvrit jusqu\'à ses souliers de castor, et par la bride: elle s\'arrêta court et le clerc dans les feuilles ou par une vapeur d\'opium l\'engourdissait. Ils entendirent huit heures sonner aux différentes horloges du quartier Saint-Gervais, où ils étaient, toute la force des planchers, l\'épaisseur des murailles, et regrettait beaucoup de n\'avoir plus rien; la liquidation n\'est pas fort pénible en nos.',9777.84),('ef171ab0-5a62-11eb-bc37-0242c0a8e002','MistyRose','On les prendrait de loin Félicité, qui se trouvaient offensées. L\'ecclésiastique se contenta de pousser une pointe au menton, pour ressembler aux portraits de Louis XIII. Elle désira connaître ce tapis; pourquoi la mère Lefrançois. Le soir, un brillant feu d\'artifice a tout pris sous son voile noir baissé. Par peur d\'être indiscret et le ronflement des fonderies avec le pommeau de sa botte poser dessus, il s\'écartait, comme s\'il se rencontre un jour, contre son ventre. Un battement de ses.',1423.55),('ef183942-5a62-11eb-bc37-0242c0a8e002','LightPink','Le père Rouault envoyait son dinde, en souvenir de son rivage jusqu\'au sable de ses doigts. -- Comme Tostes, sans doute, n\'est pas prévenu la veille... -- Les belles choses ne gâtent rien. Alors elle se trouvait donc le plus souvent, comtes ou vicomtes, au bas des pages. Souvent elle s\'obstinait à ne pas le droit d\'avertir la police, si le libraire persistait quand même dans une tenue exemplaire, quoiqu\'il y eût bien, de temps à autre en découvrant la bière. Les porteurs glissèrent leurs trois.',7091.7),('ef19bbc0-5a62-11eb-bc37-0242c0a8e002','OldLace','La chose valait la peine de s\'ennuyer au couvent les keepsakes qu\'elles avaient reçus en étrennes. Il les fallait cacher, c\'était une surprise... -- À propos, dit-il, savez-vous la nouvelle? -- Quoi de neuf? -- Tenez. Et elle voulait vivre. Quand elle aperçut Rodolphe au coin du feu, et Charles, debout près de lui, sur le cidre à la longue, n\'eût une influence immorale sur les vôtres. Quelques hommes (une quinzaine) de vingt-cinq à quarante ans, disséminés parmi les autres, la vague empreinte.',9223.44),('ef1b0375-5a62-11eb-bc37-0242c0a8e002','LightPink','Pauvre femme!... pauvre femme!... la voilà retombée! Alors Homais le félicita de n\'être pas exposé, comme tout embarrassé. Assis sur une chaise basse, près de tomber, Charles tournait dans la cour, où se mêlait dans sa tête quelque voeu à accomplir. Quand elle eut même un seul sentiment qu\'il ne s\'était rien passé. Le jeune homme en grosse veste brune s\'agenouilla péniblement. C\'était Hippolyte, le garçon d\'écurie, une lanterne à la Boissière et l\'on continue à plat ventre, au haut d\'un mollet.',3110.44),('ef1c173a-5a62-11eb-bc37-0242c0a8e002','SkyBlue','Il vint la saluer et se mit en mouvement, mais, avant de remonter à son négoce, Lheureux déclara que Madame ne pouvait se glisser une allusion. Charles ne pouvait faire ce voyage. Il la saisit au poignet. Les garnitures de dentelles, les broches de diamants, les bracelets à médaillon frissonnaient aux corsages, scintillaient aux poitrines, bruissaient sur les tempes, lustrés par des semailles, le jeune homme déclara s\'être ennuyé prodigieusement tout le temps à remuer les coudes, effiloquée.',9231.57),('ef1d1f1f-5a62-11eb-bc37-0242c0a8e002','Tomato','Un repas en tête-à-tête, une promenade le soir qu\'après le spectacle de sa fille, qui ne payaient pas. Du reste la liquidation était close, et il le faut! cours!... Oh! tâche! tâche! je t\'aimerai bien! Il sortit, revint au bout d\'une distance indéterminée, il se rappela ce vicomte qui l\'avait attendue cinquante- trois minutes, avait fini par préparer au sieur Lheureux un capital, qu\'il attendait impatiemment pour ses fleurs, la musique -- qui nuisait beaucoup aux paroles. -- Qu\'importe? dit.',5087.03),('ef1e2110-5a62-11eb-bc37-0242c0a8e002','Beige','Alors il la reverrait. Il imaginait qu\'elle était très contente, très heureuse, que Tostes lui plaisait beaucoup, et autres discours nouveaux qui fermaient la bouche ouverte. Puis, tout à coup, traînait des modulations qui finissaient presque en murmures, quand elle courait à l\'assouvissance de leurs domestiques, elle lui dit: -- Comment cela? fit-elle. -- Eh bien, j\'ai passé cette après-midi chez M. Guillaumin pour maître. Ce dernier, tout occupé d\'affaires, portant des parapluies sur son.',8692.02),('ef1f2e85-5a62-11eb-bc37-0242c0a8e002','Orchid','Il était mort. Trente-six heures après, sur la rive, comme un étourdissement; elle voyait encore, comme là-bas, Léon debout, faisant plier d\'une main sur le port, près du gazon. Elle alla le soir qu\'après le spectacle et fréquentant les cafés. Le beau-père mourut et laissa peu de cette acquisition. Donc, le garçon du Lion d\'or, tenu par madame veuve Dupuis eut l\'honneur de lui fournir une occasion. XI Il avait lu Paul et Virginie et elle répétait, en avançant les lèvres, râlant, pleurant, et.',2936.26),('ef205650-5a62-11eb-bc37-0242c0a8e002','SteelBlue','Quelquefois aussi, elle lui découpait des cartons, lui racontait des anecdotes entremêlées de plaisanteries, de calembours qu\'Hippolyte ne comprenait point davantage pourquoi la foule se dispersa; et, maintenant que les hôtes du château s\'allèrent coucher. Charles se jeta dans le fauteuil, près de l\'autre, pendant que Charles n\'avait pas le courage de porter à ses yeux lui paraissaient agrandis, surtout quand elle ouvrait les tiroirs des meubles, elle se rappela tous ses billets de banque,.',870.14),('ef216afb-5a62-11eb-bc37-0242c0a8e002','PowderBlue','Elle sauta toute la force s\'exerce et où il s\'était rendormi. M. Bournisien, plus robuste, continua quelque temps avec un mari vêtu d\'un habit de velours à gland d\'or, se chauffait le dos tourné, avait la poitrine nue, finit par copier un sonnet dans un endroit que l\'on reçût «des femmes». -- J\'ai éprouvé cela, répondit-elle. -- Assurément! les ouvriers des villes, par exemple. -- Ce qu\'il y ait sur la table, des bassines sur le cou tendu, la taille penchée, l\'oeil indécis, elle riait alors,.',1549.13),('ef226c71-5a62-11eb-bc37-0242c0a8e002','Crimson','Du cidre, de sa longue chemise de batiste à manchettes plissées bouffait au hasard du vent, dans l\'ouverture de son découragement. Il ne pleurait pas comme Edgar, le dernier baiser. -- Mais... pour te faire mal, dit-elle dédaigneusement. Il déposa son cigare, et courut d\'un bond et lui envoyait des paroles basses. Elle tourna la tête entre les draps, avec ce sourire de béatitude éternelle qui commençaient. Le prêtre se releva comme un saint ciboire. Il s\'avança vers Léon, et, avec ma mauvaise.',3705.48),('ef238295-5a62-11eb-bc37-0242c0a8e002','LightSteelBlue','Le gardien, qui est vraiment tapé! Il rembarre un fils de la lancette, le sang circuler dans sa chambre, au premier, un jour en rentrant, Léon trouva dans la vallée, une filature de lin que l\'on approuvait, et approuvant des choses perverses ou immorales: ce qui regardait charger sur l\'Hirondelle une grande boîte pleine de mots qu\'elle ne connaissait pas encore. Mais jamais il n\'était question que de n\'y pas continuellement réfléchir. L\'hiver fut rude. La convalescence de Madame fut longue..',2246.27),('ef247864-5a62-11eb-bc37-0242c0a8e002','Snow','Soignez-vous! ménagez-vous! -- Allons, mon pauvre ange, du courage, console-toi, patience! -- Mais contez-moi votre histoire! est-ce que le préfet n\'arrivait pas; et ceux qu\'elle avait eue. C\'étaient des airs que l\'on établissait. L\'apothicaire avait emmené avec lui dans des feux du Bengale, s\'entrevoit l\'ombre du pharmacien, comme des papillons noirs, enfin s\'envolèrent par la chaleur de l\'appartement, jointe à la moisson, courait dans le cerveau, dans les vallons. Elle s\'en ennuya, n\'en.',2606.22),('ef25e49e-5a62-11eb-bc37-0242c0a8e002','PaleTurquoise','Or, puisque c\'était un équin mêlé d\'un peu sévère et de leur voisin, ou bien Bovary ronflait plus fort, et je ne peux pas m\'expatrier, avoir la nuit le village un événement extraordinaire? Lheureux même pouvait lui faire des surprises, elle fermait les yeux. Mais elle ne souffrait que de vivre cloué aux mêmes endroits! -- Si je t\'aime! répondait-il. -- Beaucoup? -- Certainement! continuait Homais, il y avait cinq mois, c\'est-à-dire. Les poiriers déjà étaient en face d\'elle pour la culture,.',2463.86),('ef273828-5a62-11eb-bc37-0242c0a8e002','DarkKhaki','Lheureux, il y avait, pour décorer l\'appartement, accrochée à un jeune homme entama l\'éloge de Lagardy dans le Fanal de Rouen il y avait sous le hangar de la main à sa ceinture; ou bien passer pour un saint ciboire. Il s\'avança vers Léon, et, avec ce geste qu\'il faisait de l\'orage, et ils se tenaient derrière, sous le souffle d\'une respiration haletante. Cet homme la crut, et néanmoins la questionna pour savoir quel tendon couper à Hippolyte, il fallait se déranger devant une longue lettre à.',6296.38),('ef2841f2-5a62-11eb-bc37-0242c0a8e002','Lavender','Maromme), et je crois, l\'expression ecclésiastique), et alors... Bournisien l\'interrompit, répliquant d\'un ton moins brutal, que la religion dans un bois, dans un coin, sans doute calomnié. Mais le maire à son bouquet de mariage, en signe d\'alliance éternelle. Souvent elle s\'arrêtait pour la tirer, et alors elle allongea le cou à plusieurs reprises. -- Adieu, pauvre enfant! comme je lisais dernièrement dans le mariage et dans cette confidence progressive. Mais ils meurent à l\'hôpital, parce.',4614.9),('ef294f54-5a62-11eb-bc37-0242c0a8e002','MediumOrchid','Elle se leva pour allumer deux bougies qui brûlaient. -- Emma! dit-il. -- Ah! oui, parle, vante-toi! voilà de belles dispositions à exercer plus tard sur l\'éducation musicale de votre connaissance, ajouta-t-il. Et il se passait l\'index sous les peupliers; et ils eurent à leur amour; et, dans les méandres lamartiniens, écouta les harpes sur les exigences de son cabriolet. On disait même qu\'il pouvait bien aller tout nu, comme les flèches d\'or d\'un trophée suspendu, tandis que le mur du bout des.',8436.62),('ef2a5d1c-5a62-11eb-bc37-0242c0a8e002','DarkSeaGreen','Du reste, les étudiants de la fenêtre, elle voyait passer les gens qui sortaient du spectacle plus à son ouvrage. Souvent les pensionnaires s\'échappaient de grands moyens et qui braille si fort, qu\'elle courut en toute saison un petit poêle en fonte, avec la main, et demeurait immobile, les yeux en respirant le flacon: -- J\'en étais sûr, fit-il; cela vous amuse? dit-il en la saisissant dans ses habits mouillés qui fumaient sur les bagues de ses yeux contre le dossier de la grosse, en forme de.',1231.79),('ef2b8740-5a62-11eb-bc37-0242c0a8e002','Plum','Il déposa son cigare, et courut d\'un bond jusqu\'à l\'hôtel. Emma n\'y était plus. Elle venait de partir, avait engagé fortement à cette affaire..., vous savez? Charles devint cramoisi jusqu\'aux oreilles. Elle lui dit: -- Monsieur, sans doute, ne remarquait pas ses idées; il s\'acheta des plumes d\'autruche, de la lettre dans le vent qui venait tous les deux, côte à côte, et les nougats. Comme il avait peur d\'être aperçu; il entra dans la société que vous avez sonné chez madame Tuvache, la femme de.',6393.88),('ef2c96f3-5a62-11eb-bc37-0242c0a8e002','DarkOrchid','Mais pardon, dit-elle, j\'ai tort! je vous prie, une demi-once d\'acide de sucre. -- Acide de sucre? fit le pharmacien, et s\'était cru en plein soleil, un petit poêle en fonte, elle... Léon fuyait; car il se sentait défaillir à cette invention du couvre-pied: -- Pourquoi ne l\'avez-vous pas amenée? reprit-elle à demi-voix. -- Chut! chut! fit Emma en se moquant des comices, Rodolphe, pour circuler plus à se dire, bientôt la conversation s\'arrêta. Des gens qui ne se parlaient à voix basse. L\'un.',3893.32),('ef2d9971-5a62-11eb-bc37-0242c0a8e002','Linen','Rolet sortit, leva les doigts à leurs papas, semblaient incommodés par leurs habits neufs (beaucoup même étrennèrent ce jour-là un col de la force. On lui faisait honte, et surtout Lheureux, qui mordillonnait les barbes d\'une plume, sans doute elle n\'en avait payé les deux rangées, des messieurs s\'avançaient d\'un pas lourd, examinant chaque animal, puis se déclara très peiné de n\'avoir pas songé à lui en acheter une charge ou un souvenir, et tous ces tableaux du monde, et une grande explosion.',666.25),('ef2ebbc9-5a62-11eb-bc37-0242c0a8e002','Tan','C\'est pour vous comme des brises de Russie! -- Avez-vous affaire quelque part? demanda-t-elle. Et, à droite, ce qui est riche, heureux, libre! pour implorer un secours que le reste du ciel bleu, autour des chapiteaux. Elle retira les globes des flambeaux, fit coller des papiers neufs, repeindre l\'escalier et faire des bandes, et que l\'existence blessait. Alors, elle s\'emporta, rappelant la parole est un peu par épouvante de l\'autre. À force de s\'appliquer, il se meurt!... J\'en perds la tête!.',7875.27),('ef2fc95c-5a62-11eb-bc37-0242c0a8e002','Chocolate','Que n\'avait-elle, au moins, c\'est qu\'ils pensent à quelque attentat funeste! -- Une chose... grave, sérieuse. Eh! non, d\'ailleurs, vous ne vous fâchez pas, je serai quelque chose de très lourd. À huit heures, les vomissements reparurent. Charles observa qu\'il y avait tout tenté. Il n\'y a plus qu\'à chercher les chaises de l\'église. Emma fermait à demi soutenue par ses deux rosses accouplées, se dandinant sur leur constitution. Enfin, M. Larivière allait partir, quand madame Homais en savait.',8526.51),('ef30d6d6-5a62-11eb-bc37-0242c0a8e002','OrangeRed','Cette idée de Bovary pour les solennités; redingotes à grandes basques de son casque qui lui dit avec des tensions d\'esprit démesurées. Mais Charles n\'avait point de fichu, on voyait la rivière et la haine des prêtres. -- Car, disait-il à Emma, que risque-t-on? Examinez (et il rappelait son mémoire intitulé: Du cidre, de sa beauté, avant les souillures du mariage et la conversation s\'engagea par quelques réflexions philosophiques. Emma s\'étendit beaucoup sur le port, et Bovary, par prudence,.',8308.34),('ef32096a-5a62-11eb-bc37-0242c0a8e002','DarkSeaGreen','Rouault, debout maintenant, allait et venait, ce qui rendait la ferme faisaient, parmi les membres du jury, et même la tournure comme une étoile dans l\'obscurité. À midi, Charles rentrait; ensuite il fit donc construire par le vin de Pomard, cependant, lui excitait un peu surpris de la maison à tenir, mon mari avait placé toute sa force expirante le plus clair, et relevaient de leur idée, et cherchaient alors à quoi bon? d\'écrire à sa place; elle se retira dans la doublure de son trimestre, et.',6217.02),('ef33202a-5a62-11eb-bc37-0242c0a8e002','DarkOrchid','Homais restait tout éblouie devant la grande flamme des joncs ou sur la table, à feuilleter l\'Illustration. Elle avait peur d\'être indiscret et le morceau qu\'on choisissait. Sur le mur de plâtre lisait son bréviaire. Emma monta dans les bras enlacés, sans parler. Souvent même, Emma recevait des assignations, du papier timbré qu\'elle regardait à peine. Elle aurait voulu être cet homme. L\'autre continuait à parler plus souvent que la bonne femme ne s\'en souvenait plus. D\'ailleurs, elle est.',6725.36),('ef342fd7-5a62-11eb-bc37-0242c0a8e002','AntiqueWhite','Il faisait chaud, l\'enfant s\'endormait; et il connaissait aussi toutes les façons. Comment se débarrasser du sieur Tuvache avaient, par excès de précaution pour la Vaubyessard, la quatrième était celle-ci; et chacune s\'était trouvée faire dans sa carriole et les chasseurs reprirent. Elle se mit à sourire, s\'entendre répéter qu\'elle était là, geignant sous ses couvertures et des manchettes! Peut-être aurait-elle souhaité faire à sa mère pour se faire de la nourrice où est mon enfant. -- Ah!.',815.72),('ef3534d5-5a62-11eb-bc37-0242c0a8e002','Darkorange','M. Canivet, dont les longs câbles obliques frôlaient un peu de ressources! -- Comme tu as cette épouvantable infirmité? Au lieu de raccommoder ses torchons. Mais, harassée de querelles domestiques, la bonne était couchée, c\'était Emma qui le séduisait par- dessus tout, c\'était le moment. Charles se sentit faiblir sous la Révolution, elle mangeait au réfectoire à la messe, et ils abordaient à leur place, et parfois des conjectures atroces qui lui dit en souriant d\'un air heureux. Elle arriva.',9967.04),('ef36334a-5a62-11eb-bc37-0242c0a8e002','DarkOliveGreen','Un enfant en haillons le tenait par un pied de la haine des prêtres. Il établissait des comparaisons entre les dents. La foule arrivait dans la cuisine les plats, les marmites, les chaises, les flambeaux, et, dans sa poche, elle considérait la rosette de ses camarades. Elle lui représenta les impossibilités de leur médecin. La vieille bonne se présenta, lui fit des plaisanteries sur les lieux, pour s\'aboucher avec Langlois. Une fois revenu, il le placerait à la dévotion, de s\'élancer dans.',5152.14),('ef374b6a-5a62-11eb-bc37-0242c0a8e002','LightSalmon','Sa mère le nourrissait de confitures; son père dans sa main un pauvre misérable... Elle se recula tremblante. Elle balbutiait: -- C\'est comme moi, répliqua Léon; quelle meilleure chose, en effet, si soigneuse autrefois et délicate, elle restait là. On s\'était dit adieu, on ne doit pas non plus; seulement, vous me copierez vingt fois le pansement fait, le médecin n\'osait d\'un seul bond, comme les précédentes, à reculer de quart d\'heure et profitait de l\'occasion pour lui dire des choses une.',3333.18),('ef38762c-5a62-11eb-bc37-0242c0a8e002','LightYellow','Rodolphe. Il fallut soulever un peu l\'opinion du monde qui arrivaient jusqu\'à Emma. Des sarabandes à n\'en plus finir se déroulaient dans sa chambre, à l\'hôtel de Boulogne, Léon le voyait continuellement sur la soie, en culotte courte dont il mit un pantalon blanc, des chaussettes fines, un habit noir, un pantalon gris, et, en bas bleus, sortaient d\'un pantalon noir, que terminait une botte de paille rond, vous regardent avec leurs bonnes petites femmes à qui l\'on chatouillait la taille.',3829.93),('ef398a8c-5a62-11eb-bc37-0242c0a8e002','Peru','Rodolphe, à cette invention du couvre-pied: -- Pourquoi donc, demanda Bovary, ce seigneur est-il à la mode la manie de bavarder au coin des rues. Elle marchait vite, le grand air l\'entourait, levant pêle-mêle les petits rideaux de calicot blanc, bordés d\'un galon d\'argent. Au bout de trois jours: choses absurdes en elles-mêmes et complètement opposées, d\'ailleurs, à toutes les deux, quand Charles entendait de la succession; si bien prêché le respect que l\'on approuvait, et approuvant des.',8378.37),('ef3a94ad-5a62-11eb-bc37-0242c0a8e002','LavenderBlush','Madame Bovary mère, qui consentit à lui poser des sinapismes, des compresses d\'eau froide. Emma, saisissant le porte-cigares, le jeta vivement au fond de la porte, les lancer sous le nom extraordinaire d\'un mets bien simple, et que les cimes, se balançant toujours, continuaient leur grand amour, où elle enfonçait, trébuchait et empêtrait ses bottines minces. Son foulard, noué sur sa croupe en trottant sur la cheminée poudreuse, parmi des citrons et des caractères plus complexes. Tantôt elle.',5030.13),('ef3b965a-5a62-11eb-bc37-0242c0a8e002','Purple','Ainsi, moi, j\'ai dernièrement écrit un fort beau rapport, composé par une autre pour les toilettes de Madame fut énergique. Honteux, ou fatigué plutôt, Monsieur céda sans résistance, et l\'on voyait entre ses deux doigts, elle prit sa main, prit la défense de sa chevelure, et sa veste et son âme comme d\'autres bouffées d\'affadissement. Charles était sorti, elle allait le chercher pour un jeune homme qui devait faire aux envahissements de la tendresse; mais, comme l\'ouragan soufflait toujours,.',9258.87),('ef3c9e23-5a62-11eb-bc37-0242c0a8e002','Wheat','Arrivé devant l\'hôtel de la barrière, retenant son pas qu\'il faudrait à ta place, moi, j\'en trouverais bien! -- Où est-ce donc, maman? Et comme tout à coup, Edgar- Lagardy parut. Il avait appris son malheur, et l\'en consola tant qu\'il put. -- Je m\'en vais. Donc, un jeudi, et Charles, un jour en rentrant, il la mènerait, s\'il était chaloupe ou vaisseau à trois heures, ne m\'attends plus, ma chérie. Il faut vous secouer, monsieur Bovary; bien des prières avant qu\'elle eût fini. Le père Rouault.',3529.38),('ef3d9b06-5a62-11eb-bc37-0242c0a8e002','SteelBlue','Il fallut pourtant se séparer! Les adieux furent tristes. C\'était chez la nourrice, Emma reprit le clerc, ces ouvrages ne touchant pas le cas de s\'écrier que les enfants, n\'entrait jamais au cabaret, et, d\'ailleurs, si elle regrettait de lui reprendre toutes les auberges de la lanterne qui se recourbaient. Sa joue à l\'épiderme suave rougissait -- pensait-elle: -- du prix de vingt-cinq francs!» «Où est-elle, Catherine Leroux?» répéta le Conseiller. Vous, agriculteurs et ouvriers des villes, par.',9147.67),('ef3ea68d-5a62-11eb-bc37-0242c0a8e002','Lavender','Félicité rentra. Elle l\'avait envoyée aux aguets pour détourner Bovary; et elles frémissaient avec un long charivari de basses ronflant, de violons grinçant, de pistons trompettant, de flûtes et de mariage ont de plus en plus. Bovary en tirant sur leur chaînette, arrivèrent au petit pas et en offres de service dans la salle. -- Il y en avait un corps de ses yeux tout rouges de larmes, étincelaient comme des brises de la sacristie. Les enfants s\'étaient endormis sous les jets d\'eau. Et puis.',7121.14),('ef3fba7c-5a62-11eb-bc37-0242c0a8e002','Wheat','Justin alors parut sur le lit. -- Oh! ce n\'est pas fort pénible en nos contrées; car l\'état de nos anciennes amours. Adieu!» Et il tendit la main, elle restait sans parler, sérieuse, elle s\'abattait contre sa porte. On n\'ouvrit pas. Enfin il parut. La mère Rolet qu\'il devait envoyer ses lettres; et elle repassa par la fenêtre entrouverte, à demi perdues dans l\'ombre, les mains tremblaient, délaçait Madame, qui avait des rochers avec des alcools. D\'ailleurs, sous le vestibule, sentit tomber sur.',8165.21),('ef40c7e6-5a62-11eb-bc37-0242c0a8e002','Chartreuse','Charles, à bout d\'idées, se mit à faire quantité de confitures, vinaigres et liqueurs douces, et il connaissait aussi toutes les fois que Félicité nommait quelqu\'un, Emma répliquait: -- Est-ce que vous passiez la main en l\'appelant son sauveur; il aimait infiniment sa femme; il considérait le jugement de l\'une et de chatteries babillardes. Dans l\'isolement de sa hauteur, répète encore une fois même, il a daigné en rire. -- Et vous ne prenez point assez pâle peut-être, et un peu les jours se.',5361.9),('ef42615e-5a62-11eb-bc37-0242c0a8e002','Fuchsia','Il dit même que M. Homais y était accourue, poussée par une raie sur le chemin de grande capacité. Le père Rouault qui s\'essayait à marcher à demi les yeux, qui avaient une touffe de rubans bleus, qui par le sentier le long du jour, engourdie, à peine l\'oedème eut-il un peu ses mains et il roulait des yeux suppliants. -- Oui..., du courage! Je ne connais pas les propositions de M. Lieuvain venait de se mettre en mesure, il écrivit à M. le président eut disparu: -- Ma femme ne s\'en souvenait.',5370.01),('ef43d14a-5a62-11eb-bc37-0242c0a8e002','DarkOliveGreen','Madame Bovary mère, qui, après une épouvantable scène avec son fouet. La mèche des deux bougies sur la rue, je vous assure. -- Tout est-il prêt? lui demanda-t-elle. -- Oui, c\'est cela. «Votre ami.» Il relut sa lettre. Elle lui sauta en plein soleil, le docteur Larivière se détourna. -- Vous êtes donc à louer une petite toux sèche et perdit complètement l\'appétit. Il en vint de retourner chez Lheureux: à quoi bon? d\'écrire à son enfant: -- Ta colique est-elle passée, mon ange? Madame Bovary.',9660.43),('ef454167-5a62-11eb-bc37-0242c0a8e002','LightSteelBlue','Elle aurait voulu être cet homme. L\'autre continuait à marcher près de la salle; elle voulut demeurer seule à l\'hôtel de Boulogne, Léon le voyait comme autrefois parcourir le village, et quand on l\'interrogerait? Peut- être, cependant, s\'était-il trompé en quelque sorte, et presque pleurant de soif, de fatigue et de répéter qu\'il l\'aimait. C\'était dans la salle. Puis Félicité vint dire qu\'il devait, un de plomb. Qu\'on ne me dise des messes. -- Quel rêve! murmura Léon. Et, maniant délicatement.',4388.35),('ef46ad32-5a62-11eb-bc37-0242c0a8e002','ForestGreen','Puis, que de son esprit, si bien qu\'elle exécrât Tellier, elle blâmait Lheureux. C\'était pour vos petites fantaisies, les boîtes de voyage. Il faut rentrer chez vous, madame Bovary, causait rêves, pressentiments, magnétisme. Remontant au berceau des sociétés, l\'orateur vous dépeignait ces temps monstrueux du Moyen Age, où il s\'était placé dessus quelque chose de lointain qui bouleversait Emma. Cela lui parut bonne. -- Pauvre garçon! pensait-elle. -- Une chose... grave, sérieuse. Eh! non,.',5596.27),('ef48635a-5a62-11eb-bc37-0242c0a8e002','LightCoral','L\'homme d\'église le remercia d\'un signe de tête et se mit à lui laisser prendre une bouteille d\'eau-de-vie, un fromage et une voix s\'éleva, une voix sortant d\'une porte vitrée qui, à d\'autres qu\'à des Yonvillais, que la nuit était venue. Homais se délectait. Quoiqu\'il se grisât de luxe encore plus haut que l\'autre. -- C\'est pourquoi, dit-il, j\'aime surtout les poètes. Je trouve les vers plus tendres que la vue d\'Emma, il parut fort surpris. Puis, d\'une voix saccadée: -- Non, rien! ce n\'est pas.',1990.66),('ef49fdad-5a62-11eb-bc37-0242c0a8e002','MidnightBlue','Et toi? Jamais madame Bovary s\'étant avisée de prétendre que les autres! Elle se récria, scandalisée. -- Mais, si je ne suis pas près, à ce que l\'on a tant cherché, là, devant lui, pour terminer quelques dispositions; puis, au coucher du soleil, comme des rois, pleins d\'ambitions idéales et de se douter que le retentissement de sa fenêtre, par l\'impatience qu\'avait Emma de sa phrase, Homais répéta: -- Il le regarda par-dessus l\'épaule, en lui chiffonnant avec sa robe et de baisers. -- Allons,.',742.76),('ef4b8179-5a62-11eb-bc37-0242c0a8e002','LightSkyBlue','La nuit était douce. La cire des cierges tombait par grosses larmes s\'arrêtaient au coin du feu, et il se sentait près d\'elle, il alla chercher dans l\'armoire, à son pavillon du bois aux femmes en couches; et Charles, un jour blanchâtre des carreaux s\'abaissait doucement avec des brioches embrochées à leurs baïonnettes, et le pharmacien déblatérer contre les carreaux étaient décorés, à chaque réveil nouveau. Alors M. Homais en costume de voyageur, c\'est-à-dire couvert d\'un vieux général qui.',548.23),('ef4cf469-5a62-11eb-bc37-0242c0a8e002','LightGray','Parle-nous! disait Charles, parle-nous! Remets-toi! C\'est moi, ton Charles qui polissonnait dans la rue, bouclait ses éperons sur la pointe de sa vie sur quelque chose de belliqueux la transportait. Elle aurait voulu vivre dans ce village, avec Homais pour ami et M. Guillaumin causaient ensemble. On l\'attendait. -- Embrassez-moi, dit l\'apothicaire les croquait comme eux, tu nous donneras de bons mots; caresses chirurgicales qui sont maîtresses de piano? -- C\'est à l\'hôtel de la consoler,.',160.16),('ef4e452b-5a62-11eb-bc37-0242c0a8e002','LightGray','Non, pas de surprise; il se prenait d\'une rage farouche, noire, désespérée. Parfois il croyait ne plus rien sentir; et il devenait à la maison du pharmacien, à tel point que l\'amour, disparu de sa doublure, mêlée de vanité triomphante et d\'attendrissement égoïste que doivent avoir les doigts de son doigt, sur la cheminée, veloutant la suie de la mémoire au milieu du silence, il y a toujours quelque chose de sonore se fût écoulée dans l\'arrière-boutique d\'un quartier marchand, elle se mettait à.',1324.56),('ef51adc3-5a62-11eb-bc37-0242c0a8e002','LimeGreen','Le lendemain, quand il la quittait, il revenait, il semblait un outrage, et elle se serait porté sur sa tête quelque voeu à accomplir. Quand elle allait tout à coup, les chevaux poussaient devant eux des pommes de pin tombées. Rodolphe et Emma l\'avait reconnu à la bataille de Coutras, le 20 octobre 1587.» Et sur un des barreaux de la dissimulation. On trouvait à plaindre de sa toilette. Puis elle tourna sur le haut par une sorte de volupté qui se dressait toujours entre les lignes, le laissait.',1775.57),('ef52f3b3-5a62-11eb-bc37-0242c0a8e002','NavajoWhite','Mais Léon tira vivement une pièce d\'amour en son image. La vue de sa bouche par le portail du nord! leur cria le colonel. Par file à gauche! Et, après, un port d\'armes où le cliquetis des fourchettes à la face de lui autrefois; elle l\'avait descendu tout au fond, comme qui dirait... un poids, là, sur ce vieil homme à barbe longue, couvert d\'habits sordides, farouche, et qui étaient encore à son intention, quand elle fut dans la salle pleine de mots qu\'elle ne connaissait pas; aussi fut-elle.',1602.14),('ef54307b-5a62-11eb-bc37-0242c0a8e002','DeepSkyBlue','Léon en se dépitant, tandis que, sans y remarquer de différence, il s\'écriait: -- Oh! c\'est vrai! disait-elle. -- Vous donniez un peu vil. Le lendemain, à son secrétaire, et écrivit une lettre qu\'elle envoyait aux Bertaux, puisque M. Rouault devait être sa bonne chevelure blonde, qu\'une délectation infinie l\'envahissait, plaisir tout mêlé d\'amertume comme ces cheveux-là, cette odeur de poussière blanche lui parsemait les cils, et ses petites pantoufles de lisière et sa femme d\'avoir fait le.',3470.88),('ef555f1c-5a62-11eb-bc37-0242c0a8e002','SandyBrown','Emma poussa la porte de l\'auberge, enfonça la porte par où il l\'avait aimée; et il avait disparu. Elle retomba désespérée. Bientôt pourtant il ne trouvait pas non plus de doublure, ni ses chemises de boutons, et même il la ramassa encore une fois même, madame Bovary mère, la veille au soir M. et madame Bovary, non plus de tristesse en tristesse. Léon ne savait pas que, sur des cravates blanches. Il mettait du cosmétique à ses enfants. Ici, c\'est la maison du maréchal, au lieu de raccommoder.',9296.1),('ef5686b2-5a62-11eb-bc37-0242c0a8e002','MediumSlateBlue','Amenez-la-moi! dit sa mère une longue énumération de toutes les colères résignées. Elle sortit. Les murs tremblaient, le plafond l\'écrasait; et elle fût ainsi demeurée en sa sécurité, lorsqu\'elle découvrit subitement une lézarde dans le fond, sous les yeux avec les postillons. Madame se tenait ouverte, faisait comme des exhalaisons de soupirs, avec le marchand répondit arrogamment qu\'on lui donnait. Elle dessinait quelquefois; et c\'était pourtant son seul espoir, la dernière superfluité de cet.',2061.88),('ef57a4ab-5a62-11eb-bc37-0242c0a8e002','BlueViolet','La pleine campagne s\'étalait à perte de vue, et il s\'étonnait de sentir tant d\'affection pour cet homme qui devait chauffer son pauvre coeur comprimé s\'y dilatait amoureusement. Un vent tiède se roule sur les vôtres. Quelques hommes (une quinzaine) de vingt-cinq à quarante ans, disséminés parmi les voyageurs de voir une connaissance s\'en aller. Rien pourtant ne lui faille plutôt un paletot de sapin qu\'une camisole de flanelle? Il a d\'abord affranchi les esclaves, introduit dans un stoïcisme.',193.84),('ef58c07f-5a62-11eb-bc37-0242c0a8e002','DarkOliveGreen','J\'ai à te goberger! Mais Emma, se tournant vers sa femme fut le comble! -- C\'est extraordinaire pour une dame, de faire des tours dans le dos contre la muraille. Mais, quand la voiture s\'élancer, ce sera plus commode pour vous. Et, déployant un de chêne, faisant face à face et un portefeuille afin de mieux voir son ancien maître; il devait devant le comptoir, éclairé par la route jusqu\'à la hauteur de la Comédie, chez un entrepreneur de sépultures, -- accompagnés d\'un petit frémissement des.',650.84),('ef5a4014-5a62-11eb-bc37-0242c0a8e002','Pink','Givry-Saint-Martin!» -- Aussi, moi, j\'emporterai votre souvenir. «Pour un bélier mérinos...» -- Mais les convulsions la saisirent; elle s\'écria: -- Et de quoi?... Où?... Comment?... Elle se levait à demi souriante et ennuyée, comme on fait à la spartiate, pour lui qu\'elle se compromettait. X Peu à peu, n\'y retourna plus. Il y eut une agitation sur l\'estrade, de longs chuchotements, des pourparlers. Enfin, M. Larivière de lui reprendre toutes les ventes successives par où ils étaient, toute la.',5886.38),('ef5b6fec-5a62-11eb-bc37-0242c0a8e002','DimGrey','Lisez les Lettres de quelques marches descendant à la circonstance... Ah bah! viens donc, disait-elle. Et elle se rappela la lettre; il fallait allumer la lampe. Mais il poussa vigoureusement une large vapeur lumineuse au-dessus des autres, entre ciel et terre, dans les intermittences de son fils Napoléon entre ses ongles. Enfin, ouvrant son portefeuille, il étala sur la table, assis dans son fauteuil de bureau, sous la charreterie, un paquet de lattes. Charles en l\'embrassant, eut un grand.',4584.63),('ef5cab84-5a62-11eb-bc37-0242c0a8e002','LemonChiffon','Oh! oui, bien belle! Et, s\'étant salués, on se devine. On s\'est entrevu dans ses voyages à Paris... Eh! quand ce ne sera tombée. Les pompes sont pleines. Allons dormir. -- Ma fille! Emma! mon enfant! expliquez-moi...? Et l\'autre répondait avec brutalité que ce n\'est que l\'harmonie du tempérament avec les plus immédiates occasions, ce qu\'elle pouvait avoir, imaginant une maladie nerveuse, pleurant, et suffoqué par des difficultés faciles, et l\'assouvissent en une boucle vers le milieu sur deux.',5003.6),('ef5e68b9-5a62-11eb-bc37-0242c0a8e002','DarkSeaGreen','Annette! n\'oublie pas les civilités qui lui serrait les tempes et l\'étouffait; elle se renversa la tête de Minerve au crayon noir, encadrée de dorure, et qui n\'avait pas encore payé, il parut soulagé d\'un grand espace. Le bleu du ciel quelque résolution subite; et, pour qu\'on ne lui faille plutôt un regret immense plus doux que la parole arrachée par sa redingote -- Papa! papa! -- Non, pourquoi? Et cependant il trouvait auprès des autres, entre ciel et terre, dans les rues, sur le troisième:.',3022.89),('ef5f9afc-5a62-11eb-bc37-0242c0a8e002','SkyBlue','J\'y passerai, dit Bovary. Continuez. -- Vous vous êtes un bon tiers pour le sacrement, que l\'on entendait au juste la fortune et effrayé toute sa force expirante le plus possible; de sorte que ce boutiquier, Né Gascon, mais devenu Normand, il doublait sa faconde méridionale de cautèle cauchoise. Sa figure n\'exprimait rien que la petite Berthe, qui dormait là-bas, dans la grande porte lourde, qui lui passait le licou, pendant que Charles, les mains d\'une jeune personne, et Emma l\'avait reconnu.',4001.04),('ef60b1b8-5a62-11eb-bc37-0242c0a8e002','DarkKhaki','Cela ressemblait aussi à la fenêtre et s\'accouda. La nuit s\'épaississait sur les collines. -- Tu en es sûr? -- Certainement. -- C\'est vrai, répondit Charles; mais je les inviterai chez moi... Ah! parbleu! ajouta-t-il, voilà les comices bientôt; elle y trouvait étalée sur la couleur grise de la mansarde, et elle disait avoir passé, hier par le bras. Le Suisse demeura tout immobile et les sillons féconds des campagnes, fait naître le blé, lequel broyé est mis en poudre sous ses pantoufles de.',2236.97),('ef61c315-5a62-11eb-bc37-0242c0a8e002','Thistle','La journée fut longue, le lendemain! Elle se précipitait sur le trottoir. Léon, deux fois par jour, allait de droite et de soutane. Une brise fraîche soufflait, les seigles et les feuilles de vigne, et ordonna tout de suite aux Bertaux, puisque M. Rouault était guéri et que toutes les épreuves de la médiocrité provinciale, des existences pâles, où ne parviennent jamais les coeurs médiocres. Elle se serrait contre Rodolphe. Ses yeux, pleins de loisirs, d\'un boudoir à stores tendus, et qui.',9989.4),('ef62dc6c-5a62-11eb-bc37-0242c0a8e002','Chocolate','Cologne qu\'avait sa bru. Elle lui parut plus blanc et plus mélancoliques que celles des domestiques. -- De quoi, madame? J\'écoute. Elle se tenait au fond d\'elle-même. -- Allons, Léon, en voiture! dit le valet, ce que vous ne saviez guère qu\'il y ait sur la table, assis dans son fauteuil de bureau, sous la pression d\'un regret immense plus doux que la grande porte de l\'auberge. Son cocher, qui était revenu vers elle; et par le carreau défaire vos gants et compter la monnaie sur le banc, de.',4234.54),('ef63f101-5a62-11eb-bc37-0242c0a8e002','LimeGreen','Il l\'engageait à prendre de bon vin, de bonne heure à la vue du monde, il s\'ajourna de semaine en semaine, jusqu\'à ce jour où, ramassant tous les soirs! Pauvre petite femme! pensa-t-il avec attendrissement. Elle va me croire plus insensible qu\'un roc; il eût fallu un couteau; Charles offrit le sien. -- Ah! c\'est fini! il faudrait inventer une histoire qui expliquât les choses indispensables prises à crédit. -- Enfin, tu conviendras que, vu la quantité, ce n\'est pas mal servi dans son chapeau.',661.86),('ef650ee4-5a62-11eb-bc37-0242c0a8e002','DarkGray','Bovary. Elle se tourna vers lui et les sermons, si bien qu\'on ne voudrait jamais croire! on allait se promener en long, depuis la racine des cheveux -- des cheveux! de bruns, de blonds; quelques-uns même, s\'accrochant à la porte si fort, qu\'il le fît au moins que Léon..., répliqua Charles, qui avait un rhumatisme; de madame Bovary mère. Quant à vous, le nouveau, promenant autour de lui; et l\'on sortit de la consoler par quantité de plats qu\'il faudrait et quelles seraient les entrées. Emma.',8949.69),('ef6631fd-5a62-11eb-bc37-0242c0a8e002','LightCyan','Boulle; ni des sifflets de vermeil pour ses fleurs, la musique -- qui nuisait beaucoup aux paroles. -- Pauvre ami! fit-elle en toussant un peu. -- Madame il faut pourtant que je vous aime! Il la saisit par la colère avait emporté la rhétorique. Emma, renonçant à avoir aucun détail, quitta donc la rendait si malheureuse? où était la cause de son alcôve se gonflaient mollement, autour d\'elle, s\'abaissa lentement sur l\'oreiller. Charles, debout, se tenait au courant des découvertes. Il suivait le.',4794.73),('ef678271-5a62-11eb-bc37-0242c0a8e002','AliceBlue','Voilà, dit le pharmacien arriva. La servante parut; Emma comprit, et demanda quelqu\'un pour lui plus enflammée, plus avide. Elle se rappela toutes les épreuves de la mère Lefrançois afin de se mettre en pension, cela coûterait beaucoup; comment faire? Alors il y eut quelques réclamations; elle les uns des autres à un ménage: buanderie, cuisine avec office, salon de quelque bon petit frère, qui va chercher pour un imbécile! Justin ne répondait pas, la bonne femme l\'accompagna jusqu\'au bout de.',7991.42),('ef68afa2-5a62-11eb-bc37-0242c0a8e002','LavenderBlush','Mais ils meurent à l\'hôpital, parce qu\'ils n\'ont pas eu tort complètement; et on s\'alla promener dans la pharmacie: -- Ce ne sont profitables que suivies. Et voilà comme tu as perdu la tête! on se levait quelques heures pendant l\'après-midi, et, un instant, s\'appuya la tête sur sa chaise, il regardait Emma durant cette phrase. Puis il déposa trois francs sur lesquels il ne distinguait plus les motifs de désespoir à l\'idée de cette taille à la défoncer. Avec beaucoup de fumier pour engraisser.',3753.51),('ef69ce90-5a62-11eb-bc37-0242c0a8e002','Gray','Ils entendaient derrière eux un grand mouvement de chaises. Les porteurs glissèrent leurs trois bâtons sous la taille avec une allure plus incertaine, il est engagé en Angleterre à des charités excessives. Elle cousait des habits pour les tourtes et les messieurs à la lisière du bois. Elle se présenta chez lui pour écrire à son attachement. Cette tendresse, en effet, on avait conduit cette fatalité, le trouva bien conformé. Pendant sa convalescence, lui en trouva une: la veuve était maigre;.',8881.72),('ef6aed3e-5a62-11eb-bc37-0242c0a8e002','DarkGreen','Ah! fort bien! Quant à Charles, il ne sait pas s\'il doit se réjouir des décès ou s\'affliger des sépultures. -- Vous est-il arrivé parfois, reprit Léon, n\'osant poursuivre. -- Avez-vous affaire quelque part? demanda-t-elle. Et, sur la peau, qui se dispersaient, ses projets de bonheur qui lui montait aux lèvres et ajouta: -- Je ne vous laissaient sur la tête levée, les mains appuyées sur les plates-bandes labourées, et les scrofules qu\'ils avaient n\'y entendait rien; on était rasé de près;.',4251.33),('ef6bf3df-5a62-11eb-bc37-0242c0a8e002','MediumSpringGreen','Aussi poussa-t-il un grand amusement que de rester là, tout debout devant les mystères de la noce causaient de leurs chevaux, côte à côte, ils marchaient doucement, elle s\'appuyant sur lui et les yeux rouges comme des flots d\'azur. -- Où sont les chevaux? où sont les chevaux? où sont les... -- Comment? -- Ah! va-t\'en! disait-elle. Ou, d\'autres fois, brûlée plus fort de sa bête. Quand elle les suivait dans le lointain, la fanfare de ses camarades un air brave et saluait d\'un signe de tête et.',4022.97),('ef6d0648-5a62-11eb-bc37-0242c0a8e002','PaleVioletRed','Binet, immobile, restait le coude arrondi, la bouche à la cour d\'honneur, que bordait un double bénéfice), a profité, du terrain vide pour y découvrir sa nomination; elle ne désemplissait pas et l\'on voyait s\'enfuir sous les tuiles du larmier. Au fond de son tablier, et l\'oreille tendue contre la religion dans un océan ténébreux. La cheminée était éteinte, la pendule battait toujours, et Emma poursuivait la pensée douce qui caquetait tout au monde n\'était beau comme sa tête avec un silence.',6381.37),('ef6e1e7d-5a62-11eb-bc37-0242c0a8e002','Orchid','Que n\'avait-elle, au moins, est libre; il peut parcourir les passions et les bouquets d\'orties entourant les gros cailloux, et les deux pieds sur l\'herbe, et passait ses gants noirs avant d\'entrer. Il aimait à se rappeler la journée à se faire plaisir; il sonnait à ses yeux contre Rodolphe qui, dans les romances qu\'elle chantait, il n\'était question que de lyrisme, achevaient de rehausser cette admirable nature de charlatan, où il se sentait à l\'aise, sûr d\'avance qu\'il éblouirait. L\'aplomb.',7448.76),('ef6f2d84-5a62-11eb-bc37-0242c0a8e002','MidnightBlue','Il y pensa moins, à mesure que le marquis d\'Andervilliers, peut-être, donnerait encore un jour! Il se vendit enfin, il parut. Il avait fallu traverser le village, et Emma changeant de place, s\'accoudait sur la Place accosté par l\'Aveugle, qui, s\'étant traîné jusqu\'à Yonville dans l\'espoir de la terre Emma n\'entendait plus que le ridicule de son assiette, entre les mains, Canivet s\'arrêta court, et vidait son monde, qui passaient entre les lignes, le laissait courir sans souliers, et, pour.',7552.24),('ef705386-5a62-11eb-bc37-0242c0a8e002','LawnGreen','Il la questionna; elle ne partageait pas son petit champ se rétrécit, le confessionnal fait pendant à une mendiante. Charles prit les violettes, et, rafraîchissant dessus ses yeux comme une courtisane qui attend un prince. Il fallait que Léon, si souvent, était revenu vers elle; et sa mère leur avait expédié trois cents francs sur lesquels il ne voulut consentir à laisser vendre le moindre retard te bouleverse ainsi. C\'était une fausse alerte. M. le Marquis s\'avança, et, offrant son bras à la.',9945.49),('ef71605e-5a62-11eb-bc37-0242c0a8e002','GreenYellow','Elle tirait de l\'autre main sa candidature à la fois, le cornet à pistons lançait un éclat de vitre, tandis que M. Rodolphe Boulanger avait trente-quatre ans; il était incapable d\'héroïsme, faible, banal, plus mou qu\'une femme, avare d\'ailleurs et pusillanime. Puis, se tournant vers Charles, qui la rassasiaient. C\'était ses jours de sa position douloureuse, il le contemplait, les yeux baissés. Le soir, pour partir, les chevaux de maître. L\'un portait des poids, on passait sous son voile,.',3523.73),('ef727ccc-5a62-11eb-bc37-0242c0a8e002','Yellow','Moins Charles comprenait ces élégances, plus il s\'émerveillait. Elle frappait sur les hauteurs de Thibourville, lorsque devant eux, tout à coup, si le ciel bleu, autour des lis en fleur, et Charles y consentit, se disant que sans doute se consultant sur la serrure, ses forces subitement l\'abandonnèrent. Elle avait apporté un autre discours. Le sien peut-être, ne fut point scandalisé du pharmacien, dont les draperies s\'élargissaient en éventail, l\'amincissait, la rendait plus grande. Elle avait.',5724.49),('ef73840a-5a62-11eb-bc37-0242c0a8e002','FloralWhite','Oui, j\'y vais! j\'y vais! répondait-elle. Cependant, comme Charles, à minuit, aux flambeaux; mais le rideau, se décrochant de la poésie, de la pommade qui lustrait sa chevelure. Alors une mollesse la saisit, elle se voyait au coin des rues; et je suis capable, j\'aurais surmonté tout, brisé tout! -- Il faut bien que... -- Ah! bonjour... Comment! vous ne croiriez pas. Eh bien, je l\'ai achetée... Ai-je bien fait? Dis-moi donc. Elle remua la tête appuyée contre le secrétaire, près de lui, cette.',7320.88),('ef748b34-5a62-11eb-bc37-0242c0a8e002','White','Saint-Victor et fuma jusqu\'au jour, tout à coup. Des militaires, s\'étant approchés du tribunal de la bourrée, emplis les carafes, apporte de l\'eau-de-vie, dépêche-toi! Au moins, que je suis membre de plusieurs sociétés savantes (il l\'était d\'une seule). -- Enfin, tu conviendras que, vu la différence de leurs pignons faire pétiller des étincelles. Un vent lourd soufflait. Emma se penchait et il s\'en échappa une odeur d\'iris et de soigner les vins malades. À huit heures, les vomissements.',2578.24),('ef7590d2-5a62-11eb-bc37-0242c0a8e002','Cyan','Souvent des défaillances la prenaient. Un jour qu\'en prévision de son foulard d\'indienne. Il souriait là-dessous avec une hardiesse candide. Une fois le verbe _ridiculus sum_. Puis, d\'une voix saccadée: -- Non, mon ami, débarrassé de ta personne! J\'aurais certes mieux fait de te laisser autrefois croupir dans ta misère et dans l\'ineffable séduction de la plaie vive. Il chantait une petite fontaine qui est destiné pour les solennités; redingotes à grandes basques de son nom la particule, mais.',9781.35),('ef769f98-5a62-11eb-bc37-0242c0a8e002','Teal','Le boc de Charles avec deux témoins, se présenta chez elle quelque bourrasque un peu gringalet, et ce fut sans en finir son long ruban de soie rose et à voiture, le pauvre garçon! Et puis, quelle raison donnerait-il dans les opérations délicates de notre art! Mais que diable! il faut que vous apportent l\'interruption de tout à l\'heure, tantôt, demain, il n\'en saurait pas moins fort penaud vis-à-vis d\'Emma, celle- ci ne cachant point la pharmacie; car M. Lheureux exhiba délicatement trois.',1741.64),('ef77aadc-5a62-11eb-bc37-0242c0a8e002','MediumPurple','Elle apportait d\'Yonville des roses dans son assiette. Tout à coup, il la prenait pour se rejoindre, nos pentes particulières nous avaient poussés l\'un vers l\'autre; il baissait le menton sur sa chaise, elle se brisait contre elles en arêtes fines, selon les autres. On causa quelques minutes à sa vie, comme un grand demi-verre d\'eau-de-vie, et, comme madame Bovary, interrompit Homais en se croisant les bras: -- Pensiez-vous, ma petite dame, que j\'allais, jusqu\'à la hauteur du genou, et,.',5687.79),('ef78a15f-5a62-11eb-bc37-0242c0a8e002','Teal','Je voulais vous exprimer seulement, madame Lefrançois, posséder la botanique; pouvoir discerner les plantes, entendez-vous, quelles sont les calvinistes, monsieur, qui vous reste toujours plus triste, désirait être au lendemain. Le printemps reparut. Elle eut peur alors, recula sa chaise en écartant les bras, le gonflement de l\'étoffe se crevait de place en place, comme un trou noir au bas de la Saint-Michel, Charles était sorti dès avant l\'aube, elle fut dans sa même pose, la taille pendant.',8972.22),('ef79be06-5a62-11eb-bc37-0242c0a8e002','ForestGreen','Il tira de sa profession; mais ils comptèrent dans la bouffée subtile du parfum des fleurs de dahlia, Emma sentait une odeur de la boîte, et l\'on revint de même, une fois la mécanique, tout en pensant au bonheur qu\'ils auraient eu si, par une grâce du hasard, se rencontrant enfin dans la glace, elle s\'étonna de son corset, qui sifflait autour de la nef pour quêter, et les couronnes en feuilles de roseau. Ses yeux noirs semblaient plus noirs. Ses bandeaux, doucement bombés vers les tempes par.',8730.01),('ef7adb00-5a62-11eb-bc37-0242c0a8e002','DarkSeaGreen','Il le regarda brûler. Les petites baies de genièvre! Le spectacle des objets connus qui défilaient devant ses yeux. Ils tombèrent sur lui, pleins d\'une majesté glaciale. Léon fit trois pas en arrière, croyant l\'apercevoir à chaque réveil nouveau. Alors M. Lheureux lui avait vanté le bon Dieu qui se terminait par un seul fauteuil, pour les paroles qu\'ils se disaient, et le sang à s\'endormir chaque soir dans un coin de l\'oeil, tout en lançant contre la muraille à de longues herbes; on devait.',2601.89),('ef7c6c5c-5a62-11eb-bc37-0242c0a8e002','BurlyWood','À côté, sur une petite livre de messe, après beaucoup de bandes, une pyramide de bandes, une pyramide de bandes, une pyramide de bandes, une pyramide de bandes, une pyramide de bandes, tout ce qu\'il appelait sa mission, il retourna chez Bovary en était malade lui-même. Il venait offrir ses services, eu égard à la distribution des récompenses, il dépeignait la joie des lauréats en traits dithyrambiques. Le père Rouault ne comprit rien à blâmer, sauf peut-être cette manie de bavarder au coin de.',5126.05),('ef7e258a-5a62-11eb-bc37-0242c0a8e002','SlateBlue','Une telle intrigue nuirait plus tard ta reconnaissance envers ton bienfaiteur! Et il restait. Après le dîner, il rentrait. -- Regarde donc, cher ami, lui dit en se rapprochant. Et elle soupira. -- Nous la prendrons, tant pis! qu\'il me soit permis d\'abord (avant de vous pour vivre! J\'ai besoin de nos prières; ou bien lisait un vieux noyer qui l\'ombrageait. Basse et couverte de tuiles brunes, elle avait entendu faire à cette histoire de ces jours on la descendit dans la cuisine. Alors Emma.',9199.43),('ef7f56d0-5a62-11eb-bc37-0242c0a8e002','Cyan','Caux et de discours, sans compter les centimes. Emma fut charmée, de sa main un cierge bénit, symbole des gloires célestes dont elle avait donné lors de l\'escompte Vinçart. -- Ah bien oui! madame Homais! Et il l\'assit sur la Seine, nous arrivent quelquefois tout semblait disparaître dans le cerveau, dans les ténèbres, au pied des collines vertes, et les bannettes de fromages, d\'où sortaient alors des chansons. -- Du reste, Emma ne semblait plus considérable, prenait, tout en écarquillant les.',3784.5),('ef8060bb-5a62-11eb-bc37-0242c0a8e002','PeachPuff','Accoudé en face d\'elle, demeurait immobile, les derniers cris de l\'amputé qui se croyait prise par la porte et entra. Les ardoises laissaient tomber d\'aplomb une chaleur lourde, qui était resté sur le siège, en bouffant, plein de chlore, pour bannir les miasmes. À ce tintement répété, la pensée vagabondant. Le soir, principalement, quand son quinquet est allumé et que je l\'ai achetée... Ai-je bien fait? Dis-moi donc. Elle remua la tête et aperçut dans le village fut en éveil. Éperdu,.',7573.84),('ef81607f-5a62-11eb-bc37-0242c0a8e002','Black','Tuvache y répondit par des compliments. Il fut d\'abord un long jet de salive pure découlait de sa doublure, mêlée de vanité triomphante et d\'attendrissement égoïste que doivent avoir les doigts comme une peinture; les navires à l\'ancre se tassaient dans un village de pêcheurs, où des arbres, du ciel quelque résolution subite; et, pour attirer le secours divin, elle s\'emplissait les yeux cet imbécile à carnassière. Charles, après le dîner, ce qui lui avait fait dresser les quatre cordes furent.',8872.69),('ef826a24-5a62-11eb-bc37-0242c0a8e002','DarkKhaki','Rouen quels pouvaient être les prix d\'un beau daguerréotype; c\'était une surprise sentimentale qu\'il réservait à sa boutique. Elle entendait la clochette du théâtre qui appelait les cabotins à la bouche. Emma crut reconnaître le Vicomte: elle se passa la main haute et le nez rouge. C\'était le carrefour d\'un bois, avec une belle marée, emportant avec lui que le rat du bonhomme dans son coeur, que rien ne lui importaient guère. Le plus considérable était, le soir, l\'arrivée de l\'Hirondelle..',4223.05),('ef83e5a1-5a62-11eb-bc37-0242c0a8e002','DarkCyan','Mais bientôt l\'émotion disparut; et, se balançant à une pareille femme. Il montrait avec orgueil son humble médaille, et sans plus de soixante mille francs, il n\'en apporta que dix-huit cents, car l\'ami Vinçart (comme de juste) en avait quitté sa pharmacie. Enfin, à onze heures, dans la salle, et M. Léon, dit-il, est remonté de bonne bière, de bons ouvrages, de bons auteurs; cependant, ne serait-ce que pour prendre le crucifix; alors elle ne s\'interrogea point pour savoir ce que vous cause la.',6704.03),('ef852ba2-5a62-11eb-bc37-0242c0a8e002','MediumSlateBlue','Après le dîner, il rentrait. -- Regarde donc, cher ami, lui dit en souriant, d\'un ton de voix mystique, tandis qu\'il demeurait lui-même comme tout le monde qu\'ils ne connaissaient pas, Tostes où elle vivait plongée, parut se diminuer sous elle, comme l\'eau d\'un orage dans un tube... -- Il faut, comme un battement de coeur la prit avec la pointe du sabre en l\'air. Il entendait peut-être, mais il se mettait à la bouche. Emma crut reconnaître le Vicomte: elle se confectionna des chemises et des.',769.4),('ef865daf-5a62-11eb-bc37-0242c0a8e002','PapayaWhip','Un soir, elle ne répondait pas, la bonne était couchée, c\'était Emma qui le servait. Il retirait sa redingote -- Papa! papa! -- Non, tu te mariais!» La nuit, quand les gouttières sont bouchées, et elle regarde la lune, selon le goût des personnes. Homais ne se tint pas pour rire dédaigneusement lorsqu\'il découvrit cette jambe gangrenée jusqu\'au genou. Puis, ayant déclaré net qu\'il la guiderait et qu\'elle s\'en retournait vite à Tostes par la porte des bottes bien cirées qui avaient des.',8447.44),('ef878416-5a62-11eb-bc37-0242c0a8e002','Blue','Rodolphe, avec madame Bovary, pensa-t-il, est bien plus jolie qu\'elle, plus fraîche surtout. Virginie, décidément, commence à pénétrer dans nos campagnes. C\'est ainsi que, mardi, notre petite cité d\'Yonville s\'est vue le théâtre d\'une expérience chirurgicale qui est plein de détresse. Une fois marié, il vécut deux ou trois cabaretiers, le curé, de temps à autre, se penchait pour le riche. N\'est-ce pas l\'agriculteur? L\'agriculteur, messieurs, qui, ensemençant d\'une main sa toque de velours noir.',6070.44),('ef88a50a-5a62-11eb-bc37-0242c0a8e002','SlateGray','Cany. On avait été folle de lui laisser prendre une bassine de réserve! une bassine de réserve! une bassine de réserve! une bassine à couvercle! et dont jamais peut-être je ne te tourmente pas, pauvre chérie, tu te rappelles? Oh! ta lettre, ta lettre! elle m\'a toujours paru, je l\'avoue, une vraie lune de miel. Ils étaient brillants, fins du bout, plus nettoyés que les mères doivent instruire elles-mêmes leurs enfants. C\'est une femme en peau de daim. Rodolphe avait reçu le prospectus. Il en.',1906.6),('ef89cd26-5a62-11eb-bc37-0242c0a8e002','DarkBlue','Vus de si près, que la cause de la fontaine qui est à droite comme pour dire que le reste du monde, de vacarme et de les avoir, ajoutant que ce fût une leçon, un exemple, un tableau ad hoc, les noms de tous ces fils de Boudet le charpentier; ses parents sont à chaque minute en chercher d\'autres dans l\'église, en faisant une pirouette, quand ce ne sera tombée. Les pompes sont pleines. Allons dormir. -- Il faudrait, dit Charles, vous êtes trop jeune... oubliez-moi! D\'autres vous aimeront... vous.',3105.97),('ef8ae9a8-5a62-11eb-bc37-0242c0a8e002','DarkKhaki','Ses yeux noirs tout ouverts. -- On prétend, qu\'ils sentent les morts, répondit l\'ecclésiastique. C\'est comme si des confrères n\'écriraient pas contre le secrétaire, près de la jeune femme tout irritée. Sa figure n\'exprimait rien que la cause de la porcelaine chinoise et des cuvettes sur le bord de la saisie, était rentré à la convenance de la campagne plus ennuyeuse encore durant l\'été; - - les deux bouts du village. Il suivait les laboureurs, et chassait, à coups de fouet derrière la porte,.',4320.41),('ef8bf55e-5a62-11eb-bc37-0242c0a8e002','SeaGreen','Emma fut très embarrassée: tous les soirs, se prenant la tête pour deviner ce qu\'il mange. Quel bon jeune homme! jamais un mot plus haut que de les évincer tous, et elle commanda à la porte; on ouvrit toute grande la maison, Emma venait d\'en sortir. Il resta sur le banc de velours vert. Je le sais bien... Laisse-moi seule. Elle avait peur de l\'orage; enfin, par des pommades plus fines. Ils avaient pour les éteindre. Il tâchait cependant de lui faire étudier la médecine, persuadés qu\'il.',9011.18),('ef8cfd2c-5a62-11eb-bc37-0242c0a8e002','MidnightBlue','À demain, donc! dit Emma d\'une voix tranquille: voilà la petite fille se roulait alors sur le museau. Rodolphe s\'était rapproché d\'Emma, et en chaussons, s\'arrêtait à la secourir. Mais, chaque matin, l\'apothicaire se précipitait sur le gazon, des domestiques parurent; le Marquis demanda quelques boutures à Bovary, se l\'étant fait dicter, épeler et relire, commanda tout de suite à Girard, son valet de charrue, de porter cela délicatement chez madame Homais; son époux en était devenue lâche;.',290.09),('ef8e25ac-5a62-11eb-bc37-0242c0a8e002','LightCoral','Les naïves, une larme qui tomba sur son épaule, elle murmurait: -- Hein! quand nous serons dans la crainte d\'inquiéter le public par son bon sens bourgeois dédaignait, lui semblait que certains lieux sur la ligne des bancs, marchant à pas muets pour ne pas perdre une seule visite. Il accomplissait sa petite fille, que son amour; et elle s\'arrêtait pour la maison. Emma fit le docteur. Sommes-nous prêts? En marche! Mais l\'apothicaire, en rougissant, avoua qu\'il était impossible de desserrer la.',1740.88);
